{"http_status": 200, "account_name": "josip_juratovic", "account_data": {"Name": "Juratovic, Josip", "Partei": "SPD", "id": 738731811380076544, "screen_name": "josip_juratovic", "t0": "20210920-094556.json", "value": "Juratovic, Josip"}, "params": [["query", "from:josip_juratovic"], ["max_results", "100"], ["start_time", "2007-01-01T00:00:00Z"], ["end_time", "2022-04-18T11:59:59Z"], ["tweet.fields", "attachments,author_id,context_annotations,conversation_id,created_at,entities,geo,id,in_reply_to_user_id,lang,possibly_sensitive,public_metrics,referenced_tweets,reply_settings,source,text,withheld"], ["expansions", "author_id,referenced_tweets.id,referenced_tweets.id.author_id,entities.mentions.username,attachments.poll_ids,attachments.media_keys,in_reply_to_user_id,geo.place_id"], ["media.fields", "duration_ms,height,media_key,preview_image_url,public_metrics,type,url,width"], ["place.fields", "contained_within,country,country_code,full_name,geo,id,name,place_type"], ["poll.fields", "duration_minutes,end_datetime,id,options,voting_status"], ["user.fields", "created_at,description,entities,id,location,name,pinned_tweet_id,profile_image_url,protected,public_metrics,url,username,verified,withheld"]], "response": {"data": [{"conversation_id": "1513910648601784328", "created_at": "2022-04-12T16:03:21.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513910651785289734", "referenced_tweets": [{"type": "replied_to", "id": "1513910650338254857"}], "text": "Nationalisten treiben uns im Gegensatz zu Demokraten zwangsl\u00e4ufig fr\u00fcher oder sp\u00e4ter in den Krieg. Deshalb muss unsere Devise f\u00fcr die Weiterentwicklung auf dem Westbalkan \u201e#Demokratie statt #Stabilokratie\u201c lauten. (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 5, "quote_count": 0}, "entities": {"hashtags": [{"start": 172, "end": 183, "tag": "Demokratie"}, {"start": 190, "end": 204, "tag": "Stabilokratie"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1513910648601784328", "created_at": "2022-04-12T16:03:20.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513910650338254857", "referenced_tweets": [{"type": "replied_to", "id": "1513910648601784328"}], "text": "Denn der Angriffskrieg auf die Ukraine zeigt uns, wie wichtig #Frieden und #Stabilit\u00e4t auf dem Westbalkan auch f\u00fcr unsere #Sicherheit in Europa sind. Deshalb muss der Kampf gegen #Korruption und #Nationalisten in den Fokus ger\u00fcckt werden. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 3, "reply_count": 1, "like_count": 5, "quote_count": 0}, "entities": {"hashtags": [{"start": 62, "end": 70, "tag": "Frieden"}, {"start": 75, "end": 86, "tag": "Stabilit\u00e4t"}, {"start": 122, "end": 133, "tag": "Sicherheit"}, {"start": 179, "end": 190, "tag": "Korruption"}, {"start": 195, "end": 209, "tag": "Nationalisten"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1513910648601784328", "created_at": "2022-04-12T16:03:20.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513910648601784328", "text": "Welche Ziele verfolgt die Ampel-Regierung f\u00fcr den Westbalkan? Zu diesem Thema habe ich beim #IFIMES (International Institute for Middle East and Balkan Studies) gesprochen und klar gemacht, dass wir die #demokratischen Kr\u00e4fte auf dem #Westbalkan st\u00e4rken m\u00fcssen. (1/3) https://t.co/aGqnpJmjZ2", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 5, "like_count": 14, "quote_count": 0}, "entities": {"hashtags": [{"start": 92, "end": 99, "tag": "IFIMES"}, {"start": 203, "end": 218, "tag": "demokratischen"}, {"start": 234, "end": 245, "tag": "Westbalkan"}], "urls": [{"start": 268, "end": 291, "url": "https://t.co/aGqnpJmjZ2", "expanded_url": "https://twitter.com/josip_juratovic/status/1513910648601784328/photo/1", "display_url": "pic.twitter.com/aGqnpJmjZ2"}]}, "attachments": {"media_keys": ["3_1513910646571769856"]}, "lang": "de"}, {"conversation_id": "1513811429870252039", "created_at": "2022-04-12T09:29:05.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513811432512626690", "referenced_tweets": [{"type": "replied_to", "id": "1513811431174684675"}], "text": "Gerade Putins Angriffskrieg auf die Ukraine zeigt uns, wie wichtig #Frieden und #Stabilit\u00e4t auf dem Westbalkan auch f\u00fcr unsere #Sicherheit in Europa ist. (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 5, "quote_count": 0}, "entities": {"hashtags": [{"start": 67, "end": 75, "tag": "Frieden"}, {"start": 80, "end": 91, "tag": "Stabilit\u00e4t"}, {"start": 127, "end": 138, "tag": "Sicherheit"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1513811429870252039", "created_at": "2022-04-12T09:29:05.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513811431174684675", "referenced_tweets": [{"type": "replied_to", "id": "1513811429870252039"}], "text": "Seit Sonntag bin ich zu Gespr\u00e4chen auf dem Westbalkan und die Worte von Olaf Scholz werden hier mit Hoffnung verbunden. Der Berliner Prozess muss jetzt neu belebt werden, um allen Staaten auf dem Westbalkan endlich eine echte #EU-Beitrittsperspektive zu geben! (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 2, "like_count": 6, "quote_count": 0}, "entities": {"hashtags": [{"start": 226, "end": 229, "tag": "EU"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}], "lang": "de"}, {"conversation_id": "1513811429870252039", "created_at": "2022-04-12T09:29:04.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513811429870252039", "text": "\u201eDer westliche Balkan und dessen Integration in die Europ\u00e4ische Union ist mir sehr wichtig.\u201c Ich begr\u00fc\u00dfe es sehr, dass #Bundeskanzler Olaf Scholz gestern betont hat, dass der #Westbalkan Teil #Europas und Teil der europ\u00e4ischen Familie ist. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 9, "quote_count": 0}, "entities": {"hashtags": [{"start": 119, "end": 133, "tag": "Bundeskanzler"}, {"start": 175, "end": 186, "tag": "Westbalkan"}, {"start": 192, "end": 200, "tag": "Europas"}]}, "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}], "lang": "de"}, {"conversation_id": "1511658189946822657", "created_at": "2022-04-06T10:52:53.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1511658192710868996", "referenced_tweets": [{"type": "replied_to", "id": "1511658191192535043"}], "text": "Putins Angriffskrieg auf die Ukraine zeigt uns deutlich: Die #Sicherheit der L\u00e4nder auf dem #Westbalkan ist auch unsere eigene Sicherheit. Meine Rede k\u00f6nnt ihr im Livestream des Bundestages verfolgen (ab ca. 16:30 Uhr) oder findet ihr morgen dann auch hier. (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 7, "quote_count": 0}, "entities": {"hashtags": [{"start": 61, "end": 72, "tag": "Sicherheit"}, {"start": 92, "end": 103, "tag": "Westbalkan"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1511658189946822657", "created_at": "2022-04-06T10:52:52.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1511658191192535043", "referenced_tweets": [{"type": "replied_to", "id": "1511658189946822657"}], "text": "Wir m\u00fcssen endlich Lehren aus dem politischen #Versagen der L\u00e4nder auf dem Westbalkan \u2013 aber auch der westlichen Welt \u2013 ziehen, und allen L\u00e4ndern auf dem Westbalkan eine echte #EU-Beitrittsperspektive er\u00f6ffnen. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 6, "quote_count": 0}, "entities": {"hashtags": [{"start": 46, "end": 55, "tag": "Versagen"}, {"start": 176, "end": 179, "tag": "EU"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1511658189946822657", "created_at": "2022-04-06T10:52:52.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1511658189946822657", "text": "In diesen Tagen vor 30 Jahren begann die Belagerung von #Sarajevo und die Konflikte auf dem #Westbalkan gipfelten in einem jahrelangen #Krieg mit unvorstellbaren #Gr\u00e4ueltaten. Bei der heutigen Debatte im Bundestag Gedenken wir den Opfern dieses Krieges. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 8, "reply_count": 6, "like_count": 37, "quote_count": 0}, "entities": {"hashtags": [{"start": 56, "end": 65, "tag": "Sarajevo"}, {"start": 92, "end": 103, "tag": "Westbalkan"}, {"start": 135, "end": 141, "tag": "Krieg"}, {"start": 162, "end": 174, "tag": "Gr\u00e4ueltaten"}]}, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "lang": "de"}, {"conversation_id": "1509860230255026179", "created_at": "2022-04-01T11:48:25.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1509860232511557633", "referenced_tweets": [{"type": "replied_to", "id": "1509860230255026179"}], "text": "Nur im #internationalen #Schulterschluss werden wir langfristige Stabilit\u00e4t und Frieden \u2013 auch f\u00fcr uns hier in Deutschland \u2013 sichern! Herzlichen Dank an den Gastgeber Ahmed Mohamed Aljarwan, den Pr\u00e4sidenten der GCTP. (2/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 2, "quote_count": 0}, "entities": {"hashtags": [{"start": 7, "end": 23, "tag": "internationalen"}, {"start": 24, "end": 40, "tag": "Schulterschluss"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "6", "name": "Sports Event"}, "entity": {"id": "1103026158382141440", "name": "Tokyo 2020 Summer Olympics", "description": "Tokyo 2020 Summer Olympics "}}, {"domain": {"id": "11", "name": "Sport", "description": "Types of sports, like soccer and basketball"}, "entity": {"id": "839543534990446592", "name": "Handball"}}, {"domain": {"id": "11", "name": "Sport", "description": "Types of sports, like soccer and basketball"}, "entity": {"id": "1390689133094342662", "name": "Olympic Handball"}}], "lang": "de"}, {"conversation_id": "1509860230255026179", "created_at": "2022-04-01T11:48:25.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1509860230255026179", "text": "Am letzten Wochenende war ich bei der Parlamentariersitzung des Global Council for Tolerance and Peace (#GCTP) in Dubai und Abu Dhabi. Gemeinsam mit den Parlamentariern aus \u00fcber 50 Staaten haben wir ein deutliches Zeichen f\u00fcr #Toleranz und #Frieden weltweit gesetzt. (1/2) https://t.co/nCUQoz31Si", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 3, "like_count": 3, "quote_count": 0}, "entities": {"hashtags": [{"start": 104, "end": 109, "tag": "GCTP"}, {"start": 226, "end": 235, "tag": "Toleranz"}, {"start": 240, "end": 248, "tag": "Frieden"}], "urls": [{"start": 273, "end": 296, "url": "https://t.co/nCUQoz31Si", "expanded_url": "https://twitter.com/josip_juratovic/status/1509860230255026179/photo/1", "display_url": "pic.twitter.com/nCUQoz31Si"}]}, "attachments": {"media_keys": ["3_1509860225586810887"]}, "lang": "de"}, {"conversation_id": "1507040544417013768", "created_at": "2022-03-24T17:04:00.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1507040546430369792", "referenced_tweets": [{"type": "replied_to", "id": "1507040544417013768"}], "text": "Deshalb gilt es nach wie vor die Nationalisten auf allen Seiten zu isolieren, und durch die aktive Unterst\u00fctzung von Netzwerken der Demokraten in der gesamten Region den lang versprochenen Weg in die #Mitgliedschaft der #Europ\u00e4ischen Union umzusetzen. (2/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 200, "end": 215, "tag": "Mitgliedschaft"}, {"start": 220, "end": 233, "tag": "Europ\u00e4ischen"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1507040544417013768", "created_at": "2022-03-24T17:03:59.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1507040544417013768", "text": "Heute konnte ich mich noch mit Manuel Sarrazin austauschen. Er ist der neue #Sonderbeauftragte der Bundesregierung f\u00fcr den #Westbalkan. Wir sind uns einig, dass es in der jetzigen Situation besonders wichtig ist, f\u00fcr #Stabilit\u00e4t auf dem Westbalkan zu sorgen. (1/2) https://t.co/4brLJjZ97y", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 7, "quote_count": 0}, "entities": {"hashtags": [{"start": 76, "end": 94, "tag": "Sonderbeauftragte"}, {"start": 123, "end": 134, "tag": "Westbalkan"}, {"start": 217, "end": 228, "tag": "Stabilit\u00e4t"}], "urls": [{"start": 265, "end": 288, "url": "https://t.co/4brLJjZ97y", "expanded_url": "https://twitter.com/josip_juratovic/status/1507040544417013768/photo/1", "display_url": "pic.twitter.com/4brLJjZ97y"}]}, "attachments": {"media_keys": ["3_1507040534182965249"]}, "lang": "de"}, {"conversation_id": "1505945933665742856", "created_at": "2022-03-21T16:34:25.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1505945937545420801", "referenced_tweets": [{"type": "replied_to", "id": "1505945935792287747"}], "entities": {"mentions": [{"start": 19, "end": 31, "username": "NancyFaeser", "id": "620221740"}], "hashtags": [{"start": 103, "end": 115, "tag": "Rechtsstaat"}, {"start": 153, "end": 164, "tag": "Pr\u00e4vention"}]}, "text": "Ich bin froh, dass @NancyFaeser mit ihrem Aktionsplan gegen Rechtsextremismus sowohl auf einen starken #Rechtsstaat setzt, aber auch einen Fokus auf die #Pr\u00e4vention legt. Denn Rassismus k\u00f6nnen wir nur gemeinsam bek\u00e4mpfen! (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 8, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1505945933665742856", "created_at": "2022-03-21T16:34:24.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1505945935792287747", "referenced_tweets": [{"type": "replied_to", "id": "1505945933665742856"}], "text": "Wir stehen f\u00fcr ein buntes und #tolerantes Deutschland, dass aus seiner #Vielf\u00e4ltigkeit Kraft zieht. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 8, "quote_count": 0}, "entities": {"hashtags": [{"start": 30, "end": 41, "tag": "tolerantes"}, {"start": 71, "end": 86, "tag": "Vielf\u00e4ltigkeit"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1505945933665742856", "created_at": "2022-03-21T16:34:24.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1505945933665742856", "text": "Heute ist internationaler Tag gegen Rassismus. Rassismus beginnt nicht mit Gewalt, sondern resultiert in ihr. Deshalb m\u00fcssen wir uns in unserem eigenen Umfeld entschieden gegen Rassismus stellen und als Gesellschaft klar machen: Nicht mit uns! #TagGegenRassismus (1/3) https://t.co/BHCYRliSJT", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 4, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 244, "end": 262, "tag": "TagGegenRassismus"}], "urls": [{"start": 269, "end": 292, "url": "https://t.co/BHCYRliSJT", "expanded_url": "https://twitter.com/josip_juratovic/status/1505945933665742856/photo/1", "display_url": "pic.twitter.com/BHCYRliSJT"}]}, "attachments": {"media_keys": ["3_1505945920982167553"]}, "lang": "de"}, {"conversation_id": "1505857857702580224", "created_at": "2022-03-21T10:44:25.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1505857857702580224", "text": "#Inklusion bedeutet f\u00fcr mich, dass alle ihre Tr\u00e4ume verfolgen k\u00f6nnen \u2013 und zwar in der Mitte der Gesellschaft! Mit der #LotsOfSocks-Kampagne setzen heute am Welt-Down-Syndrom-Tag viele Menschen ein Zeichen f\u00fcr eine bunte und inklusive Gesellschaft!\n\n\ud83d\udcf8: Paul Alexander Probst https://t.co/Y4xjTU4x22", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 2, "like_count": 9, "quote_count": 0}, "entities": {"hashtags": [{"start": 0, "end": 10, "tag": "Inklusion"}, {"start": 119, "end": 131, "tag": "LotsOfSocks"}], "urls": [{"start": 275, "end": 298, "url": "https://t.co/Y4xjTU4x22", "expanded_url": "https://twitter.com/josip_juratovic/status/1505857857702580224/photo/1", "display_url": "pic.twitter.com/Y4xjTU4x22"}]}, "attachments": {"media_keys": ["3_1505857851058761728"]}, "lang": "de"}, {"conversation_id": "1504804671977889794", "created_at": "2022-03-18T12:59:26.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1504804673655648259", "referenced_tweets": [{"type": "replied_to", "id": "1504804671977889794"}], "text": "Putins Angriffskrieg hat in den vergangenen Tagen deutlich gezeigt, dass die #EU-Beitrittsperspektive auch zu unserer eigenen #Sicherheit jetzt mit Nachdruck verfolgt werden muss. Herzlichen Dank f\u00fcr den guten Austausch. 2/2", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 13, 