Mai w\u00e4hlt ein Gro\u00dfteil der Betriebe einen neuen #Betriebsrat. Die betriebliche Mitbestimmung hat unser Land vorangebracht und ist Teil unseres wirtschaftlichen Erfolgs. Ich rufe daher alle Arbeitnehmer*innen dazu auf, sich an den #Wahlen zu beteiligen. (1/2) https://t.co/cF3sfw39O1", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 17, "quote_count": 0}, "entities": {"hashtags": [{"start": 70, "end": 82, "tag": "Betriebsrat"}, {"start": 252, "end": 259, "tag": "Wahlen"}], "urls": [{"start": 281, "end": 304, "url": "https://t.co/cF3sfw39O1", "expanded_url": "https://twitter.com/josip_juratovic/status/1498687338456694787/photo/1", "display_url": "pic.twitter.com/cF3sfw39O1"}]}, "attachments": {"media_keys": ["3_1498687322967232518"]}, "lang": "de"}, {"conversation_id": "1497987619132788741", "created_at": "2022-02-27T17:30:56.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987628590936068", "referenced_tweets": [{"type": "replied_to", "id": "1497987627164835842"}], "text": "Wir wissen nicht, wie gro\u00df der Hunger von Putin ist und wann unsere eigene Sicherheit in Gefahr ist. Somit m\u00fcssen wir verinnerlichen, dass wir f\u00fcr unsere #Freiheit #Opfer bringen m\u00fcssen. (7/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 6, "quote_count": 0}, "entities": {"hashtags": [{"start": 154, "end": 163, "tag": "Freiheit"}, {"start": 164, "end": 170, "tag": "Opfer"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}, {"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "86493112613