7987624195313667", "referenced_tweets": [{"type": "replied_to", "id": "1497987622752428039"}], "text": "Dennoch k\u00f6nnen wir es keinesfalls hinnehmen, dass Russland mitten in Europa #Krieg f\u00fchrt und die Souver\u00e4nit\u00e4t und Integrit\u00e4t seiner Nachbarn in Frage stellt und milit\u00e4risch angreift. (4/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 76, "end": 82, "tag": "Krieg"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1497987619132788741", "created_at": "2022-02-27T17:30:55.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987622752428039", "referenced_tweets": [{"type": "replied_to", "id": "1497987621175316486"}], "text": "Mit harten #Sanktionen, #humanit\u00e4rer Hilfe und #Waffenlieferungen zeigen wir der Ukraine unsere Solidarit\u00e4t und stehen ihr geschlossen und entschlossen zur Seite. Wir sind uns bewusst, dass uns die Sanktionen am Ende auch selbst wehtun werden. (3/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 5, "quote_count": 0}, "entities": {"hashtags": [{"start": 11, "end": 22, "tag": "Sanktionen"}, {"start": 24, "end": 36, "tag": "humanit\u00e4rer"}, {"start": 47, "end": 65, "tag": "Waffenlieferungen"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}, {"domain": {"id": "123", "name": "Ongoing News Story", "