at": "2022-02-27T17:30:54.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987619132788741", "entities": {"mentions": [{"start": 17, "end": 31, "username": "Sondersitzung", "id": "927261091910078465"}, {"start": 46, "end": 56, "username": "Bundestag", "id": "3088296873"}]}, "text": "Bei der heutigen @Sondersitzung des Deutschen @Bundestag haben alle demokratischen Fraktionen der Bundesregierung ihre Unterst\u00fctzung best\u00e4tigt. Der Bundestag als h\u00f6chstes Organ unserer Verfassung hat der Exekutive damit R\u00fcckendeckung bei ihrem weiteren Handeln gegeben. (1/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 11, "quote_count": 0}, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "lang": "de"}, {"conversation_id": "1496798441367818245", "created_at": "2022-02-24T10:45:32.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1496798443716677633", "referenced_tweets": [{"type": "replied_to", "id": "1496798442504560651"}], "text": "Wir k\u00f6nnen es aber keinesfalls hinnehmen, dass Russland mitten in Europa #Krieg f\u00fchrt und die Souver\u00e4nit\u00e4t seiner Nachbar*innen in Frage stellt und angreift. Die n\u00e4chsten Tage m\u00fcssen wir genau beobachten, wie wir die Ukraine in dieser Lage bestm\u00f6glich unterst\u00fctzen k\u00f6nnen. (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 7, "quote_count": 0}, "entities": {"hashtags": [{"start": 73, "end": 79, "tag": "Krieg"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1496798441367818245", "created_at": "2022-02-24T10:45:32.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1496798442504560651", "referenced_tweets": [{"type": "replied_to", "id": "1496798441367818245"}], "text": "Jetzt m\u00fcssen schnell und deutlich die #Sanktionen versch\u00e4rft werden, um den Druck auf Russland zu erh\u00f6hen. Klar ist, dass uns diese Sanktionen am Ende auch selbst weh tun werden. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 8, "quote_count": 0}, "entities": {"hashtags": [{"start": 38, "end": 49, "tag": "Sanktionen"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1496798441367818245", "created_at": "2022-02-24T10:45:32.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1496798441367818245", "text": "Dies ist ein dunkler Tag f\u00fcr die #Ukraine, aber auch f\u00fcr ganz #Europa. Putin greift die ganze Ukraine an. Wir brauchen starke und klare Antworten auf diesen #V\u00f6lkerrechtsbruch und m\u00fcssen solidarisch an der Seite der Ukrainerinnen und Ukrainer stehen. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 11, "quote_count": 0}, "entities": {"hashtags": [{"start": 33, "end": 41, "tag": "Ukraine"}, {"start": 62, "end": 69, "tag": "Europa"}, {"start": 157, "end": 175, "tag": "V\u00f6lkerrechtsbruch"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}, {"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "864931126132985856", "name": "Vladimir Putin", "description": "President of Russia Vladimir Putin"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "864931126132985856", "name": "Vladimir Putin", "description": "President of Russia Vladimir Putin"}}], "lang": "de"}, {"conversation_id": "1495041148502650881", "created_at": "2022-02-19T14:22:40.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1495041148502650881", "text": "Heute, genau zwei Jahre nach den Anschl\u00e4gen in Hanau, haben wir in Heilbronn klar gemacht: kein Platz den Rassisten! Gemeinsam mit einem breiten B\u00fcndnis haben wir den Rechten gezeigt, dass wir die Demokratie gegen sie verteidigen. https://t.co/0ji0o9OPLr", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 24, "quote_count": 0}, "attachments": {"media_keys": ["3_1495041137240854530"]}, "entities": {"urls": [{"start": 231, "end": 254, "url": "https://t.co/0ji0o9OPLr", "expanded_url": "https://twitter.com/josip_juratovic/status/1495041148502650881/photo/1", "display_url": "pic.twitter.com/0ji0o9OPLr"}]}, "lang": "de"}, {"conversation_id": "1494663827471929350", "created_at": "2022-02-18T13:23:20.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1494663827471929350", "text": "Es ist richtig, jetzt die Sonderregeln f\u00fcr die #Kurzarbeit bis zum 30. Juni zu verl\u00e4ngern. Es braucht Planungssicherheit f\u00fcr die Unternehmen, um Mitarbeiter*innen auch in schwierigen Zeiten halten zu k\u00f6nnen, um nach der Pandemie wieder voll durchzustarten. https://t.co/ZRe7fY7I7L", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 47, "end": 58, "tag": "Kurzarbeit"}], "urls": [{"start": 257, "end": 280, "url": "https://t.co/ZRe7fY7I7L", "expanded_url": "https://twitter.com/josip_juratovic/status/1494663827471929350/photo/1", "display_url": "pic.twitter.com/ZRe7fY7I7L"}]}, "attachments": {"media_keys": ["3_1494663819104337924"]}, "lang": "de"}, {"conversation_id": "1494603017286471680", "created_at": "2022-02-18T09:21:42.000Z", "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1494603017286471680", "referenced_tweets": [{"type": "retweeted", "id": "1494602389067862016"}], "entities": {"mentions": [{"start": 3, "end": 11, "username": "a_watch", "id": "35142791"}, {"start": 77, "end": 93, "username": "josip_juratovic", "id": "738731811380076544"}]}, "text": "RT @a_watch: \"Klar kannst Du es schaffen Politiker zu werden\", antwortet MdB @josip_juratovic einem nach eigenen Angaben sch\u00fcchternen 14j\u00e4h\u2026", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 8, "reply_count": 0, "like_count": 0, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1492856338665418761", "created_at": "2022-02-13T13:41:01.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1492856338665418761", "text": "Herzlichen Gl\u00fcckwunsch Frank-Walter #Steinmeier! Gerade jetzt ist es wichtig, einen #Bundespr\u00e4sidenten zu haben, der die Gesellschaft zusammenf\u00fchrt und Spaltung \u00fcberwindet. Frank-Walter Steinmeier ist der richtige Pr\u00e4sident f\u00fcr diese herausfordernde Zeit. https://t.co/h7ueu38Rmm", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 9, "quote_count": 0}, "entities": {"hashtags": [{"start": 36, "end": 47, "tag": "Steinmeier"}, {"start": 84, "end": 102, "tag": "Bundespr\u00e4sidenten"}], "urls": [{"start": 256, "end": 279, "url": "https://t.co/h7ueu38Rmm", "expanded_url": "https://twitter.com/josip_juratovic/status/1492856338665418761/photo/1", "display_url": "pic.twitter.com/h7ueu38Rmm"}]}, "attachments": {"media_keys": ["3_1492856336668839946"]}, "lang": "de"}, {"conversation_id": "1492515474004791298", "created_at": "2022-02-12T15:06:33.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1492515474004791298", "text": "Morgen ist es soweit: Wir w\u00e4hlen den #Bundespr\u00e4sidenten. Und damit auch unter Corona-Ma\u00dfnahmen alle Platz haben, wird die #Bundesversammlung in diesem Jahr im Paul-L\u00f6be-Haus stattfinden. https://t.co/W0wW1dPpJY", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 3, "reply_count": 0, "like_count": 12, "quote_count": 0}, "entities": {"hashtags": [{"start": 37, "end": 55, "tag": "Bundespr\u00e4sidenten"}, {"start": 122, "end": 140, "tag": "Bundesversammlung"}], "urls": [{"start": 187, "end": 210, "url": "https://t.co/W0wW1dPpJY", "expanded_url": "https://twitter.com/josip_juratovic/status/1492515474004791298/photo/1", "display_url": "pic.twitter.com/W0wW1dPpJY"}]}, "attachments": {"media_keys": ["3_1492515458960048131"]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "lang": "de"}, {"conversation_id": "1490409703943417861", "created_at": "2022-02-06T19:38:58.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1490409703943417861", "text": "Herzlichen Gl\u00fcckwunsch zur gewonnenen OB-Wahl, lieber Harry. Mehr als 80% sind ein klares Zeichen der Heilbronner*innen f\u00fcr 8 weitere erfolgreiche Jahre \ud83d\udcaa\ud83c\udffb https://t.co/OYTycTchJO", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 33, "quote_count": 0}, "attachments": {"media_keys": ["3_1490409701875593216"]}, "entities": {"urls": [{"start": 156, "end": 179, "url": "https://t.co/OYTycTchJO", "expanded_url": "https://twitter.com/josip_juratovic/status/1490409703943417861/photo/1", "display_url": "pic.twitter.com/OYTycTchJO"}]}, "lang": "de"}, {"conversation_id": "1486657874210263041", "created_at": "2022-01-27T11:10:32.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1486657874210263041", "text": "#WeRemember - #NieWieder Hass, Gewalt und Krieg. Es darf keinen Schlussstrich geben, sondern es liegt in unserer #Verantwortung, die Erinnerung wach zu halten. Deshalb gedenken wir heute den Opfern des Nationalsozialismus. https://t.co/U9wkovVVqQ", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 13, "quote_count": 1}, "entities": {"hashtags": [{"start": 0, "end": 11, "tag": "WeRemember"}, {"start": 14, "end": 24, "tag": "NieWieder"}, {"start": 113, "end": 127, "tag": "Verantwortung"}], "urls": [{"start": 223, "end": 246, "url": "https://t.co/U9wkovVVqQ", "expanded_url": "https://twitter.com/josip_juratovic/status/1486657874210263041/photo/1", "display_url": "pic.twitter.com/U9wkovVVqQ"}]}, "attachments": {"media_keys": ["3_1486657868497571843"]}, "lang": "de"}, {"conversation_id": "1485677995947921408", "created_at": "2022-01-24T18:16:51.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1485677995947921408", "text": "Heute hat Heilbronn ein wichtiges #Zeichen gesetzt! Mit einer #Menschenkette durch die gesamte Fu\u00dfg\u00e4ngerzone haben wir deutlich gemacht, dass wir f\u00fcr gesellschaftlichen #Zusammenhalt stehen. Nur #gemeinsam kommen wir durch die #Pandemie! https://t.co/TDCtAjRFmo", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 4, "reply_count": 0, "like_count": 19, "quote_count": 0}, "entities": {"hashtags": [{"start": 34, "end": 42, "tag": "Zeichen"}, {"start": 62, "end": 76, "tag": "Menschenkette"}, {"start": 169, "end": 182, "tag": "Zusammenhalt"}, {"start": 195, "end": 205, "tag": "gemeinsam"}, {"start": 227, "end": 236, "tag": "Pandemie"}], "urls": [{"start": 238, "end": 261, "url": "https://t.co/TDCtAjRFmo", "expanded_url": "https://twitter.com/josip_juratovic/status/1485677995947921408/photo/1", "display_url": "pic.twitter.com/TDCtAjRFmo"}, {"start": 238, "end": 261, "url": "https://t.co/TDCtAjRFmo", "expanded_url": "https://twitter.com/josip_juratovic/status/1485677995947921408/photo/1", "display_url": "pic.twitter.com/TDCtAjRFmo"}]}, "attachments": {"media_keys": ["3_1485677978868670464", "3_1485677991107739653"]}, "lang": "de"}, {"conversation_id": "1481649684988846085", "created_at": "2022-01-13T15:29:47.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1481649687476125703", "referenced_tweets": [{"type": "replied_to", "id": "1481649684988846085"}], "text": "Dies schaffen wir nur im #Dialog und konstruktiver #Zusammenarbeit. Herzlichen Dank f\u00fcr das konstruktive Gespr\u00e4ch. (2/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 16, "quote_count": 0}, "entities": {"hashtags": [{"start": 25, "end": 32, "tag": "Dialog"}, {"start": 51, "end": 66, "tag": "Zusammenarbeit"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1481649684988846085", "created_at": "2022-01-13T15:29:47.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1481649684988846085", "text": "Heute konnte ich mich mit dem #Botschafter der Republik #Kosovo, Dr. Faruk Ajeti, austauschen. S\u00fcdosteuropa steht vor gro\u00dfen Herausforderungen um #Frieden und #Stabilit\u00e4t in der Region zu sichern. (1/2) https://t.co/SiYUMRBntR", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 53, "quote_count": 1}, "entities": {"hashtags": [{"start": 30, "end": 42, "tag": "Botschafter"}, {"start": 56, "end": 63, "tag": "Kosovo"}, {"start": 146, "end": 154, "tag": "Frieden"}, {"start": 159, "end": 170, "tag": "Stabilit\u00e4t"}], "urls": [{"start": 203, "end": 226, "url": "https://t.co/SiYUMRBntR", "expanded_url": "https://twitter.com/josip_juratovic/status/1481649684988846085/photo/1", "display_url": "pic.twitter.com/SiYUMRBntR"}]}, "attachments": {"media_keys": ["3_1481649670841462784"]}, "lang": "de"}, {"conversation_id": "1471810223589498884", "created_at": "2021-12-17T11:51:16.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1471810223589498884", "referenced_tweets": [{"type": "retweeted", "id": "1471808570450751489"}], "entities": {"mentions": [{"start": 3, "end": 9, "username": "spdbt", "id": "347792540"}]}, "text": "RT @spdbt: A\u015f\u0131 olun, Booster\u2019\u0131 yapt\u0131r\u0131n! \ud83d\udc89\nVakcinirajte se! Uzmi \"Booster\"! \ud83d\udc89\nCijepite se! Uzmite Booster! \ud83d\udc89\nLasst Euch impfen! Holt Euch d\u2026", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 18, "reply_count": 0, "like_count": 0, "quote_count": 0}, "lang": "tr"}, {"conversation_id": "1463822276177104899", "created_at": "2021-11-25T10:50:29.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1463822391751159814", "referenced_tweets": [{"type": "replied_to", "id": "1463822276177104899"}], "text": "Deshalb m\u00fcssen wir gemeinsam hinschauen und an der Seite aller Frauen stehen, denen physische oder psychische Gewalt angetan wird. Hilfe gibt es zum Beispiel beim Verein Frauen helfen Frauen e.V. in Heilbronn (07131 507853) (2/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 2, "like_count": 6, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1463822276177104899", "created_at": "2021-11-25T10:50:01.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1463822276177104899", "text": "In unserer Gesellschaft gibt es keinen Platz f\u00fcr Gewaltt\u00e4ter. Am heutigen internationalen Tag gegen Gewalt an Frauen machen wir es noch mal ganz deutlich: Wir nehmen die Gewalt nicht hin. Gerade im vergangenen Jahr ist viel Zeit hinter verschlossenen T\u00fcren verbracht worden. (1/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 6, "like_count": 7, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1459123536941957134", "created_at": "2021-11-12T11:40:07.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1459123842752946177", "referenced_tweets": [{"type": "replied_to", "id": "1459123708170326018"}], "text": "So tr\u00e4gt die falsche Toleranz gegen\u00fcber Nationalist:innen und Antidemokrat:innen und das feige Zur\u00fcckweichen angesichts der D\u00e4monisierung von Gefl\u00fcchteten quer durch das politische Spektrum nun giftige Fr\u00fcchte. Die ganze PM dazu gibt\u2019s auf meiner HP. (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 9, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1459123536941957134", "created_at": "2021-11-12T11:39:35.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1459123708170326018", "referenced_tweets": [{"type": "replied_to", "id": "1459123536941957134"}], "text": "W\u00e4hrend derartige moralische Abgr\u00fcnde vom Lukaschenko-Regime kaum mehr \u00fcberraschen, tr\u00e4gt auch die #Europa #Verantwortung f\u00fcr die menschenverachtende Situation. War die \"Festung Europa\" jahrelang nur eine Vision der extremen Rechten, wird sie nun Realit\u00e4t. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 99, "end": 106, "tag": "Europa"}, {"start": 107, "end": 121, "tag": "Verantwortung"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1459123536941957134", "created_at": "2021-11-12T11:38:55.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1459123536941957134", "text": "Die Situation an der #polnisch-#belarussischen Grenze erf\u00fcllt mich als Demokrat und Europ\u00e4er mit #Wut und #Scham. In diesem perfiden Machtspiel auf dem R\u00fccken notleidender Menschen auf der Suche nach einer besseren Zukunft gibt es keine unschuldige Seite. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 6, "like_count": 17, "quote_count": 1}, "entities": {"hashtags": [{"start": 21, "end": 30, "tag": "polnisch"}, {"start": 31, "end": 46, "tag": "belarussischen"}, {"start": 97, "end": 101, "tag": "Wut"}, {"start": 106, "end": 112, "tag": "Scham"}]}, "lang": "de"}, {"conversation_id": "1446443199808086020", "created_at": "2021-10-08T11:52:36.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1446443408470552578", "referenced_tweets": [{"type": "replied_to", "id": "1446443199808086020"}], "text": "Daf\u00fcr setzte ich mich als Berichterstatter f\u00fcr den #Westbalkan pers\u00f6nlich ein und werde die Problematik bei meinen Gespr\u00e4chen mit den zust\u00e4ndigen Ministerien auf dem Westbalkan in der kommenden Woche thematisieren. (2/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 51, "end": 62, "tag": "Westbalkan"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1446443199808086020", "created_at": "2021-10-08T11:51:47.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1446443199808086020", "text": "Die illegalen #Pushbacks an der #kroatisch-#bosnischen Grenze verurteile ich auf das Sch\u00e4rfste. Diese #unmenschliche Vorgehensweise widerspricht allen europ\u00e4ischen Grunds\u00e4tzen. Jetzt muss gekl\u00e4rt werden, wer daf\u00fcr die Verantwortung tr\u00e4gt und Konsequenzen gezogen werden. (1/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 4, "reply_count": 2, "like_count": 24, "quote_count": 0}, "entities": {"hashtags": [{"start": 14, "end": 24, "tag": "Pushbacks"}, {"start": 32, "end": 42, "tag": "kroatisch"}, {"start": 43, "end": 54, "tag": "bosnischen"}, {"start": 102, "end": 116, "tag": "unmenschliche"}]}, "lang": "de"}, {"conversation_id": "1444718091913646081", "created_at": "2021-10-03T17:36:49.000Z", "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1444718091913646081", "text": "Heute feiern wir den 31. #TagderDeutschenEinheit. Eine historische Leistung vieler mutiger Menschen.\n\nDoch um es mit den Worten von Olaf Scholz zu sagen:  \"Heute sind wir ein Land, trotzdem bleibt viel zu tun. Vor allem bei der Angleichung der Geh\u00e4lter und Renten.\"", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 25, "end": 48, "tag": "TagderDeutschenEinheit"}]}, "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}, {"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1439959177003089924", "name": "Bundestagswahl 2021"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}, {"domain": {"id": "38", "name": "Political Race", "description": ""}, "entity": {"id": "1439959177003089924", "name": "Bundestagswahl 2021"}}], "lang": "de"}, {"conversation_id": "1427256342654357517", "created_at": "2021-08-16T13:11:15.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1427256642035503108", "referenced_tweets": [{"type": "replied_to", "id": "1427256521533100040"}], "text": "F\u00fcr mich ist die Situation jetzt in erster Linie eine humanit\u00e4re Frage und keine rein politische. Unsere #Verantwortung f\u00fcr die Menschen Afghanistans bleibt. Das sind wir ihnen schuldig. (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 7, "quote_count": 0}, "entities": {"hashtags": [{"start": 105, "end": 119, "tag": "Verantwortung"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1427256342654357517", "created_at": "2021-08-16T13:10:46.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1427256521533100040", "referenced_tweets": [{"type": "replied_to", "id": "1427256342654357517"}], "text": "Denn es steht ganz au\u00dfer Frage: Wir sind #verpflichtet f\u00fcr die #Sicherheit aller afghanischen Ortskr\u00e4fte und ihrer Familien zu sorgen, die in den vergangenen Jahren unsere Soldat*innen unterst\u00fctzt haben. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 8, "quote_count": 0}, "entities": {"hashtags": [{"start": 41, "end": 54, "tag": "verpflichtet"}, {"start": 63, "end": 74, "tag": "Sicherheit"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1427256342654357517", "created_at": "2021-08-16T13:10:03.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1427256342654357517", "text": "Der Horror, den die Menschen in #Afghanistan nach dem Einmarsch der Taliban in Kabul erleben, \u00fcbersteigt unsere Vorstellungskraft. Nun gilt es alles zu tun um noch so viele Menschen wie m\u00f6glich zu #retten \u2013 und zwar unb\u00fcrokratisch und sofort.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 32, "end": 44, "tag": "Afghanistan"}, {"start": 197, "end": 204, "tag": "retten"}]}, "lang": "de"}, {"conversation_id": "1422900866051358726", "created_at": "2021-08-04T12:43:31.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1422901009127456768", "referenced_tweets": [{"type": "replied_to", "id": "1422900951363555330"}], "text": "Um das Risiko f\u00fcr diese Altersgruppe gering zu halten, m\u00fcssen jetzt die Erwachsenen #Verantwortung \u00fcbernehmen und sich impfen lassen. Also: T-Shirt-\u00c4rmel hochkrempeln und impfen lassen! (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 10, "quote_count": 0}, "entities": {"hashtags": [{"start": 84, "end": 98, "tag": "Verantwortung"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1422900866051358726", "created_at": "2021-08-04T12:43:17.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1422900951363555330", "referenced_tweets": [{"type": "replied_to", "id": "1422900866051358726"}], "text": "Jetzt stehen alle #Erwachsenen in der Pflicht, f\u00fcr ein m\u00f6glichst normales Schuljahr zu sorgen. F\u00fcr alle unter 12 Jahren gibt es noch keinen zugelassenen Impfstoff. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 18, "end": 30, "tag": "Erwachsenen"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1422900866051358726", "created_at": "2021-08-04T12:42:57.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1422900866051358726", "text": "Jetzt ist #Solidarit\u00e4t mit den #Kleinsten gefragt! Wir m\u00fcssen die Wochen bis zum Herbst nutzen, um so viele Menschen wie m\u00f6glich zu #impfen. Es kann nicht sein, dass wir jetzt zaudern und unsere Kinder und Enkel dann im Herbst die #Leidtragenden sind. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 19, "quote_count": 0}, "entities": {"hashtags": [{"start": 10, "end": 22, "tag": "Solidarit\u00e4t"}, {"start": 31, "end": 41, "tag": "Kleinsten"}, {"start": 132, "end": 139, "tag": "impfen"}, {"start": 231, "end": 245, "tag": "Leidtragenden"}]}, "lang": "de"}, {"conversation_id": "1418163880510042113", "created_at": "2021-07-22T10:59:51.000Z", "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1418163880510042113", "referenced_tweets": [{"type": "retweeted", "id": "1418118469372059648"}], "entities": {"mentions": [{"start": 3, "end": 16, "username": "saschabinder", "id": "219032584"}, {"start": 35, "end": 46, "username": "Landtag_BW", "id": "1968838140"}], "hashtags": [{"start": 64, "end": 70, "tag": "noAfd"}]}, "text": "RT @saschabinder: Gestern wurde im @Landtag_BW der Kandidat der #noAfd mit stimmen auch von anderen Fraktionen in den Verfassungsgerichtsho\u2026", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 382, "reply_count": 0, "like_count": 0, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1418145845871054853", "created_at": "2021-07-22T09:48:12.000Z", "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1418145845871054853", "referenced_tweets": [{"type": "retweeted", "id": "1418142724067319808"}], "entities": {"mentions": [{"start": 3, "end": 12, "username": "spdbawue", "id": "19062136"}, {"start": 18, "end": 29, "username": "Landtag_BW", "id": "1968838140"}], "hashtags": [{"start": 40, "end": 46, "tag": "noAfD"}]}, "text": "RT @spdbawue: Der @Landtag_BW hat einen #noAfD Mann in den Verfassungsgerichtshof gew\u00e4hlt. 37x Ja; 32x Nein; 77x Egal. F\u00fcr uns gilt seit \u00fcb\u2026", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 93, "reply_count": 0, "like_count": 0, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1416026853886803973", "created_at": "2021-07-16T13:29:11.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1416027131633668097", "referenced_tweets": [{"type": "replied_to", "id": "1416027031968567304"}], "text": "Mein gro\u00dfer Respekt und meine tiefe Dankbarkeit gelten allen Einsatzkr\u00e4ften, die hier ihr eigenes Leben riskieren, um andere zu retten. (3/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 6, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1416026853886803973", "created_at": "2021-07-16T13:28:47.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1416027031968567304", "referenced_tweets": [{"type": "replied_to", "id": "1416026853886803973"}], "text": "Schrecklich, mit welcher Macht die Wassermassen ganze D\u00f6rfer zerst\u00f6rt haben. Jetzt gilt es, den Betroffenen schnelle Hilfe zu leisten und Solidarit\u00e4t zu zeigen. Ich bin stolz, dass auch Einsatzkr\u00e4fte aus unserer Region nach NRW und RP aufgebrochen sind. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 7, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1416026853886803973", "created_at": "2021-07-16T13:28:05.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1416026853886803973", "text": "Meine Gedanken und Gebete sind bei den Menschen in NRW und RP. Mein Mitgef\u00fchl gilt den Verstorbenen, den Vermissten, den Angeh\u00f6rigen und allen, die ihr Hab und Gut durch das #Hochwasser verloren haben. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 18, "quote_count": 0}, "entities": {"hashtags": [{"start": 174, "end": 185, "tag": "Hochwasser"}]}, "lang": "de"}, {"conversation_id": "1409879345913552898", "created_at": "2021-06-29T14:20:37.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1409879481163059206", "referenced_tweets": [{"type": "replied_to", "id": "1409879345913552898"}], "text": "Es kann nicht sein, dass kleine Einkommen bis 30.000 \u20ac nur \u00fcber 24% des Einkommens verf\u00fcgen, aber 36% der Sozialabgaben tragen. Einkommen mit mehr als 110.000 \u20ac verf\u00fcgen \u00fcber 23% des Einkommens, tragen aber nur 9% der Sozialabgaben. https://t.co/kygqTzLwHd", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 9, "reply_count": 1, "like_count": 22, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "entities": {"urls": [{"start": 233, "end": 256, "url": "https://t.co/kygqTzLwHd", "expanded_url": "https://www.zeit.de/wirtschaft/2021-06/einkommensverteilung-geringverdienende-sozialabgaben-jahreseinkommen-beitragsbemessungsgrenze", "display_url": "zeit.de/wirtschaft/202\u2026", "images": [{"url": "https://pbs.twimg.com/news_img/1483038881608089601/JjVrNxOE?format=jpg&name=orig", "width": 1300, "height": 731}, {"url": "https://pbs.twimg.com/news_img/1483038881608089601/JjVrNxOE?format=jpg&name=150x150", "width": 150, "height": 150}], "status": 200, "title": "Einkommensverteilung: Geringverdienende zahlen \u00fcberproportional viel Geld in Sozialkassen", "description": "Die Beitragsbemessungsgrenze f\u00fchrt einem Bericht zufolge zu einem Missverh\u00e4ltnis bei den Sozialabgaben. Die Linke kritisiert die Besserstellung von Besserverdienenden.", "unwound_url": "https://www.zeit.de/wirtschaft/2021-06/einkommensverteilung-geringverdienende-sozialabgaben-jahreseinkommen-beitragsbemessungsgrenze"}]}, "lang": "de"}, {"conversation_id": "1409879345913552898", "created_at": "2021-06-29T14:20:05.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1409879345913552898", "text": "Die #Beitragsbemessungsgrenze muss deutlich angehoben werden. Breite Schultern m\u00fcssen ihren Beitrag auch bei den #Sozialabgaben leisten. Im Moment zahlen Gering- und Normalverdienende \u00fcberproportional in die Sozialkassen.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 4, "reply_count": 2, "like_count": 18, "quote_count": 0}, "entities": {"hashtags": [{"start": 4, "end": 29, "tag": "Beitragsbemessungsgrenze"}, {"start": 113, "end": 127, "tag": "Sozialabgaben"}]}, "lang": "de"}, {"conversation_id": "1407276699742621697", "created_at": "2021-06-22T09:58:05.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1407276699742621697", "text": "Ein #Turnier f\u00fcr alle? Es ist ein Armutszeugnis f\u00fcr die #UEFA, dass sie ein solidarisches Zeichen im Sinne der #Toleranz und der #Weltoffenheit verhindert. Die Welt ist #bunt! (1/2) https://t.co/Qdw6cFZXk1", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 17, "reply_count": 5, "like_count": 270, "quote_count": 2}, "entities": {"hashtags": [{"start": 4, "end": 12, "tag": "Turnier"}, {"start": 56, "end": 61, "tag": "UEFA"}, {"start": 111, "end": 120, "tag": "Toleranz"}, {"start": 129, "end": 143, "tag": "Weltoffenheit"}, {"start": 169, "end": 174, "tag": "bunt"}], "urls": [{"start": 182, "end": 205, "url": "https://t.co/Qdw6cFZXk1", "expanded_url": "https://twitter.com/josip_juratovic/status/1407276699742621697/photo/1", "display_url": "pic.twitter.com/Qdw6cFZXk1"}]}, "attachments": {"media_keys": ["3_1407276690930388994"]}, "lang": "de"}, {"conversation_id": "1407276432141733894", "created_at": "2021-06-22T09:57:02.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1407276432141733894", "text": "(2/2) In dem Moment, in dem die #UEFA diese Aktion verbietet, handelt sie bereits politisch. Allerdings auf der Seite der Ewiggestrigen. Traurig, dass die UEFA wohl nicht nein gesagt h\u00e4tte, h\u00e4tte die Aktion ein Weltkonzern gesponsert und w\u00e4ren Werbegelder geflossen. #Toleranz", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 6, "reply_count": 0, "like_count": 71, "quote_count": 2}, "entities": {"hashtags": [{"start": 32, "end": 37, "tag": "UEFA"}, {"start": 267, "end": 276, "tag": "Toleranz"}]}, "lang": "de"}, {"conversation_id": "1403312838043705353", "created_at": "2021-06-11T11:27:07.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1403312838043705353", "text": "Die Verabschiedung des #Lieferkettengesetzes eine der wichtigsten Entscheidungen in dieser Legislaturperiode. Mit dem Gesetz sorgen wir f\u00fcr eine bessere Zukunft, indem wir den #sozialen und #\u00f6kologischen Fu\u00dfabdruck in der Lieferkette in den Fokus r\u00fccken.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 8, "quote_count": 0}, "entities": {"hashtags": [{"start": 23, "end": 44, "tag": "Lieferkettengesetzes"}, {"start": 176, "end": 185, "tag": "sozialen"}, {"start": 190, "end": 203, "tag": "\u00f6kologischen"}]}, "lang": "de"}, {"conversation_id": "1402261746191114243", "created_at": "2021-06-08T13:50:27.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1402261746191114243", "text": "Statt der Forderung aus dem Altmaier -Ministerium nach der #Rentemit68 brauchen wir 12\u20ac #Mindestlohn und eine deutliche Anhebung oder den Wegfall der #Beitragsbemessungsgrenze von 7100\u20ac. Es kann nicht sein, dass hohe Geh\u00e4lter nicht entspr. in die Sozialversicherung einzahlen.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 3, "like_count": 11, "quote_count": 0}, "entities": {"hashtags": [{"start": 59, "end": 70, "tag": "Rentemit68"}, {"start": 88, "end": 100, "tag": "Mindestlohn"}, {"start": 150, "end": 175, "tag": "Beitragsbemessungsgrenze"}]}, "lang": "de"}, {"conversation_id": "1395713803288031236", "created_at": "2021-05-21T12:11:16.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1395713803288031236", "text": "Als ehem. Betriebsrat wei\u00df ich, wie wichtig Betriebsr\u00e4te f\u00fcr ein stabiles Klima im Betrieb und f\u00fcr bessere Arbeitsbedingungen sind. Mit dem #Betriebsr\u00e4temodernisierungsgesetz st\u00e4rken wir die Arbeitnehmer*innen  und machen die Gr\u00fcndung von Betriebsr\u00e4ten einfacher und sicherer.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 24, "quote_count": 0}, "entities": {"hashtags": [{"start": 140, "end": 174, "tag": "Betriebsr\u00e4temodernisierungsgesetz"}]}, "lang": "de"}, {"conversation_id": "1395277623996059650", "created_at": "2021-05-20T10:02:23.000Z", "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1395318981154705412", "referenced_tweets": [{"type": "replied_to", "id": "1395277623996059650"}], "entities": {"mentions": [{"start": 0, "end": 16, "username": "wochenendrebell", "id": "980866921"}]}, "text": "@wochenendrebell Pers\u00f6nliche Selbstdarstellung durch das Abweichen von der Fraktionslinie halte ich prinzipiell nicht f\u00fcr richtig.\n\nAber weil ich \u00f6fter gefragt wurde: Ich habe gestern bewusst f\u00fcr den Antrag gestimmt und dies vorher meiner Fraktion mitgeteilt.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 4, "reply_count": 1, "like_count": 17, "quot