3, "end": 72, "tag": "Wei\u00dfbuch"}], "urls": [{"start": 279, "end": 302, "url": "https://t.co/nCX0OVsWoJ", "expanded_url": "https://twitter.com/josip_juratovic/status/1395021345608585223/photo/1", "display_url": "pic.twitter.com/nCX0OVsWoJ"}]}, "text": "Globale Herausforderungen werden nur #multilateral gel\u00f6st. Das #Wei\u00dfbuch Multilateralismus benennt die wichtigsten Herausforderungen, vor denen die multilaterale Ordnung steht und unterstreicht, warum wir mehr int. Zusammenarbeit brauchen. Klare Leseempfehlung! @AuswaertigesAmt https://t.co/nCX0OVsWoJ", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 7, "quote_count": 0}, "attachments": {"media_keys": ["3_1395021180852219906"]}, "lang": "de"}, {"conversation_id": "1388547106319867908", "created_at": "2021-05-01T17:33:22.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1388547106319867908", "text": "#Solidarit\u00e4tIstZukunft - das haben die vielen Kolleg*innen heute bei der #DGB-Kundgebung in Heilbronn klar gemacht. Mit Maske, Abstand und Hygienema\u00dfnahmen.\nDie SPD Heilbronn zeigte sich heute solidarisch und war #gema1nsam stark vertreten. https://t.co/Gj0oRyEOFd", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 11, "quote_count": 0}, "entities": {"hashtags": [{"start": 0, "end": 22, "tag": "Solidarit\u00e4tIstZukunft"}, {"start": 73, "end": 77, "tag": "DGB"}, {"start": 213, "end": 223, "tag": "gema1nsam"}], "urls": [{"start": 241, "end": 264, "url": "https://t.co/Gj0oRyEOFd", "expanded_url": "https://twitter.com/josip_juratovic/status/1388547106319867908/photo/1", "display_url": "pic.twitter.com/Gj0oRyEOFd"}]}, "attachments": {"media_keys": ["3_1388546679587147784"]}, "lang": "de"}, {"conversation_id": "1387386252350169090", "created_at": "2021-04-28T12:40:34.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1387386254950649856", "referenced_tweets": [{"type": "replied_to", "id": "1387386253662949381"}], "text": "Repr\u00e4sentant*innen der Bev\u00f6lkerung gef\u00fchrt wird.\nJene, die heute wieder schwarze Listen f\u00fchren und r\u00fccksichtslos f\u00fcr Ihre Interessen eintreten, sind die Geister der Vergangenheit, wegen deren Kompromisslosigkeit schon Millionen Menschen ihr Leben lassen mussten (3/3).", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 10, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1387386252350169090", "created_at": "2021-04-28T12:40:33.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1387386253662949381", "referenced_tweets": [{"type": "replied_to", "id": "1387386252350169090"}], "text": "nicht alle B\u00fcrger*innen mit unseren Entscheidungen vollst\u00e4ndig zufrieden sein k\u00f6nnen. Ich habe Verst\u00e4ndnis, dass dies gerade in diesen herausfordernden Zeiten zu Diskussionen f\u00fchren kann.\nAllerdings erwarte ich, dass diese Diskussion mit #Respekt vor den gew\u00e4hlten (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 238, "end": 246, "tag": "Respekt"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1387386252350169090", "created_at": "2021-04-28T12:40:33.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1387386252350169090", "text": "In Sozialen Medien kursieren dieser Tage sog. #Todeslisten, mit den Namen von #Bundestagsabgeordneten. Dazu muss ich mich \u00e4u\u00dfern: Die Findung von Kompromissen ist ein wesentliches Merkmal unserer parl. #Demokratie. Wir Abgeordnete m\u00fcssen daher in Kauf nehmen, dass (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 46, "end": 58, "tag": "Todeslisten"}, {"start": 78, "end": 101, "tag": "Bundestagsabgeordneten"}, {"start": 202, "end": 213, "tag": "Demokratie"}]}, "lang": "de"}, {"conversation_id": "1387098979108855815", "created_at": "2021-04-27T17:39:02.000Z", "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1387098979108855815", "entities": {"mentions": [{"start": 150, "end": 158, "username": "jusosbw", "id": "21188850"}], "hashtags": [{"start": 161, "end": 175, "tag": "SPDfor1point5"}]}, "text": "Klimaschutz ist nicht verhandelbar.\n\nVerantwortungsvolle Klimapolitik sucht nach L\u00f6sungen, die alle mitnimmt. Deswegen unterst\u00fctze ich den Appell der @jusosbw . #SPDfor1point5", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 8, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1383772156677345281", "created_at": "2021-04-18T13:19:26.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1383772156677345281", "text": "Was wir bei allen Diskussionen \u00fcber die #Pandemie nicht aus den Augen verlieren d\u00fcrfen: Hinter den Zahlen stehen Menschen.\nMenschen und ihre Geschichte, verbunden mit der Pandemie - durch Einschr\u00e4nkung, Erkrankung und Verlust. Diesen Menschen gedenken wir heute. #Gedenktag https://t.co/wYrYHxrLHG", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "entities": {"hashtags": [{"start": 40, "end": 49, "tag": "Pandemie"}, {"start": 263, "end": 273, "tag": "Gedenktag"}], "urls": [{"start": 274, "end": 297, "url": "https://t.co/wYrYHxrLHG", "expanded_url": "https://twitter.com/josip_juratovic/status/1383772156677345281/photo/1", "display_url": "pic.twitter.com/wYrYHxrLHG"}]}, "attachments": {"media_keys": ["3_1383772146585931787"]}, "lang": "de"}, {"conversation_id": "1382595218164355072", "created_at": "2021-04-15T07:22:42.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1382595218164355072", "entities": {"mentions": [{"start": 26, "end": 41, "username": "bundeswehrInfo", "id": "121415484"}, {"start": 273, "end": 279, "username": "spdbt", "id": "347792540"}], "hashtags": [{"start": 45, "end": 57, "tag": "Afghanistan"}, {"start": 164, "end": 169, "tag": "NATO"}]}, "text": "Mit den Soldat*innen der  @bundeswehrInfo in #Afghanistan endet ein langer Auslandseinsatz. Ein bedeutender, aber leider auch verlustreicher Einsatz: auf Seite der #NATO und der afghanischen Bev\u00f6lkerung. Gemeinsam gilt es jetzt: Abzug planen und ziviles Engagement setzen. @spdbt", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 4, "quote_count": 0}, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1016738021939351558", "name": "North Atlantic Treaty Organization", "description": "North Atlantic Treaty Organization"}}], "lang": "de"}, {"conversation_id": "1381924339109523456", "created_at": "2021-04-13T10:56:52.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1381924339109523456", "referenced_tweets": [{"type": "quoted", "id": "1381852415612366848"}], "entities": {"mentions": [{"start": 254, "end": 268, "username": "hubertus_heil", "id": "15943222"}, {"start": 270, "end": 276, "username": "spdbt", "id": "347792540"}], "hashtags": [{"start": 4, "end": 16, "tag": "Testpflicht"}, {"start": 124, "end": 136, "tag": "Solidarit\u00e4t"}], "urls": [{"start": 277, "end": 300, "url": "https://t.co/qSxRRumPvb", "expanded_url": "https://twitter.com/hubertus_heil/status/1381852415612366848", "display_url": "twitter.com/hubertus_heil/\u2026"}]}, "text": "Die #Testpflicht in den Betrieben schafft Sicherheit f\u00fcr die Besch\u00e4ftigten, die t\u00e4glich zur Arbeit gehen m\u00fcssen. Es geht um #Solidarit\u00e4t, die wir selbstverst\u00e4ndlich von den Arbeitgeber*innen einfordern. Nur gemeinsam kommen wir durch die 3. Welle. Danke @hubertus_heil! @spdbt https://t.co/qSxRRumPvb", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 4, "quote_count": 0}, "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}], "lang": "de"}, {"conversation_id": "1381282489801527296", "created_at": "2021-04-11T16:26:23.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1381282489801527296", "entities": {"mentions": [{"start": 103, "end": 114, "username": "OlafScholz", "id": "38150247"}, {"start": 253, "end": 259, "username": "spdbt", "id": "347792540"}, {"start": 260, "end": 266, "username": "spdde", "id": "26458162"}, {"start": 267, "end": 280, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 16, "end": 26, "tag": "Notbremse"}, {"start": 125, "end": 139, "tag": "Verantwortung"}, {"start": 154, "end": 167, "tag": "Profilierung"}, {"start": 245, "end": 251, "tag": "Union"}]}, "text": "Die bundesweite #Notbremse kommt und ist notwendig! Ein wichtiger Beitrag f. Transparenz und Klarheit! @OlafScholz\nstellt d. #Verantwortung in den Fokus. #Profilierung ist da fehl am Platz. Es muss Schluss sein mit dem Hahnenkampf innerhalb der #Union! @spdbt @spdde @stimmeonline", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 8, "like_count": 20, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1380150266163499020", "created_at": "2021-04-08T13:27:20.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1380150266163499020", "referenced_tweets": [{"type": "quoted", "id": "1379681450858008577"}], "entities": {"mentions": [{"start": 255, "end": 261, "username": "spdbt", "id": "347792540"}, {"start": 262, "end": 278, "username": "TheProgressives", "id": "19287037"}], "hashtags": [{"start": 8, "end": 15, "tag": "Werten"}, {"start": 19, "end": 31, "tag": "Miteinander"}, {"start": 40, "end": 48, "tag": "Frieden"}, {"start": 53, "end": 63, "tag": "Wohlstand"}, {"start": 67, "end": 74, "tag": "Europa"}, {"start": 171, "end": 177, "tag": "cofoe"}, {"start": 221, "end": 229, "tag": "Zukunft"}, {"start": 241, "end": 253, "tag": "Regierungen"}], "urls": [{"start": 279, "end": 302, "url": "https://t.co/I8dDrYcyKj", "expanded_url": "https://twitter.com/SZ/status/1379681450858008577", "display_url": "twitter.com/SZ/status/1379\u2026"}]}, "text": "Nur mit #Werten u. #Miteinander gibt es #Frieden und #Wohlstand in #Europa. Daf\u00fcr braucht es Menschen, die sich damit auseinandersetzen u. europ. Ideen leben. Deshalb ist #cofoe so wichtig. Wir gestalten gemeinsam unsere #Zukunft, nicht die #Regierungen. @spdbt @TheProgressives https://t.co/I8dDrYcyKj", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1380137652977070080", "created_at": "2021-04-08T12:37:12.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1380137652977070080", "referenced_tweets": [{"type": "quoted", "id": "1380076663640268801"}], "entities": {"mentions": [{"start": 257, "end": 263, "username": "spdbt", "id": "347792540"}, {"start": 264, "end": 277, "username": "ZR_SintiRoma", "id": "740572850688557058"}], "hashtags": [{"start": 75, "end": 80, "tag": "Roma"}, {"start": 84, "end": 91, "tag": "Europa"}, {"start": 115, "end": 127, "tag": "Ausgrenzung"}, {"start": 129, "end": 145, "tag": "Diskriminierung"}, {"start": 147, "end": 154, "tag": "Gewalt"}], "urls": [{"start": 278, "end": 301, "url": "https://t.co/m4z0gEPfox", "expanded_url": "https://twitter.com/ZR_SintiRoma/status/1380076663640268801", "display_url": "twitter.com/ZR_SintiRoma/s\u2026"}]}, "text": "In Vielfalt geeint. Dazu geh\u00f6ren selbstverst\u00e4ndlich fast 12 Mio. Sinti und #Roma in #Europa. Die Realit\u00e4t in 2021: #Ausgrenzung, #Diskriminierung, #Gewalt. Deshalb ist die breite Solidarit\u00e4t so notwendig. Nicht nur heute am Tag der Roma, sondern jeden Tag! @spdbt @ZR_SintiRoma https://t.co/m4z0gEPfox", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1379324720911413248", "created_at": "2021-04-06T06:46:54.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1379324720911413248", "referenced_tweets": [{"type": "quoted", "id": "1378712453916286985"}], "entities": {"mentions": [{"start": 237, "end": 250, "username": "spdlandtagbw", "id": "174208140"}, {"start": 252, "end": 265, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 0, "end": 12, "tag": "Solidarit\u00e4t"}, {"start": 70, "end": 76, "tag": "s0304"}, {"start": 216, "end": 224, "tag": "Landtag"}], "urls": [{"start": 266, "end": 289, "url": "https://t.co/QBpEryMWKQ", "expanded_url": "https://twitter.com/saschabinder/status/1378712453916286985", "display_url": "twitter.com/saschabinder/s\u2026"}]}, "text": "#Solidarit\u00e4t in schwereren Zeiten ist wichtiger denn je. Dann gibt es #s0304. Bewusstes missachten der Auflagen - keine Maske und kein Abstand. Einfach kein Anstand!Antworten m\u00fcssen jetzt auf den Tisch - und zwar im #Landtag. Richtig so @spdlandtagbw! @stimmeonline https://t.co/QBpEryMWKQ", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 3, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1377986740355526662", "created_at": "2021-04-02T14:10:15.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1377986740355526662", "referenced_tweets": [{"type": "quoted", "id": "1377940864799014913"}], "entities": {"mentions": [{"start": 18, "end": 27, "username": "GrueneBW", "id": "16002482"}, {"start": 184, "end": 193, "username": "spdbawue", "id": "19062136"}, {"start": 194, "end": 200, "username": "spdde", "id": "26458162"}], "hashtags": [{"start": 28, "end": 40, "tag": "Kretschmann"}, {"start": 94, "end": 106, "tag": "Klimaschutz"}], "urls": [{"start": 201, "end": 224, "url": "https://t.co/Y5e0uGHMBE", "expanded_url": "https://twitter.com/StochAndreas/status/1377940864799014913", "display_url": "twitter.com/StochAndreas/s\u2026"}]}, "text": "Entweder sind die @GrueneBW #Kretschmann's Geisel, oder sie haben es doch nicht so eilig beim #Klimaschutz, wie sie es in Berlin betonen - oder \u00fcber die Sozialen Medien kommunizieren. @spdbawue @spdde https://t.co/Y5e0uGHMBE", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 3, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1377253591593934852", "created_at": "2021-03-31T13:36:59.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1377253591593934852", "referenced_tweets": [{"type": "quoted", "id": "1377188023767547904"}], "entities": {"mentions": [{"start": 246, "end": 259, "username": "stimmeonline", "id": "26986638"}, {"start": 260, "end": 266, "username": "spdbt", "id": "347792540"}], "hashtags": [{"start": 15, "end": 27, "tag": "Betriebsrat"}, {"start": 44, "end": 57, "tag": "Betriebsr\u00e4te"}, {"start": 134, "end": 168, "tag": "Betriebsr\u00e4temodernisierungsgesetz"}], "urls": [{"start": 267, "end": 290, "url": "https://t.co/c5YvaRhDw9", "expanded_url": "https://twitter.com/spdbt/status/1377188023767547904", "display_url": "twitter.com/spdbt/status/1\u2026"}]}, "text": "Als erfahrener #Betriebsrat wei\u00df ich: Wo es #Betriebsr\u00e4te gibt und Besch\u00e4ftigte mitbestimmen, sind die Arbeitsbedingungen besser. Das #Betriebsr\u00e4temodernisierungsgesetz vereinfacht die Gr\u00fcndung, sch\u00fctzt Besch\u00e4ftigte, st\u00e4rkt ihre Rechte. Endlich! @stimmeonline\n@spdbt https://t.co/c5YvaRhDw9", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 4, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1376811210256048130", "created_at": "2021-03-30T08:19:07.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1376811210256048130", "referenced_tweets": [{"type": "quoted", "id": "1376742062478012419"}], "entities": {"mentions": [{"start": 30, "end": 39, "username": "IGMetall", "id": "17895191"}], "hashtags": [{"start": 43, "end": 47, "tag": "NRW"}, {"start": 203, "end": 217, "tag": "Gerechtigkeit"}], "urls": [{"start": 219, "end": 242, "url": "https://t.co/fILxmf84pl", "expanded_url": "https://twitter.com/IGMetall/status/1376742062478012419", "display_url": "twitter.com/IGMetall/statu\u2026"}]}, "text": "Die Gewerkschaftler*innen der @IGMetall in #NRW haben ein gutes Ergebnis erzielt und gezeigt, dass Krisenfolgen nicht einseitig getragen werden m\u00fcssen. Andere L\u00e4nder m\u00fcssen jetzt nachziehen - es geht um #Gerechtigkeit! https://t.co/fILxmf84pl", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1376484492156747777", "created_at": "2021-03-29T10:40:51.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1376484492156747777", "referenced_tweets": [{"type": "quoted", "id": "1373997904617115649"}], "text": "#FaireLieferketten bedeutet: Keine Ausreden mehr f\u00fcr gr\u00f6\u00dfere Konzerne! Wir sorgen f\u00fcr mehr Transparenz bei den Zulieferungen und k\u00f6nnen #Menschenrechte besser absichern. Daran arbeiten wir europaweit, denn es geht um unsere Werte. Bis dahin muss unser Lieferkettengesetz liefern! https://t.co/FgEatMaPb0", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "entities": {"hashtags": [{"start": 0, "end": 18, "tag": "FaireLieferketten"}, {"start": 136, "end": 151, "tag": "Menschenrechte"}], "urls": [{"start": 280, "end": 303, "url": "https://t.co/FgEatMaPb0", "expanded_url": "https://twitter.com/BMAS_Bund/status/1373997904617115649", "display_url": "twitter.com/BMAS_Bund/stat\u2026"}]}, "lang": "de"}, {"conversation_id": "1375483148671279113", "created_at": "2021-03-26T16:21:52.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1375483148671279113", "referenced_tweets": [{"type": "quoted", "id": "1375448414364839937"}], "entities": {"mentions": [{"start": 260, "end": 273, "username": "stimmeonline", "id": "26986638"}, {"start": 274, "end": 280, "username": "spdbt", "id": "347792540"}], "hashtags": [{"start": 16, "end": 29, "tag": "Abgeordneten"}, {"start": 128, "end": 140, "tag": "Transparenz"}, {"start": 149, "end": 155, "tag": "Union"}, {"start": 250, "end": 258, "tag": "Politik"}], "urls": [{"start": 281, "end": 304, "url": "https://t.co/s0REfVJL51", "expanded_url": "https://twitter.com/spdbt/status/1375448414364839937", "display_url": "twitter.com/spdbt/status/1\u2026"}]}, "text": "Die anst\u00e4ndigen #Abgeordneten stehen nicht weiter im Schatten der \"schwarzen Schafe\". Ich begr\u00fc\u00dfe die heutige Einigung f\u00fcr mehr #Transparenz mit der #Union. Jetzt muss weiter geliefert werden: im Sinne von Transparenz, im Sinne des Vertrauens in die #Politik. @stimmeonline @spdbt https://t.co/s0REfVJL51", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1375039989646561280", "created_at": "2021-03-25T11:00:55.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1375039989646561280", "entities": {"mentions": [{"start": 254, "end": 260, "username": "spdbt", "id": "347792540"}, {"start": 261, "end": 274, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 209, "end": 224, "tag": "Lobbyregisters"}]}, "text": "Abgeordneter ist man mit Herz und Verstand - vor allem ist man 24/7 f\u00fcr die B\u00fcrger*innen im Einsatz. Da bleibt eigentlich keine Zeit f\u00fcr gro\u00dfe Nebent\u00e4tigkeiten. So verstehe ich mein Mandat. Die Einf\u00fchrung des #Lobbyregisters ist daher l\u00e4ngst \u00fcberf\u00e4llig! @spdbt @stimmeonline", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1374655050631557125", "created_at": "2021-03-24T09:31:18.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1374655051898232832", "referenced_tweets": [{"type": "replied_to", "id": "1374655050631557125"}], "text": "Es gilt zu beachten: Viele B\u00fcrger*innen k\u00f6nnen es sich schlicht nicht leisten, am #Monatsende f\u00fcr ein solch langes Wochenende einzukaufen. Wir brauchen L\u00f6sungen, die es allen erm\u00f6glicht, gut versorgt zuhause zu bleiben!", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "entities": {"hashtags": [{"start": 82, "end": 93, "tag": "Monatsende"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1374655050631557125", "created_at": "2021-03-24T09:31:18.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1374655050631557125", "entities": {"mentions": [{"start": 196, "end": 202, "username": "spdbt", "id": "347792540"}, {"start": 203, "end": 216, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 29, "end": 37, "tag": "Ruhetag"}]}, "text": "Die Erkl\u00e4rung des 01.04. zum #Ruhetag sorgt verst\u00e4ndlicherweise f\u00fcr viel Verwirrung in der Bev\u00f6lkerung. Wir brauchen jetzt schnell Klarheit dar\u00fcber, was die Beschl\u00fcsse konkret um Ostern bedeuten! @spdbt @stimmeonline", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 0, "quote_count": 0}, "context_annotations": [{"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1372917575357591554", "name": "Easter", "description": "this entity for all conversations for Easter all year "}}, {"domain": {"id": "119", "name": "Holiday", "description": "Holidays like Christmas or Halloween"}, "entity": {"id": "1372917575357591554", "name": "Easter", "description": "this entity for all conversations for Easter all year "}}], "lang": "de"}, {"conversation_id": "1374316485494067203", "created_at": "2021-03-23T11:05:58.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1374316485494067203", "entities": {"mentions": [{"start": 259, "end": 265, "username": "spdbt", "id": "347792540"}, {"start": 266, "end": 279, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 4, "end": 18, "tag": "Osterlockdown"}]}, "text": "Ein #Osterlockdown ist angesichts der rapide steigenden Inzidenzen wohl unumg\u00e4nglich. Dennoch: Ich w\u00fcnsche mir bei der Bek\u00e4mpfung der Pandemie mehr proaktives Handeln, statt st\u00e4ndiger Schadensbegrenzung! So wird Vertrauen verspielt und noch mehr Unmut ges\u00e4t!\n@spdbt @stimmeonline", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1371781023898427399", "created_at": "2021-03-16T11:10:57.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1371781023898427399", "referenced_tweets": [{"type": "quoted", "id": "1371606399336189953"}], "entities": {"mentions": [{"start": 65, "end": 81, "username": "Karl_Lauterbach", "id": "3292982985"}, {"start": 251, "end": 257, "username": "spdbt", "id": "347792540"}, {"start": 258, "end": 271, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 19, "end": 31, "tag": "AstraZeneca"}], "urls": [{"start": 272, "end": 295, "url": "https://t.co/xj3ka3hdlr", "expanded_url": "https://twitter.com/Karl_Lauterbach/status/1371606399336189953", "display_url": "twitter.com/Karl_Lauterbac\u2026"}]}, "text": "Die Aussetzung von #AstraZeneca hat schlimme Folgen. Der Kollege @Karl_Lauterbach hat Recht: Wir m\u00fcssen herausfinden, wie die F\u00e4lle zustande kamen, die Vernunft gebietet jedoch die Eind\u00e4mmung der COVID-19 Pandemie durch schnelles, effizientes Impfen. @spdbt @stimmeonline https://t.co/xj3ka3hdlr", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "lang": "de"}, {"conversation_id": "1371025293448712197", "created_at": "2021-03-14T09:07:57.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1371025295264911367", "referenced_tweets": [{"type": "replied_to", "id": "1371025293448712197"}], "entities": {"mentions": [{"start": 205, "end": 214, "username": "spdbawue", "id": "19062136"}]}, "text": "Ich w\u00fcnsche Rainer Hinderer, Klaus Ranger - Landtagskandidat im Wahlkreis Neckarsulm -, Jens Sch\u00e4fer - Landtagskandidat Wahlkreis Eppingen - und Patrick Wegener viel Erfolg heute - weil sie es verdienen. \n@spdbawue", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1371025293448712197", "created_at": "2021-03-14T09:07:57.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1371025293448712197", "text": "Heute entscheiden wir dar\u00fcber, wer uns f\u00fcr die n\u00e4chsten f\u00fcnf Jahre im Landtag von #BaW\u00fc vertreten wird. In besonders schwierigen Zeiten brauchen wir verantwortungsbewusste Abgeordnete mit klaren Zielen und Tatkraft. #daswichtigejetzt #ltwbw21 https://t.co/hyl9Ph1I3a", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 1, "quote_count": 0}, "entities": {"hashtags": [{"start": 82, "end": 87, "tag": "BaW\u00fc"}, {"start": 216, "end": 233, "tag": "daswichtigejetzt"}, {"start": 234, "end": 242, "tag": "ltwbw21"}], "urls": [{"start": 243, "end": 266, "url": "https://t.co/hyl9Ph1I3a", "expanded_url": "https://twitter.com/josip_juratovic/status/1371025293448712197/photo/1", "display_url": "pic.twitter.com/hyl9Ph1I3a"}]}, "attachments": {"media_keys": ["3_1371025263941795840"]}, "lang": "de"}, {"conversation_id": "1370035618638663687", "created_at": "2021-03-11T15:35:20.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1370035618638663687", "text": "Wir alle erinnern uns an die schrecklichen Bilder aus #Fukushima von vor 10 Jahren. Obgleich ein politischer Wendepunkt - #Atomkraft kann keine Alternative sein - war es f\u00fcr viele Menschen in #Japan der Tag, an dem sie Freunde und Familie verloren haben. Ihnen gedenken wir heute.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 3, "quote_count": 0}, "entities": {"hashtags": [{"start": 54, "end": 64, "tag": "Fukushima"}, {"start": 122, "end": 132, "tag": "Atomkraft"}, {"start": 192, "end": 198, "tag": "Japan"}]}, "lang": "de"}, {"conversation_id": "1369693169923788806", "created_at": "2021-03-10T16:54:34.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1369693169923788806", "referenced_tweets": [{"type": "quoted", "id": "1368883701170511878"}], "text": "Ich kann mich nur wiederholen: Noch immer verdienen Frauen im Schnitt 18% weniger als ihre m\u00e4nnlichen Kollegen. #GeradeJetzt, am heutigen #EqualPayDay m\u00fcssen wir uns diese Tatsache bewusst machen! Die #GenderPayGap ist real und muss dringend \u00fcberbr\u00fcckt werden. https://t.co/rizCn8KZH3", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "entities": {"hashtags": [{"start": 112, "end": 124, "tag": "GeradeJetzt"}, {"start": 138, "end": 150, "tag": "EqualPayDay"}, {"start": 201, "end": 214, "tag": "GenderPayGap"}], "urls": [{"start": 261, "end": 284, "url": "https://t.co/rizCn8KZH3", "expanded_url": "https://twitter.com/josip_juratovic/status/1368883701170511878", "display_url": "twitter.com/josip_juratovi\u2026"}]}, "lang": "de"}, {"conversation_id": "1368883699870228481", "created_at": "2021-03-08T11:18:01.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1368883701170511878", "referenced_tweets": [{"type": "replied_to", "id": "1368883699870228481"}], "text": "Gleicher Lohn f\u00fcr gleiche Arbeit ist ein Urgedanke sozialdemokratischer Politik und vor allem heute, zum #Weltfrauentag wichtiger denn je.", "reply_settings": "everyone", "author_id": "738731811380076544", "publ