username": "BMAS_Bund", "public_metrics": {"followers_count": 84332, "following_count": 300, "tweet_count": 10881, "listed_count": 781}, "description": "Aktuelle Nachrichten aus dem Bundesministerium f\u00fcr Arbeit und Soziales.\nAlle Inhalte: !B.\nImpressum: https://t.co/kaENEp2V03", "profile_image_url": "https://pbs.twimg.com/profile_images/1430864132736262148/-4ZckDlL_normal.jpg", "entities": {"url": {"urls": [{"start": 0, "end": 23, "url": "https://t.co/nrXjrkXXC8", "expanded_url": "http://www.bmas.de", "display_url": "bmas.de"}]}, "description": {"urls": [{"start": 101, "end": 124, "url": "https://t.co/kaENEp2V03", "expanded_url": "http://bmas.de/impressum", "display_url": "bmas.de/impressum"}]}}, "protected": false, "verified": true, "created_at": "2013-06-24T14:32:44.000Z", "url": "https://t.co/nrXjrkXXC8", "pinned_tweet_id": "1496367989326860289", "name": "BMAS", "id": "1543415318"}, {"location": "Berlin, Deutschland", "username": "Karl_Lauterbach", "public_metrics": {"followers_count": 979537, "following_count": 303, "tweet_count": 9755, "listed_count": 3129}, "description": "SPD Bundestagsabgeordneter, Bundesgesundheitsminister, der hier selbst und privat tweetet.", "profile_image_url": "https://pbs.twimg.com/profile_images/601388878554079232/db5tdAsW_normal.jpg", "entities": {"url": {"urls": [{"start": 0, "end": 23, "url": "https://t.co/aNTUPwOxBp", "expanded_url": "http://www.karllauterbach.de", "display_url": "karllauterbach.de"}]}}, "protected": false, "verified": true, "created_at": "2015-05-21T14:01:21.000Z", "url": "https://t.co/aNTUPwOxBp", "pinned_tweet_id": "1468145083946090497", "name": "Prof. Karl Lauterbach", "id": "3292982985"}], "tweets": [{"conversation_id": "1513910648601784328", "created_at": "2022-04-12T16:03:20.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513910650338254857", "referenced_tweets": [{"type": "replied_to", "id": "1513910648601784328"}], "text": "Denn der Angriffskrieg auf die Ukraine zeigt uns, wie wichtig #Frieden und #Stabilit\u00e4t auf dem Westbalkan auch f\u00fcr unsere #Sicherheit in Europa sind. Deshalb muss der Kampf gegen #Korruption und #Nationalisten in den Fokus ger\u00fcckt werden. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 3, "reply_count": 1, "like_count": 5, "quote_count": 0}, "entities": {"hashtags": [{"start": 62, "end": 70, "tag": "Frieden"}, {"start": 75, "end": 86, "tag": "Stabilit\u00e4t"}, {"start": 122, "end": 133, "tag": "Sicherheit"}, {"start": 179, "end": 190, "tag": "Korruption"}, {"start": 195, "end": 209, "tag": "Nationalisten"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1513910648601784328", "created_at": "2022-04-12T16:03:20.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513910648601784328", "text": "Welche Ziele verfolgt die Ampel-Regierung f\u00fcr den Westbalkan? Zu diesem Thema habe ich beim #IFIMES (International Institute for Middle East and Balkan Studies) gesprochen und klar gemacht, dass wir die #demokratischen Kr\u00e4fte auf dem #Westbalkan st\u00e4rken m\u00fcssen. (1/3) https://t.co/aGqnpJmjZ2", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 5, "like_count": 14, "quote_count": 0}, "entities": {"hashtags": [{"start": 92, "end": 99, "tag": "IFIMES"}, {"start": 203, "end": 218, "tag": "demokratischen"}, {"start": 234, "end": 245, "tag": "Westbalkan"}], "urls": [{"start": 268, "end": 291, "url": "https://t.co/aGqnpJmjZ2", "expanded_url": "https://twitter.com/josip_juratovic/status/1513910648601784328/photo/1", "display_url": "pic.twitter.com/aGqnpJmjZ2"}]}, "attachments": {"media_keys": ["3_1513910646571769856"]}, "lang": "de"}, {"conversation_id": "1513811429870252039", "created_at": "2022-04-12T09:29:05.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513811431174684675", "referenced_tweets": [{"type": "replied_to", "id": "1513811429870252039"}], "text": "Seit Sonntag bin ich zu Gespr\u00e4chen auf dem Westbalkan und die Worte von Olaf Scholz werden hier mit Hoffnung verbunden. Der Berliner Prozess muss jetzt neu belebt werden, um allen Staaten auf dem Westbalkan endlich eine echte #EU-Beitrittsperspektive zu geben! (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 2, "like_count": 6, "quote_count": 0}, "entities": {"hashtags": [{"start": 226, "end": 229, "tag": "EU"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}], "lang": "de"}, {"conversation_id": "1513811429870252039", "created_at": "2022-04-12T09:29:04.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1513811429870252039", "text": "\u201eDer westliche Balkan und dessen Integration in die Europ\u00e4ische Union ist mir sehr wichtig.\u201c Ich begr\u00fc\u00dfe es sehr, dass #Bundeskanzler Olaf Scholz gestern betont hat, dass der #Westbalkan Teil #Europas und Teil der europ\u00e4ischen Familie ist. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 9, "quote_count": 0}, "entities": {"hashtags": [{"start": 119, "end": 133, "tag": "Bundeskanzler"}, {"start": 175, "end": 186, "tag": "Westbalkan"}, {"start": 192, "end": 200, "tag": "Europas"}]}, "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}], "lang": "de"}, {"conversation_id": "1511658189946822657", "created_at": "2022-04-06T10:52:52.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1511658191192535043", "referenced_tweets": [{"type": "replied_to", "id": "1511658189946822657"}], "text": "Wir m\u00fcssen endlich Lehren aus dem politischen #Versagen der L\u00e4nder auf dem Westbalkan \u2013 aber auch der westlichen Welt \u2013 ziehen, und allen L\u00e4ndern auf dem Westbalkan eine echte #EU-Beitrittsperspektive er\u00f6ffnen. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 6, "quote_count": 0}, "entities": {"hashtags": [{"start": 46, "end": 55, "tag": "Versagen"}, {"start": 176, "end": 179, "tag": "EU"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1511658189946822657", "created_at": "2022-04-06T10:52:52.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1511658189946822657", "text": "In diesen Tagen vor 30 Jahren begann die Belagerung von #Sarajevo und die Konflikte auf dem #Westbalkan gipfelten in einem jahrelangen #Krieg mit unvorstellbaren #Gr\u00e4ueltaten. Bei der heutigen Debatte im Bundestag Gedenken wir den Opfern dieses Krieges. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 8, "reply_count": 6, "like_count": 37, "quote_count": 0}, "entities": {"hashtags": [{"start": 56, "end": 65, "tag": "Sarajevo"}, {"start": 92, "end": 103, "tag": "Westbalkan"}, {"start": 135, "end": 141, "tag": "Krieg"}, {"start": 162, "end": 174, "tag": "Gr\u00e4ueltaten"}]}, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "lang": "de"}, {"conversation_id": "1509860230255026179", "created_at": "2022-04-01T11:48:25.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1509860230255026179", "text": "Am letzten Wochenende war ich bei der Parlamentariersitzung des Global Council for Tolerance and Peace (#GCTP) in Dubai und Abu Dhabi. Gemeinsam mit den Parlamentariern aus \u00fcber 50 Staaten haben wir ein deutliches Zeichen f\u00fcr #Toleranz und #Frieden weltweit gesetzt. (1/2) https://t.co/nCUQoz31Si", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 3, "like_count": 3, "quote_count": 0}, "entities": {"hashtags": [{"start": 104, "end": 109, "tag": "GCTP"}, {"start": 226, "end": 235, "tag": "Toleranz"}, {"start": 240, "end": 248, "tag": "Frieden"}], "urls": [{"start": 273, "end": 296, "url": "https://t.co/nCUQoz31Si", "expanded_url": "https://twitter.com/josip_juratovic/status/1509860230255026179/photo/1", "display_url": "pic.twitter.com/nCUQoz31Si"}]}, "attachments": {"media_keys": ["3_1509860225586810887"]}, "lang": "de"}, {"conversation_id": "1507040544417013768", "created_at": "2022-03-24T17:03:59.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1507040544417013768", "text": "Heute konnte ich mich noch mit Manuel Sarrazin austauschen. Er ist der neue #Sonderbeauftragte der Bundesregierung f\u00fcr den #Westbalkan. Wir sind uns einig, dass es in der jetzigen Situation besonders wichtig ist, f\u00fcr #Stabilit\u00e4t auf dem Westbalkan zu sorgen. (1/2) https://t.co/4brLJjZ97y", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 7, "quote_count": 0}, "entities": {"hashtags": [{"start": 76, "end": 94, "tag": "Sonderbeauftragte"}, {"start": 123, "end": 134, "tag": "Westbalkan"}, {"start": 217, "end": 228, "tag": "Stabilit\u00e4t"}], "urls": [{"start": 265, "end": 288, "url": "https://t.co/4brLJjZ97y", "expanded_url": "https://twitter.com/josip_juratovic/status/1507040544417013768/photo/1", "display_url": "pic.twitter.com/4brLJjZ97y"}]}, "attachments": {"media_keys": ["3_1507040534182965249"]}, "lang": "de"}, {"conversation_id": "1505945933665742856", "created_at": "2022-03-21T16:34:24.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1505945935792287747", "referenced_tweets": [{"type": "replied_to", "id": "1505945933665742856"}], "text": "Wir stehen f\u00fcr ein buntes und #tolerantes Deutschland, dass aus seiner #Vielf\u00e4ltigkeit Kraft zieht. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 8, "quote_count": 0}, "entities": {"hashtags": [{"start": 30, "end": 41, "tag": "tolerantes"}, {"start": 71, "end": 86, "tag": "Vielf\u00e4ltigkeit"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1505945933665742856", "created_at": "2022-03-21T16:34:24.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1505945933665742856", "text": "Heute ist internationaler Tag gegen Rassismus. Rassismus beginnt nicht mit Gewalt, sondern resultiert in ihr. Deshalb m\u00fcssen wir uns in unserem eigenen Umfeld entschieden gegen Rassismus stellen und als Gesellschaft klar machen: Nicht mit uns! #TagGegenRassismus (1/3) https://t.co/BHCYRliSJT", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 4, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 244, "end": 262, "tag": "TagGegenRassismus"}], "urls": [{"start": 269, "end": 292, "url": "https://t.co/BHCYRliSJT", "expanded_url": "https://twitter.com/josip_juratovic/status/1505945933665742856/photo/1", "display_url": "pic.twitter.com/BHCYRliSJT"}]}, "attachments": {"media_keys": ["3_1505945920982167553"]}, "lang": "de"}, {"conversation_id": "1504804671977889794", "created_at": "2022-03-18T12:59:26.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1504804671977889794", "text": "Gestern konnte ich mich mit Denis Zvizdic, Sprecher des Repr\u00e4sentantenhauses der Parlamentarischen Versammlung von Bosnien und Herzegowina, austauschen. Wir sind uns einig, dass wir gemeinsam f\u00fcr Stabilit\u00e4t in Bosnien und Herzegowina und dem gesamten Westbalkan sorgen m\u00fcssen. 1/2 https://t.co/golzqKFvru", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 5, "reply_count": 3, "like_count": 23, "quote_count": 0}, "attachments": {"media_keys": ["3_1504804666776989699"]}, "entities": {"urls": [{"start": 281, "end": 304, "url": "https://t.co/golzqKFvru", "expanded_url": "https://twitter.com/josip_juratovic/status/1504804671977889794/photo/1", "display_url": "pic.twitter.com/golzqKFvru"}]}, "lang": "de"}, {"conversation_id": "1498687338456694787", "created_at": "2022-03-01T15:51:20.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1498687338456694787", "text": "Von heute bis zum 31. Mai w\u00e4hlt ein Gro\u00dfteil der Betriebe einen neuen #Betriebsrat. Die betriebliche Mitbestimmung hat unser Land vorangebracht und ist Teil unseres wirtschaftlichen Erfolgs. Ich rufe daher alle Arbeitnehmer*innen dazu auf, sich an den #Wahlen zu beteiligen. (1/2) https://t.co/cF3sfw39O1", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 2, "reply_count": 1, "like_count": 17, "quote_count": 0}, "entities": {"hashtags": [{"start": 70, "end": 82, "tag": "Betriebsrat"}, {"start": 252, "end": 259, "tag": "Wahlen"}], "urls": [{"start": 281, "end": 304, "url": "https://t.co/cF3sfw39O1", "expanded_url": "https://twitter.com/josip_juratovic/status/1498687338456694787/photo/1", "display_url": "pic.twitter.com/cF3sfw39O1"}]}, "attachments": {"media_keys": ["3_1498687322967232518"]}, "lang": "de"}, {"conversation_id": "1497987619132788741", "created_at": "2022-02-27T17:30:56.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987627164835842", "referenced_tweets": [{"type": "replied_to", "id": "1497987625713639424"}], "text": "Deshalb hat die Regierung auch ein #Entlastungspaket auf den Weg gebracht, um die negativen Auswirkungen auf unsere B\u00fcrgerinnen und B\u00fcrger abzufedern. (6/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 6, "quote_count": 0}, "entities": {"hashtags": [{"start": 35, "end": 52, "tag": "Entlastungspaket"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1497987619132788741", "created_at": "2022-02-27T17:30:55.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987625713639424", "referenced_tweets": [{"type": "replied_to", "id": "1497987624195313667"}], "text": "Wir d\u00fcrfen nicht verschweigen, dass auch wir durch die Sanktionen mit #steigenden #Energiepreisen und einer Teuerung der Lebenshaltungskosten rechnen m\u00fcssen. (5/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 5, "quote_count": 0}, "entities": {"hashtags": [{"start": 70, "end": 81, "tag": "steigenden"}, {"start": 82, "end": 97, "tag": "Energiepreisen"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1497987619132788741", "created_at": "2022-02-27T17:30:55.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987624195313667", "referenced_tweets": [{"type": "replied_to", "id": "1497987622752428039"}], "text": "Dennoch k\u00f6nnen wir es keinesfalls hinnehmen, dass Russland mitten in Europa #Krieg f\u00fchrt und die Souver\u00e4nit\u00e4t und Integrit\u00e4t seiner Nachbarn in Frage stellt und milit\u00e4risch angreift. (4/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 76, "end": 82, "tag": "Krieg"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1497987619132788741", "created_at": "2022-02-27T17:30:55.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987622752428039", "referenced_tweets": [{"type": "replied_to", "id": "1497987621175316486"}], "text": "Mit harten #Sanktionen, #humanit\u00e4rer Hilfe und #Waffenlieferungen zeigen wir der Ukraine unsere Solidarit\u00e4t und stehen ihr geschlossen und entschlossen zur Seite. Wir sind uns bewusst, dass uns die Sanktionen am Ende auch selbst wehtun werden. (3/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 5, "quote_count": 0}, "entities": {"hashtags": [{"start": 11, "end": 22, "tag": "Sanktionen"}, {"start": 24, "end": 36, "tag": "humanit\u00e4rer"}, {"start": 47, "end": 65, "tag": "Waffenlieferungen"}]}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}, {"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1497987619132788741", "created_at": "2022-02-27T17:30:54.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987621175316486", "referenced_tweets": [{"type": "replied_to", "id": "1497987619132788741"}], "entities": {"mentions": [{"start": 14, "end": 25, "username": "OlafScholz", "id": "38150247"}], "hashtags": [{"start": 82, "end": 100, "tag": "V\u00f6lkerrechtsbruch"}, {"start": 136, "end": 148, "tag": "solidarisch"}]}, "text": "Bundeskanzler @OlafScholz hat heute starke und klare Antworten auf den russischen #V\u00f6lkerrechtsbruch gegeben und klargestellt, dass wir #solidarisch an der Seite der Ukrainerinnen und Ukrainer stehen. (2/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 5, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}, {"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1439959177003089924", "name": "Bundestagswahl 2021"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "1439961464555466753", "name": "Olaf Scholz"}}, {"domain": {"id": "38", "name": "Political Race", "description": ""}, "entity": {"id": "1439959177003089924", "name": "Bundestagswahl 2021"}}, {"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}], "lang": "de"}, {"conversation_id": "1497987619132788741", "created_at": "2022-02-27T17:30:54.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1497987619132788741", "entities": {"mentions": [{"start": 17, "end": 31, "username": "Sondersitzung", "id": "927261091910078465"}, {"start": 46, "end": 56, "username": "Bundestag", "id": "3088296873"}]}, "text": "Bei der heutigen @Sondersitzung des Deutschen @Bundestag haben alle demokratischen Fraktionen der Bundesregierung ihre Unterst\u00fctzung best\u00e4tigt. Der Bundestag als h\u00f6chstes Organ unserer Verfassung hat der Exekutive damit R\u00fcckendeckung bei ihrem weiteren Handeln gegeben. (1/7)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 11, "quote_count": 0}, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1099777660912263168", "name": "German Bundestag", "description": "The Bundestag is the German federal parliament."}}], "lang": "de"}, {"conversation_id": "1496798441367818245", "created_at": "2022-02-24T10:45:32.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1496798442504560651", "referenced_tweets": [{"type": "replied_to", "id": "1496798441367818245"}], "text": "Jetzt m\u00fcssen schnell und deutlich die #Sanktionen versch\u00e4rft werden, um den Druck auf Russland zu erh\u00f6hen. Klar ist, dass uns diese Sanktionen am Ende auch selbst weh tun werden. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 8, "quote_count": 0}, "entities": {"hashtags": [{"start": 38, "end": 49, "tag": "Sanktionen"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1496798441367818245", "created_at": "2022-02-24T10:45:32.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1496798441367818245", "text": "Dies ist ein dunkler Tag f\u00fcr die #Ukraine, aber auch f\u00fcr ganz #Europa. Putin greift die ganze Ukraine an. Wir brauchen starke und klare Antworten auf diesen #V\u00f6lkerrechtsbruch und m\u00fcssen solidarisch an der Seite der Ukrainerinnen und Ukrainer stehen. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 11, "quote_count": 0}, "entities": {"hashtags": [{"start": 33, "end": 41, "tag": "Ukraine"}, {"start": 62, "end": 69, "tag": "Europa"}, {"start": 157, "end": 175, "tag": "V\u00f6lkerrechtsbruch"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1484601166080081920", "name": "Russo-Ukrainian conflict"}}, {"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "864931126132985856", "name": "Vladimir Putin", "description": "President of Russia Vladimir Putin"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "864931126132985856", "name": "Vladimir Putin", "description": "President of Russia Vladimir Putin"}}], "lang": "de"}, {"conversation_id": "1494602389067862016", "created_at": "2022-02-18T09:19:12.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1494602389067862016", "entities": {"mentions": [{"start": 64, "end": 80, "username": "josip_juratovic", "id": "738731811380076544"}], "urls": [{"start": 257, "end": 280, "url": "https://t.co/o2YIqxIB8G", "expanded_url": "https://www.abgeordnetenwatch.de/profile/josip-juratovic/fragen-antworten/kann-ich-m14-es-schaffen-trotz-meiner-schuechternheit-sowie-sprachlosigkeit-in-der-schule-auch-wenn-ich-alle", "display_url": "abgeordnetenwatch.de/profile/josip-\u2026"}]}, "text": "\"Klar kannst Du es schaffen Politiker zu werden\", antwortet MdB @josip_juratovic einem nach eigenen Angaben sch\u00fcchternen 14j\u00e4hrigen. \"Als ich mit 15 nach \ud83c\udde9\ud83c\uddea kam, konnte ich kein Wort Deutsch. Ich hoffe, dass ich irgendwann von Dir als Politiker lesen kann\"\nhttps://t.co/o2YIqxIB8G", "reply_settings": "everyone", "author_id": "35142791", "public_metrics": {"retweet_count": 8, "reply_count": 1, "like_count": 43, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1481649684988846085", "created_at": "2022-01-13T15:29:47.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1481649684988846085", "text": "Heute konnte ich mich mit dem #Botschafter der Republik #Kosovo, Dr. Faruk Ajeti, austauschen. S\u00fcdosteuropa steht vor gro\u00dfen Herausforderungen um #Frieden und #Stabilit\u00e4t in der Region zu sichern. (1/2) https://t.co/SiYUMRBntR", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 53, "quote_count": 1}, "entities": {"hashtags": [{"start": 30, "end": 42, "tag": "Botschafter"}, {"start": 56, "end": 63, "tag": "Kosovo"}, {"start": 146, "end": 154, "tag": "Frieden"}, {"start": 159, "end": 170, "tag": "Stabilit\u00e4t"}], "urls": [{"start": 203, "end": 226, "url": "https://t.co/SiYUMRBntR", "expanded_url": "https://twitter.com/josip_juratovic/status/1481649684988846085/photo/1", "display_url": "pic.twitter.com/SiYUMRBntR"}]}, "attachments": {"media_keys": ["3_1481649670841462784"]}, "lang": "de"}, {"conversation_id": "1471808570450751489", "created_at": "2021-12-17T11:44:42.000Z", "possibly_sensitive": false, "source": "Twitter Media Studio", "id": "1471808570450751489", "entities": {"mentions": [{"start": 149, "end": 157, "username": "CanselK", "id": "23248102"}, {"start": 178, "end": 194, "username": "josip_juratovic", "id": "738731811380076544"}], "urls": [{"start": 196, "end": 219, "url": "https://t.co/8KpzAlxPvp", "expanded_url": "https://twitter.com/spdbt/status/1471808570450751489/video/1", "display_url": "pic.twitter.com/8KpzAlxPvp"}]}, "text": "A\u015f\u0131 olun, Booster\u2019\u0131 yapt\u0131r\u0131n! \ud83d\udc89\nVakcinirajte se! Uzmi \"Booster\"! \ud83d\udc89\nCijepite se! Uzmite Booster! \ud83d\udc89\nLasst Euch impfen! Holt Euch den Booster! \ud83d\udc89\n\nDanke @CanselK, Adis Ahmetovic und @josip_juratovic. https://t.co/8KpzAlxPvp", "reply_settings": "everyone", "author_id": "347792540", "public_metrics": {"retweet_count": 18, "reply_count": 16, "like_count": 82, "quote_count": 4}, "attachments": {"media_keys": ["13_1471808066609991684"]}, "lang": "tr"}, {"conversation_id": "1463822276177104899", "created_at": "2021-11-25T10:50:01.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1463822276177104899", "text": "In unserer Gesellschaft gibt es keinen Platz f\u00fcr Gewaltt\u00e4ter. Am heutigen internationalen Tag gegen Gewalt an Frauen machen wir es noch mal ganz deutlich: Wir nehmen die Gewalt nicht hin. Gerade im vergangenen Jahr ist viel Zeit hinter verschlossenen T\u00fcren verbracht worden. (1/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 6, "like_count": 7, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1459123536941957134", "created_at": "2021-11-12T11:39:35.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1459123708170326018", "referenced_tweets": [{"type": "replied_to", "id": "1459123536941957134"}], "text": "W\u00e4hrend derartige moralische Abgr\u00fcnde vom Lukaschenko-Regime kaum mehr \u00fcberraschen, tr\u00e4gt auch die #Europa #Verantwortung f\u00fcr die menschenverachtende Situation. War die \"Festung Europa\" jahrelang nur eine Vision der extremen Rechten, wird sie nun Realit\u00e4t. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 99, "end": 106, "tag": "Europa"}, {"start": 107, "end": 121, "tag": "Verantwortung"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1459123536941957134", "created_at": "2021-11-12T11:38:55.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1459123536941957134", "text": "Die Situation an der #polnisch-#belarussischen Grenze erf\u00fcllt mich als Demokrat und Europ\u00e4er mit #Wut und #Scham. In diesem perfiden Machtspiel auf dem R\u00fccken notleidender Menschen auf der Suche nach einer besseren Zukunft gibt es keine unschuldige Seite. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 6, "like_count": 17, "quote_count": 1}, "entities": {"hashtags": [{"start": 21, "end": 30, "tag": "polnisch"}, {"start": 31, "end": 46, "tag": "belarussischen"}, {"start": 97, "end": 101, "tag": "Wut"}, {"start": 106, "end": 112, "tag": "Scham"}]}, "lang": "de"}, {"conversation_id": "1446443199808086020", "created_at": "2021-10-08T11:51:47.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1446443199808086020", "text": "Die illegalen #Pushbacks an der #kroatisch-#bosnischen Grenze verurteile ich auf das Sch\u00e4rfste. Diese #unmenschliche Vorgehensweise widerspricht allen europ\u00e4ischen Grunds\u00e4tzen. Jetzt muss gekl\u00e4rt werden, wer daf\u00fcr die Verantwortung tr\u00e4gt und Konsequenzen gezogen werden. (1/2)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 4, "reply_count": 2, "like_count": 24, "quote_count": 0}, "entities": {"hashtags": [{"start": 14, "end": 24, "tag": "Pushbacks"}, {"start": 32, "end": 42, "tag": "kroatisch"}, {"start": 43, "end": 54, "tag": "bosnischen"}, {"start": 102, "end": 116, "tag": "unmenschliche"}]}, "lang": "de"}, {"conversation_id": "1427256342654357517", "created_at": "2021-08-16T13:10:46.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1427256521533100040", "referenced_tweets": [{"type": "replied_to", "id": "1427256342654357517"}], "text": "Denn es steht ganz au\u00dfer Frage: Wir sind #verpflichtet f\u00fcr die #Sicherheit aller afghanischen Ortskr\u00e4fte und ihrer Familien zu sorgen, die in den vergangenen Jahren unsere Soldat*innen unterst\u00fctzt haben. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 8, "quote_count": 0}, "entities": {"hashtags": [{"start": 41, "end": 54, "tag": "verpflichtet"}, {"start": 63, "end": 74, "tag": "Sicherheit"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1427256342654357517", "created_at": "2021-08-16T13:10:03.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1427256342654357517", "text": "Der Horror, den die Menschen in #Afghanistan nach dem Einmarsch der Taliban in Kabul erleben, \u00fcbersteigt unsere Vorstellungskraft. Nun gilt es alles zu tun um noch so viele Menschen wie m\u00f6glich zu #retten \u2013 und zwar unb\u00fcrokratisch und sofort.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 32, "end": 44, "tag": "Afghanistan"}, {"start": 197, "end": 204, "tag": "retten"}]}, "lang": "de"}, {"conversation_id": "1422900866051358726", "created_at": "2021-08-04T12:43:17.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1422900951363555330", "referenced_tweets": [{"type": "replied_to", "id": "1422900866051358726"}], "text": "Jetzt stehen alle #Erwachsenen in der Pflicht, f\u00fcr ein m\u00f6glichst normales Schuljahr zu sorgen. F\u00fcr alle unter 12 Jahren gibt es noch keinen zugelassenen Impfstoff. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 13, "quote_count": 0}, "entities": {"hashtags": [{"start": 18, "end": 30, "tag": "Erwachsenen"}]}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1422900866051358726", "created_at": "2021-08-04T12:42:57.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1422900866051358726", "text": "Jetzt ist #Solidarit\u00e4t mit den #Kleinsten gefragt! Wir m\u00fcssen die Wochen bis zum Herbst nutzen, um so viele Menschen wie m\u00f6glich zu #impfen. Es kann nicht sein, dass wir jetzt zaudern und unsere Kinder und Enkel dann im Herbst die #Leidtragenden sind. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 19, "quote_count": 0}, "entities": {"hashtags": [{"start": 10, "end": 22, "tag": "Solidarit\u00e4t"}, {"start": 31, "end": 41, "tag": "Kleinsten"}, {"start": 132, "end": 139, "tag": "impfen"}, {"start": 231, "end": 245, "tag": "Leidtragenden"}]}, "lang": "de"}, {"conversation_id": "1418118469372059648", "created_at": "2021-07-22T07:59:25.000Z", "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1418118469372059648", "entities": {"mentions": [{"start": 17, "end": 28, "username": "Landtag_BW", "id": "1968838140"}], "hashtags": [{"start": 46, "end": 52, "tag": "noAfd"}, {"start": 127, "end": 145, "tag": "BadenWuerttemberg"}, {"start": 184, "end": 198, "tag": "keinfussbreit"}], "urls": [{"start": 199, "end": 222, "url": "https://t.co/bO3zMd3A3h", "expanded_url": "https://twitter.com/saschabinder/status/1418118469372059648/video/1", "display_url": "pic.twitter.com/bO3zMd3A3h"}]}, "text": "Gestern wurde im @Landtag_BW der Kandidat der #noAfd mit stimmen auch von anderen Fraktionen in den Verfassungsgerichtshof von #BadenWuerttemberg gew\u00e4hlt. Ich bin immer noch entsetzt! #keinfussbreit https://t.co/bO3zMd3A3h", "reply_settings": "everyone", "author_id": "219032584", "public_metrics": {"retweet_count": 382, "reply_count": 320, "like_count": 2355, "quote_count": 104}, "attachments": {"media_keys": ["7_1418116512645361666"]}, "lang": "de"}, {"conversation_id": "1418142724067319808", "created_at": "2021-07-22T09:35:47.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1418142724067319808", "entities": {"mentions": [{"start": 4, "end": 15, "username": "Landtag_BW", "id": "1968838140"}], "hashtags": [{"start": 26, "end": 32, "tag": "noAfD"}, {"start": 266, "end": 284, "tag": "BadenWuerttemberg"}], "urls": [{"start": 285, "end": 308, "url": "https://t.co/FrYTXhPCfK", "expanded_url": "https://twitter.com/spdbawue/status/1418142724067319808/photo/1", "display_url": "pic.twitter.com/FrYTXhPCfK"}]}, "text": "Der @Landtag_BW hat einen #noAfD Mann in den Verfassungsgerichtshof gew\u00e4hlt. 37x Ja; 32x Nein; 77x Egal. F\u00fcr uns gilt seit \u00fcber 158 Jahren: klare Kante gegen Rechts &amp; kein Fu\u00dfbreit dem Faschismus! Verfassungsfeinde w\u00e4hlt man nicht in den Verfassungsgerichtshof. #BadenWuerttemberg https://t.co/FrYTXhPCfK", "reply_settings": "everyone", "author_id": "19062136", "public_metrics": {"retweet_count": 93, "reply_count": 71, "like_count": 634, "quote_count": 13}, "attachments": {"media_keys": ["3_1418142657923190787"]}, "lang": "de"}, {"conversation_id": "1416026853886803973", "created_at": "2021-07-16T13:28:47.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1416027031968567304", "referenced_tweets": [{"type": "replied_to", "id": "1416026853886803973"}], "text": "Schrecklich, mit welcher Macht die Wassermassen ganze D\u00f6rfer zerst\u00f6rt haben. Jetzt gilt es, den Betroffenen schnelle Hilfe zu leisten und Solidarit\u00e4t zu zeigen. Ich bin stolz, dass auch Einsatzkr\u00e4fte aus unserer Region nach NRW und RP aufgebrochen sind. (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 7, "quote_count": 0}, "in_reply_to_user_id": "738731811380076544", "lang": "de"}, {"conversation_id": "1416026853886803973", "created_at": "2021-07-16T13:28:05.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1416026853886803973", "text": "Meine Gedanken und Gebete sind bei den Menschen in NRW und RP. Mein Mitgef\u00fchl gilt den Verstorbenen, den Vermissten, den Angeh\u00f6rigen und allen, die ihr Hab und Gut durch das #Hochwasser verloren haben. (1/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 18, "quote_count": 0}, "entities": {"hashtags": [{"start": 174, "end": 185, "tag": "Hochwasser"}]}, "lang": "de"}, {"conversation_id": "1409879345913552898", "created_at": "2021-06-29T14:20:05.000Z", "possibly_sensitive": false, "source": "Twitter for Android", "id": "1409879345913552898", "text": "Die #Beitragsbemessungsgrenze muss deutlich angehoben werden. Breite Schultern m\u00fcssen ihren Beitrag auch bei den #Sozialabgaben leisten. Im Moment zahlen Gering- und Normalverdienende \u00fcberproportional in die Sozialkassen.", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 4, "reply_count": 2, "like_count": 18, "quote_count": 0}, "entities": {"hashtags": [{"start": 4, "end": 29, "tag": "Beitragsbemessungsgrenze"}, {"start": 113, "end": 127, "tag": "Sozialabgaben"}]}, "lang": "de"}, {"conversation_id": "1395277623996059650", "created_at": "2021-05-20T07:18:03.000Z", "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1395277623996059650", "entities": {"mentions": [{"start": 101, "end": 117, "username": "josip_juratovic", "id": "738731811380076544"}], "urls": [{"start": 119, "end": 142, "url": "https://t.co/ibj4ppXkJr", "expanded_url": "https://www.queer.de/docs/namentliche-abstimmung-gruene.pdf", "display_url": "queer.de/docs/namentlic\u2026"}]}, "text": "Darf man sich bei Ihnen f\u00fcr ihre anst\u00e4ndige Abstimmung gestern bedanken oder war dies ein Versehen ? @josip_juratovic  https://t.co/ibj4ppXkJr", "reply_settings": "everyone", "author_id": "980866921", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 7, "quote_count": 0}, "lang": "de"}, {"conversation_id": "1395306497438015488", "created_at": "2021-05-20T09:18:40.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1395307981345116163", "referenced_tweets": [{"type": "replied_to", "id": "1395306497438015488"}], "entities": {"mentions": [{"start": 0, "end": 16, "username": "josip_juratovic", "id": "738731811380076544"}]}, "text": "@josip_juratovic Hallo Herr Juratovic, haben Sie bewusst als einziger in Ihrer Fraktion f\u00fcr den Antrag gestimmt (manchmal vertun sich ja auch Politiker, siehe Altmaier neulich)? Falls ja, haben Sie gerade viele neue Fans gewonnen \ud83d\ude0a\ud83c\udf39\ud83d\udc4d", "reply_settings": "everyone", "author_id": "782527230", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 34, "quote_count": 0}, "in_reply_to_user_id": "782527230", "lang": "de"}, {"conversation_id": "1387386252350169090", "created_at": "2021-04-28T12:40:33.000Z", "possibly_sensitive": false, "source": "Twitter Web App", "id": "1387386253662949381", "referenced_tweets": [{"type": "replied_to", "id": "1387386252350169090"}], "text": "nicht alle B\u00fcrger*innen mit unseren Entscheidungen vollst\u00e4ndig zufrieden sein k\u00f6nnen. Ich habe Verst\u00e4ndnis, dass dies gerade in diesen herausfordernden Zeiten zu Diskussionen f\u00fchren kann.\nAllerdings erwarte ich, dass diese Diskussion mit #Respekt vor den gew\u00e4hlten (2/3)", "reply_settings": "everyone", "author_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 238, "end": 246, "tag": "Respekt"}]}, "in_reply_to_user_id": "738731811380076544", "lang"