count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1359122604016230409", "text": "Verl\u00e4ssliche und belastbare Informationen sind Grundstein jeder demokratischen Entscheidungsfindung. Am heutigen #SaferInternetDay muss besonders deutlich werden, dass #HateSpeech und #Cyberkriminalit\u00e4t ernstzunehmende Gefahren f\u00fcr unseren Rechtsstaat sind! @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 38, "end": 49, "username": "OlafScholz", "id": "38150247"}, {"start": 273, "end": 279, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 280, "end": 303, "url": "https://t.co/5zUprrxHb0", "expanded_url": "https://twitter.com/vorwaerts/status/1358490325841547266", "display_url": "twitter.com/vorwaerts/stat\u2026"}], "hashtags": [{"start": 81, "end": 99, "tag": "Zukunftsmissionen"}, {"start": 129, "end": 146, "tag": "Klimaneutralit\u00e4t"}, {"start": 148, "end": 164, "tag": "Mobilit\u00e4tswende"}, {"start": 166, "end": 182, "tag": "Digitalisierung"}, {"start": 187, "end": 209, "tag": "Gesundheitsversorgung"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "referenced_tweets": [{"type": "quoted", "id": "1358490325841547266"}], "created_at": "2021-02-08T10:25:06.000Z", "conversation_id": "1358723521657139201", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 3, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1358723521657139201", "text": "\"Die Zeit des Redens ist vorbei\" sagt @OlafScholz - jetzt wird angepackt! Unsere #Zukunftsmissionen bringen uns weiter in Sachen #Klimaneutralit\u00e4t, #Mobilit\u00e4tswende, #Digitalisierung und #Gesundheitsversorgung und spiegeln somit den Kernauftrag der Sozialdemokratie wider. @spdbt https://t.co/5zUprrxHb0"}, {"entities": {"mentions": [{"start": 236, "end": 242, "username": "spdbt", "id": "347792540"}, {"start": 243, "end": 256, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 69, "end": 89, "tag": "Koalitionsausschuss"}, {"start": 115, "end": 127, "tag": "Kinderbonus"}, {"start": 138, "end": 153, "tag": "Coronazuschlag"}]}, "created_at": "2021-02-04T17:13:26.000Z", "conversation_id": "1357376730558824452", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 2, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1357376730558824452", "text": "Die SPD bleibt stark an der Seite der Besch\u00e4ftigten und Familien: Im #Koalitionsausschuss wurden u.a. ein weiterer #Kinderbonus sowie ein #Coronazuschlag f\u00fcr Grundsicherungsempfangende beschlossen. Ein wichtiges Signal in Krisenzeiten! @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 260, "end": 273, "username": "stimmeonline", "id": "26986638"}, {"start": 274, "end": 280, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 281, "end": 304, "url": "https://t.co/2y6uEo3tAk", "expanded_url": "https://twitter.com/OlafScholz/status/1356183681379909634", "display_url": "twitter.com/OlafScholz/sta\u2026"}], "hashtags": [{"start": 91, "end": 101, "tag": "Lieferung"}, {"start": 106, "end": 116, "tag": "Impfstoff"}, {"start": 122, "end": 133, "tag": "Impfgipfel"}]}, "referenced_tweets": [{"type": "quoted", "id": "1356183681379909634"}], "created_at": "2021-02-01T17:34:02.000Z", "conversation_id": "1356294752174563336", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 4, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1356294752174563336", "text": "Um die Pandemie langfristig in den Griff zu bekommen, brauchen wir Verbindlichkeit bei der #Lieferung von #Impfstoff. Der #Impfgipfel muss Klarheit schaffen - nicht nur f\u00fcr Politiker*innen, sondern vor allem f\u00fcr die Bev\u00f6lkerung, deren \u00dcberleben davon abh\u00e4ngt! @stimmeonline @spdbt https://t.co/2y6uEo3tAk"}, {"created_at": "2021-01-27T09:02:05.000Z", "attachments": {"media_keys": ["3_1354353920726982656"]}, "conversation_id": "1354353977756938243", "author_id": "738731811380076544", "entities": {"urls": [{"start": 281, "end": 304, "url": "https://t.co/wbmtki9VWE", "expanded_url": "https://twitter.com/josip_juratovic/status/1354353977756938243/photo/1", "display_url": "pic.twitter.com/wbmtki9VWE"}], "hashtags": [{"start": 0, "end": 11, "tag": "WeRemember"}, {"start": 270, "end": 280, "tag": "NieWieder"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 6, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1354353977756938243", "text": "#WeRemember Am 27.01.1945 wurde das KZ Auschwitz-Birkenau befreit. Wir d\u00fcrfen unter unsere Geschichte keinen Schlussstrich ziehen. Vielmehr m\u00fcssen wir die Erinnerung wach halten, das ist unser aller Verantwortung. Deshalb gedenken wir heute den Opfern des Nazi-Regimes. #NieWieder https://t.co/wbmtki9VWE"}, {"entities": {"mentions": [{"start": 260, "end": 266, "username": "spdbt", "id": "347792540"}, {"start": 267, "end": 280, "username": "stimmeonline", "id": "26986638"}], "urls": [{"start": 281, "end": 304, "url": "https://t.co/ztJuuwk9Rq", "expanded_url": "https://twitter.com/spdbt/status/1352599962446606336", "display_url": "twitter.com/spdbt/status/1\u2026"}], "hashtags": [{"start": 29, "end": 35, "tag": "Krise"}, {"start": 78, "end": 91, "tag": "Zusammenhalt"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}, {"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}], "referenced_tweets": [{"type": "quoted", "id": "1352599962446606336"}], "created_at": "2021-01-25T10:16:50.000Z", "conversation_id": "1353648011767898114", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1353648011767898114", "text": "Die Kraft, die uns durch die #Krise bringt? Klare Antwort: Gesellschaftlicher #Zusammenhalt! Wer es ernst meint, muss auch die im Blick haben, die schon vor Ausbruch der Pandemie an Armuts- und Belastungsgrenze gelebt haben. Zuschuss zur Grundsicherung jetzt! @spdbt @stimmeonline https://t.co/ztJuuwk9Rq"}, {"context_annotations": [{"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1349062721677914112", "name": "Inauguration Day: Watch as Joe Biden and Kamala Harris are sworn into office"}}, {"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "10040395078", "name": "Joe Biden", "description": "US President Joe Biden"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "10040395078", "name": "Joe Biden", "description": "US President Joe Biden"}}], "referenced_tweets": [{"type": "quoted", "id": "1352175828285730816"}], "created_at": "2021-01-21T17:14:40.000Z", "conversation_id": "1352303612295327752", "author_id": "738731811380076544", "entities": {"urls": [{"start": 262, "end": 285, "url": "https://t.co/yS18nP6pSo", "expanded_url": "https://twitter.com/SZ/status/1352175828285730816", "display_url": "twitter.com/SZ/status/1352\u2026"}], "hashtags": [{"start": 4, "end": 21, "tag": "Inauguration2021"}, {"start": 127, "end": 138, "tag": "Demokratie"}, {"start": 250, "end": 261, "tag": "bethelight"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 4, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1352303612295327752", "text": "Die #Inauguration2021 markiert einen Wendepunkt - nicht nur in der Geschichte der USA, sondern auch in unserem Verst\u00e4ndnis von #Demokratie. Es liegen jetzt einige Herausforderungen vor uns, um das transatlantische Verh\u00e4ltnis wieder gerade zu r\u00fccken. #bethelight https://t.co/yS18nP6pSo"}, {"referenced_tweets": [{"type": "replied_to", "id": "1351879455569039361"}], "created_at": "2021-01-20T13:09:13.000Z", "conversation_id": "1351879455569039361", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "und", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 2, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1351879457250881538", "text": "Pozdravljam odluku Bundes kabineta koji je potvrdio kolegu Christiana Schmidta za kandidata visokog predstavnika za Bosnu i Hercegovinu \ud83c\udde7\ud83c\udde6 ispred Njema\u010dke! \u010cestitam."}, {"created_at": "2021-01-20T13:09:13.000Z", "conversation_id": "1351879455569039361", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 3, "like_count": 6, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1351879455569039361", "text": "Ich begr\u00fc\