Arme gegriffen! @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 271, "end": 277, "username": "spdbt", "id": "347792540"}], "hashtags": [{"start": 41, "end": 48, "tag": "Weidel"}, {"start": 57, "end": 63, "tag": "noAfD"}, {"start": 99, "end": 111, "tag": "Impfdebatte"}, {"start": 164, "end": 176, "tag": "Impfpflicht"}]}, "created_at": "2021-01-13T13:02:02.000Z", "conversation_id": "1349340932097912832", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1349340932097912832", "text": "Die gezielte Desinformation, wie sie von #Weidel und der #noAfD verbreitet wird, helfen uns in der #Impfdebatte nicht weiter. Wir haben klar gemacht: Es wird keine #Impfpflicht geben. Stattdessen m\u00fcssen wir Aufkl\u00e4rungsarbeit betreiben, damit die Impfbereitschaft steigt! @spdbt"}, {"referenced_tweets": [{"type": "replied_to", "id": "1347494318945280000"}], "created_at": "2021-01-08T10:44:15.000Z", "conversation_id": "1347494316206387200", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 1}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1347494320253906944", "text": "Es ist h\u00f6chste Zeit, dass wir endlich aufwachen und unsere Demokratie verteidigen, denn wer der in der Demokratie schl\u00e4ft, wird in der Diktatur aufwachen - und aus der Diktatur gibt es kein Zur\u00fcck mehr ohne Blutvergie\u00dfen. (4/4)"}, {"referenced_tweets": [{"type": "replied_to", "id": "1347494317577920513"}], "created_at": "2021-01-08T10:44:15.000Z", "conversation_id": "1347494316206387200", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1347494318945280000", "text": "Wohin ein solcher Trumpismus f\u00fchrt, kann man seit drei Jahrzehnten auf dem Westbalkan verfolgen - gegen solche Tendenzen k\u00e4mpfe ich jeden Tag, denn f\u00fcr die M\u00e4chtigen, die sich diesem Ph\u00e4nomen bedienen, spielen demokratische Spielregeln keine Rolle mehr. (3/4)"}, {"referenced_tweets": [{"type": "replied_to", "id": "1347494316206387200"}], "created_at": "2021-01-08T10:44:15.000Z", "conversation_id": "1347494316206387200", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1347494317577920513", "text": "Das ist die Entwicklung, die wir aktuell in den USA verfolgen k\u00f6nnen. Leider sind die USA nicht das einzige Land, das diese \u201eF\u00e4ulnis\u201c der gesellschaftlichen Grundordnung offenlegt. Inzwischen ist das Ph\u00e4nomen des Trumpismus bedauerlicherweise auch bei uns zu finden. (2/4)"}, {"context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "10040395078", "name": "Joe Biden", "description": "US President Joe Biden"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "10040395078", "name": "Joe Biden", "description": "US President Joe Biden"}}], "created_at": "2021-01-08T10:44:14.000Z", "conversation_id": "1347494316206387200", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 3, "quote_count": 0}, "entities": {"hashtags": [{"start": 34, "end": 47, "tag": "WashingtonDC"}