t unserer eigenen Handlungsf\u00e4higkeit auch ein Zeichen f\u00fcr Europa. Dank @OlafScholz verabschieden wir einen #Haushalt mit klar sozialdemokratischer Handschrift, der #Krisenbew\u00e4ltigung gro\u00df schreibt! @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 231, "end": 244, "username": "stimmeonline", "id": "26986638"}], "urls": [{"start": 6, "end": 29, "url": "https://t.co/yIhs8pFj2x", "expanded_url": "http://stadtarchiv.heilbronn.de", "display_url": "stadtarchiv.heilbronn.de"}]}, "referenced_tweets": [{"type": "replied_to", "id": "1334790207145734144"}], "created_at": "2020-12-04T09:22:39.000Z", "conversation_id": "1334790207145734144", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1334790208328491008", "text": "Unter https://t.co/yIhs8pFj2x gibt es au\u00dferdem Ausschnitte der Ausstellung \u201eFeuersturm \u2013 aus der Sammlung des Stadtarchivs\u201c zu sehen. Diese schrecklichen Bilder erinnern uns daran, wie wichtig es ist, f\u00fcr Frieden zusammenzustehen. @stimmeonline"}, {"created_at": "2020-12-04T09:22:39.000Z", "conversation_id": "1334790207145734144", "author_id": "738731811380076544", "entities": {"urls": [{"start": 110, "end": 133, "url": "https://t.co/YRUQC5Pymq", "expanded_url": "http://www.heilbronn.de/", "display_url": "heilbronn.de", "status": 200, "title": "Stadt Heilbronn: Startseite", "description": "Offizielles Internetportal der Stadt Heilbronn", "unwound_url": "https://www.heilbronn.de/startseite.html"}, {"start": 247, "end": 270, "url": "https://t.co/UrI1WBL5wl", "expanded_url": "http://heilbronnerfriedensweg.com", "display_url": "heilbronnerfriedensweg.com"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1334790207145734144", "text": "Heute gedenken wir der Bombardierung Heilbronns vor 76 Jahren auf dem Ehrenfriedhof. Die Gedenkfeier kann auf https://t.co/YRUQC5Pymq ab 19 Uhr angeschaut werden. Auch sehenswert: Der virtuelle, \u00f6kumenische Friedensweg der Kirchen, abrufbar unter https://t.co/UrI1WBL5wl."}, {"entities": {"mentions": [{"start": 255, "end": 261, "username": "spdbt", "id": "347792540"}, {"start": 262, "end": 275, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 10, "end": 54, "tag": "InternationalerTagDerMenschenMitBehinderung"}, {"start": 93, "end": 103, "tag": "Inklusion"}, {"start": 108, "end": 117, "tag": "Teilhabe"}]}, "created_at": "2020-12-03T13:22:31.000Z", "conversation_id": "1334488185217413120", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1334488185217413120", "text": "Heute ist #InternationalerTagDerMenschenMitBehinderung, der uns dazu mahnt, f\u00fcr vollst\u00e4ndige #Inklusion und #Teilhabe zu k\u00e4mpfen. \u00dcbrigens bedeutet das f\u00fcr mich auch, dass alle, die in Behindertenwerkst\u00e4tten besch\u00e4ftigt sind, fair entlohnt werden m\u00fcssen! @spdbt @stimmeonline"}, {"created_at": "2020-11-25T13:35:08.000Z", "attachments": {"media_keys": ["3_1331592191421149190"]}, "conversation_id": "1331592256244035584", "author_id": "738731811380076544", "entities": {"urls": [{"start": 271, "end": 294, "url": "https://t.co/geOZDzpOmU", "expanded_url": "https://twitter.com/josip_juratovic/status/1331592256244035584/photo/1", "display_url": "pic.twitter.com/geOZDzpOmU"}], "hashtags": [{"start": 12, "end": 35, "tag": "TagGegenGewaltAnFrauen"}, {"start": 153, "end": 170, "tag": "schweigenbrechen"}, {"start": 255, "end": 270, "tag": "OrangeTheWorld"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1331592256244035584", "text": "Am heutigen #TagGegenGewaltAnFrauen machen wir lautstark auf die Gewalt aufmerksam, der M\u00e4dchen und Frauen t\u00e4glich ausgesetzt sind. Nur gemeinsam kann   #schweigenbrechen gelingen. Im Notfall ist das Hilfetelefon rund um die Uhr erreichbar - danke daf\u00fcr. #OrangeTheWorld https://t.co/geOZDzpOmU"}, {"entities": {"mentions": [{"start": 243, "end": 256, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 51, "end": 71, "tag": "Breitbandversorgung"}, {"start": 92, "end": 103, "tag": "HomeOffice"}, {"start": 223, "end": 235, "tag": "Jagsthausen"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "created_at": "2020-11-24T14:51:33.000Z", "conversation_id": "1331249098142474240", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1331249098142474240", "text": "Wir sehen gerade jetzt, wie wichtig der Ausbau der #Breitbandversorgung f\u00fcr unser Land ist: #HomeOffice. Der Bund unterst\u00fctzt dabei die kommunalen Projekte vor Ort. 918.000 Euro  flie\u00dfen dabei f\u00fcr schnelleres Internet nach #Jagsthausen. @BMVI @stimmeonline"}, {"created_at": "2020-11-23T12:53:54.000Z", "attachments": {"media_keys": ["3_1330856972040671237"]}, "conversation_id": "1330857103934812160", "author_id": "738731811380076544", "entities": {"urls": [{"start": 151, "end": 174, "url": "https://t.co/ZkmuUmNRu8", "expanded_url": "https://twitter.com/josip_juratovic/status/1330857103934812160/photo/1", "display_url": "pic.twitter.com/ZkmuUmNRu8"}], "hashtags": [{"start": 4, "end": 18, "tag": "Boellerverbot"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1330857103934812160", "text": "Ein #Boellerverbot in diesem Jahr w\u00e4re ein klares Bekenntnis zur R\u00fccksicht gegen\u00fcber Mensch, Tier und Umwelt - meinem Pajdo gef\u00e4llt das in jedem Fall! https://t.co/ZkmuUmNRu8"}, {"entities": {"mentions": [{"start": 259, "end": 265, "username": "spdbt", "id": "347792540"}, {"start": 266, "end": 279, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 42, "end": 53, "tag": "Grundrecht"}, {"start": 126, "end": 134, "tag": "Respekt"}, {"start": 235, "end": 258, "tag": "Infektionsschutzgesetz"}]}, "created_at": "2020-11-18T13:36:09.000Z", "conversation_id": "1329055795934322689", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 4, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1329055795934322689", "text": "Das Demonstrationsrecht ist ein wichtiges #Grundrecht unserer Verfassung, welches ich respektiere. Doch: Ich w\u00fcnsche mir mehr #Respekt der Demonstrierenden vor dem Amt, der legitim gew\u00e4hlten Repr\u00e4sentanten der B\u00fcrgerinnen und B\u00fcrger. \n#Infektionsschutzgesetz\n@spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 263, "end": 269, "username": "spdbt", "id": "347792540"}], "hashtags": [{"start": 47, "end": 55, "tag": "Vukovar"}, {"start": 120, "end": 128, "tag": "Frieden"}]}, "created_at": "2020-11-17T17:50:05.000Z", "conversation_id": "1328757315210797058", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 2, "like_count": 13, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1328757315210797058", "text": "Wir gedenken heute den unschuldigen Opfern von #Vukovar. Dieses Gedenken muss Ermutigung f\u00fcr uns sein, f\u00fcr Vergebung u. #Frieden zu arbeiten - Tag f\u00fcr Tag. Diese schrecklichen Gr\u00e4ueltaten, die Tr\u00e4nen unschuldiger Kinder, Blut und Tod d\u00fcrfen nie wieder vorkommen. @spdbt"}, {"entities": {"mentions": [{"start": 40, "end": 51, "username": "Zoran_Zaev", "id": "1648317175"}, {"start": 93, "end": 103, "username": "FESonline", "id": "144862179"}], "urls": [{"start": 230, "end": 253, "url": "https://t.co/cOeHRs7GMU", "expanded_url": "https://twitter.com/Zoran_Zaev/status/1328445232296452101", "display_url": "twitter.com/Zoran_Zaev/sta\u2026"}]}, "referenced_tweets": [{"type": "quoted", "id": "1328445232296452101"}], "created_at": "2020-11-17T11:24:15.000Z", "conversation_id": "1328660217068974080", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 7, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1328660217068974080", "text": "Herzlichen Gl\u00fcckwunsch an meinen Freund @Zoran_Zaev, der gestern den Menschenrechtspreis der @FESonline erhielt. Seine Leistungen f\u00fcr \ud83c\uddf2\ud83c\uddf0 zeugen von einem starken, europ\u00e4ischen Geist, der nach Frieden und Freiheit f\u00fcr alle strebt. https://t.co/cOeHRs7GMU"}, {"entities": {"mentions": [{"start": 246, "end": 252, "username": "spdbt", "id": "347792540"}, {"start": 253, "end": 266, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 34, "end": 40, "tag": "Paris"}, {"start": 44, "end": 53, "tag": "Bataclan"}]}, "created_at": "2020-11-13T14:34:39.000Z", "conversation_id": "1327258580110745601", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1327258580110745601", "text": "Heute j\u00e4hrt sich der Anschlag von #Paris im #Bataclan zum 5. Mal - Europa trauert um die Toten. Meine Gedanken sind heute bei allen Angeh\u00f6rigen und jenen, die mit den Folgen dieses Terrors zu k\u00e4mpfen haben. Jedes der 130 Opfer ist eines zu viel. @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 225, "end": 236, "username": "OlafScholz", "id": "38150247"}, {"start": 237, "end": 243, "username": "spdbt", "id": "347792540"}, {"start": 244, "end": 257, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 19, "end": 33, "tag": "Haushaltslage"}, {"start": 103, "end": 110, "tag": "Corona"}, {"start": 258, "end": 274, "tag": "Steuersch\u00e4tzung"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "created_at": "2020-11-12T17:16:30.000Z", "conversation_id": "1326936924393779201", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1326936924393779201", "text": "Trotz angespannter #Haushaltslage darf es jetzt nicht zu Einsparungen am falschen Ende kommen. Weitere #Corona-Gelder m\u00fcssen flie\u00dfen - bereits gestellte Antr\u00e4ge schnellstm\u00f6glich bearbeitet werden, um Hilfe leisten zu k\u00f6nnen. @olafscholz @spdbt @stimmeonline #Steuersch\u00e4tzung"}, {"entities": {"mentions": [{"start": 244, "end": 256, "username": "Europarl_DE", "id": "36332848"}, {"start": 258, "end": 264, "username": "spdbt", "id": "347792540"}, {"start": 265, "end": 278, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 21, "end": 24, "tag": "EU"}]}, "context_annotations": [{"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "1127870700109189121", "name": "European Parliament", "description": "European Parliament"}}], "created_at": "2020-11-12T08:35:43.000Z", "conversation_id": "1326805864418775040", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1326805864418775040", "text": "Die Einigung auf den #EU-Haushalt ist ein Erfolg. Auch in Krisenzeiten bleiben wir damit stark und handlungsf\u00e4hig. Wir blicken mit unserem Haushalt nicht nur auf die krisengepr\u00e4gte Gegenwart, sondern wagen einen mutigen Schritt in die Zukunft! @Europarl_DE  @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 249, "end": 255, "username": "spdbt", "id": "347792540"}, {"start": 256, "end": 269, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 7, "end": 15, "tag": "Schmidt"}, {"start": 43, "end": 56, "tag": "Leidenschaft"}, {"start": 104, "end": 111, "tag": "Europa"}, {"start": 189, "end": 199, "tag": "Charakter"}]}, "created_at": "2020-11-10T13:25:45.000Z", "conversation_id": "1326154078825701376", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1326154078825701376", "text": "Helmut #Schmidt war ein Politiker, der mit #Leidenschaft und klarer Sprache sich f\u00fcr unser Land und f\u00fcr #Europa eingesetzt hat. Immer mit klarem Kompass. Gerade in der Krise zeige sich der #Charakter - davon brauchen wir heute wieder mehr, denn je. @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 244, "end": 250, "username": "spdbt", "id": "347792540"}, {"start": 251, "end": 264, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 7, "end": 16, "tag": "November"}, {"start": 85, "end": 96, "tag": "Geschichte"}, {"start": 111, "end": 126, "tag": "Antisemitismus"}, {"start": 213, "end": 223, "tag": "NieWieder"}, {"start": 225, "end": 243, "tag": "Reichspogromnacht"}]}, "created_at": "2020-11-09T08:07:20.000Z", "conversation_id": "1325711556563365889", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1325711556563365889", "text": "Der 9. #November: ein geschichtstr\u00e4chtiger Tag in der deutschen, in der europ\u00e4ischen #Geschichte. Das Gift des #Antisemitismus zieht sich immer st\u00e4rker durch unsere \u00d6ffentlichkeit. Unsere Antwort darauf ist klar: #NieWieder! #Reichspogromnacht @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 159, "end": 172, "username": "election2020", "id": "17349789"}, {"start": 173, "end": 179, "username": "spdbt", "id": "347792540"}, {"start": 180, "end": 193, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 36, "end": 48, "tag": "Pr\u00e4sidenten"}]}, "created_at": "2020-11-07T18:25:12.000Z", "conversation_id": "1325142273131229184", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 27, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1325142273131229184", "text": "Die Vereinigten Staaten haben ihren #Pr\u00e4sidenten gew\u00e4hlt. Auch hierzulande ist Aufbruchsstimmung zu versp\u00fcren - auf eine gute transatlantische Zusammenarbeit! @Election2020 @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 258, "end": 264, "username": "spdbt", "id": "347792540"}, {"start": 265, "end": 278, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 243, "end": 257, "tag": "Elections2020"}]}, "context_annotations": [{"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1318573265820921857", "name": "2020 US Election Day"}}], "created_at": "2020-11-04T13:17:52.000Z", "conversation_id": "1323977764618252290", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 8, "quote_count": 1}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1323977764618252290", "text": "Wir befinden uns in einem Kampf zwischen humanistischer und egoistischer Weltanschauung. Dabei wird es immer deutlicher, dass sich der Humanismus - in Form von demokratischen Werten - nicht mehr gegen den entfesselten Egoismus behaupten kann. #Elections2020 @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 171, "end": 177, "username": "spdbt", "id": "347792540"}, {"start": 178, "end": 191, "username": "stimmeonline", "id": "26986638"}]}, "referenced_tweets": [{"type": "replied_to", "id": "1323925307808763910"}], "created_at": "2020-11-04T09:49:25.000Z", "conversation_id": "1323925307808763910", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1323925309134118912", "text": "Fest steht, dass wir in Zukunft ein gefestigteres, vertrauensbasiertes transatlantisches Verh\u00e4ltnis ben\u00f6tigen, um globale Herausforderungen auch global angehen zu k\u00f6nnen. @spdbt @stimmeonline (2/2)"}, {"context_annotations": [{"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1029453725360775168", "name": "2020 US Presidential Election", "description": "2020 US Presidential Election"}}, {"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1318573265820921857", "name": "2020 US Election Day"}}], "created_at": "2020-11-04T09:49:25.000Z", "conversation_id": "1323925307808763910", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 3, "quote_count": 0}, "entities": {"hashtags": [{"start": 27, "end": 31, "tag": "USA"}, {"start": 36, "end": 49, "tag": "Election2020"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1323925307808763910", "text": "Die Wahlbeteiligung in den #USA zur #Election2020 ist historisch. Sie zeugt von dem Willen des US-amerikanischen Volkes, sein demokratisches Recht zur freien Wahl wahrzunehmen. Deutschland und Europa halten sich f\u00fcr jeden Wahlausgang bereit. (1/2)"}, {"entities": {"mentions": [{"start": 254, "end": 260, "username": "spdbt", "id": "347792540"}, {"start": 261, "end": 274, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 76, "end": 83, "tag": "Terror"}, {"start": 143, "end": 148, "tag": "Wien"}, {"start": 214, "end": 226, "tag": "Terrorismus"}]}, "created_at": "2020-11-03T10:06:22.000Z", "conversation_id": "1323567186020093958", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 3, "reply_count": 5, "like_count": 20, "quote_count": 1}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1323567186020093958", "text": "Gestern Frankreich, heute \u00d6sterreich: Unsere europ\u00e4ischen Nachbarn sind vom #Terror schwer gezeichnet. Wir alle trauern heute um die Opfer von #Wien und w\u00fcnschen den Verletzten schnelle Genesung. Solidarit\u00e4t gegen #Terrorismus ist nun wichtiger denn je. @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 25, "end": 39, "username": "hubertus_heil", "id": "15943222"}, {"start": 260, "end": 266, "username": "spdbt", "id": "347792540"}, {"start": 267, "end": 280, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 91, "end": 105, "tag": "Besch\u00e4ftigten"}, {"start": 106, "end": 117, "tag": "Homeoffice"}, {"start": 209, "end": 215, "tag": "Kitas"}, {"start": 221, "end": 234, "tag": "Pflegeheimen"}, {"start": 245, "end": 258, "tag": "Flie\u00dfb\u00e4ndern"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}, {"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}], "created_at": "2020-11-02T10:25:55.000Z", "conversation_id": "1323209716995117056", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 6, "reply_count": 2, "like_count": 27, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1323209716995117056", "text": "Ich kann meinem Kollegen @hubertus_heil nur zustimmen: Dort wo es m\u00f6glich ist, sollten die #Besch\u00e4ftigten #Homeoffice machen. Damit sch\u00fctzen wir auch diejenigen, die nicht von zu Hause arbeiten k\u00f6nnen: in den #Kitas, den #Pflegeheimen u. an den #Flie\u00dfb\u00e4ndern. @spdbt @stimmeonline"}, {"entities": {"mentions": [{"start": 41, "end": 57, "username": "Karl_Lauterbach", "id": "3292982985"}, {"start": 252, "end": 258, "username": "spdbt", "id": "347792540"}, {"start": 259, "end": 272, "username": "stimmeonline", "id": "26986638"}], "urls": [{"start": 273, "end": 296, "url": "https://t.co/Aghmhjsw1L", "expanded_url": "https://twitter.com/Die_Insider/status/1321772552809816069", "display_url": "twitter.com/Die_Insider/st\u2026"}]}, "context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "referenced_tweets": [{"type": "quoted", "id": "1321772552809816069"}], "created_at": "2020-10-30T08:54:17.000Z", "conversation_id": "1322099494595547136", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 20, "reply_count": 9, "like_count": 153, "quote_count": 6}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1322099494595547136", "text": "Mit einzigartigem Sachverstand hilft uns @Karl_Lauterbach den richtigen Weg durch die Krise zu finden. Den Hass und die Morddrohungen, die er daf\u00fcr erh\u00e4lt, muss der starke Rechtsstaat unnachgiebig verfolgen und ahnden. Solidarit\u00e4t mit meinem Kollegen! @spdbt @stimmeonline https://t.co/Aghmhjsw1L"}, {"context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "created_at": "2020-10-29T13:29:28.000Z", "conversation_id": "1321806357503369221", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "entities": {"hashtags": [{"start": 20, "end": 42, "tag": "WellenbrecherShutdown"}, {"start": 262, "end": 273, "tag": "stayathome"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1321806357503369221", "text": "Einen kurzfristigen #WellenbrecherShutdown halte ich in der ggw. Lage f\u00fcr notwendig, obwohl ich einen differenzierteren Umgang mit Gastronomie- und Kulturbetrieben, die sich an die Regeln gehalten haben, bef\u00fcrworte. Jetzt gilt es, weiterhin solidarisch zu sein! #stayathome"}, {"entities": {"mentions": [{"start": 255, "end": 261, "username": "spdbt", "id": "347792540"}, {"start": 262, "end": 275, "username": "stimmeonline", "id": "26986638"}], "urls": [{"start": 276, "end": 299, "url": "https://t.co/JNFnxg4aBV", "expanded_url": "https://twitter.com/josip_juratovic/status/1320666095552966656/photo/1", "display_url": "pic.twitter.com/JNFnxg4aBV"}], "hashtags": [{"start": 24, "end": 34, "tag": "oppermann"}]}, "created_at": "2020-10-26T09:58:28.000Z", "attachments": {"media_keys": ["3_1320665978167058432"]}, "conversation_id": "1320666095552966656", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 4, "reply_count": 1, "like_count": 32, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1320666095552966656", "text": "Ruhe in Frieden, Thomas #oppermann. Du wirst uns stets in Erinnerung bleiben - als scharfsinniger Au\u00dfenpolitiker und leidenschaftlicher Sozialdemokrat, vor allem jedoch als wehrhafter Demokrat. Unsere Gedanken sind bei deinen Angeh\u00f6rigen und deinem Team. @spdbt @stimmeonline https://t.co/JNFnxg4aBV"}, {"referenced_tweets": [{"type": "replied_to", "id": "1318847597159862272"}], "created_at": "2020-10-21T09:43:48.000Z", "conversation_id": "1318847597159862272", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "und", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "entities": {"hashtags": [{"start": 0, "end": 16, "tag": "Rassismusstudie"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1318850466189615104", "text": "#Rassismusstudie"}, {"entities": {"mentions": [{"start": 264, "end": 277, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 19, "end": 29, "tag": "Vertrauen"}, {"start": 65, "end": 75, "tag": "Rassismus"}, {"start": 87, "end": 101, "tag": "Institutionen"}, {"start": 125, "end": 137, "tag": "Anst\u00e4ndigen"}, {"start": 165, "end": 174, "tag": "Seehofer"}, {"start": 228, "end": 236, "tag": "Politik"}]}, "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "887720012340879360", "name": "Horst Seehofer", "description": "Horst Seehofer"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "887720012340879360", "name": "Horst Seehofer", "description": "Horst Seehofer"}}], "created_at": "2020-10-21T09:32:24.000Z", "conversation_id": "1318847597159862272", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1318847597159862272", "text": "Aufkl\u00e4rung schafft #Vertrauen: deshalb brauchen wir Studien \u00fcber #Rassismus in staatl. #Institutionen. Damit st\u00e4rken wir die #Anst\u00e4ndigen, der Mehrheit, den R\u00fccken. #Seehofer scheint den Vertrauensverlust der Bev\u00f6lkerung in die #Politik einfach in Kauf zu nehmen! @stimmeonline"}, {"context_annotations": [{"domain": {"id": "123", "name": "Ongoing News Story", "description": "Ongoing News Stories like 'Brexit'"}, "entity": {"id": "1220701888179359745", "name": "COVID-19"}}], "created_at": "2020-10-20T10:21:32.000Z", "attachments": {"media_keys": ["3_1318497535716188162"]}, "conversation_id": "1318497571111829504", "author_id": "738731811380076544", "entities": {"urls": [{"start": 273, "end": 296, "url": "https://t.co/Ctsa6m3tl7", "expanded_url": "https://twitter.com/josip_juratovic/status/1318497571111829504/photo/1", "display_url": "pic.twitter.com/Ctsa6m3tl7"}], "hashtags": [{"start": 28, "end": 35, "tag": "corona"}, {"start": 2