otations": [{"domain": {"id": "45", "name": "Brand Vertical", "description": "Top level entities that describe a Brands industry"}, "entity": {"id": "781974596157251587", "name": "Government/Education"}}, {"domain": {"id": "46", "name": "Brand Category", "description": "Categories within Brand Verticals that narrow down the scope of Brands"}, "entity": {"id": "781974597226729473", "name": "Non-profit"}}, {"domain": {"id": "47", "name": "Brand", "description": "Brands and Companies"}, "entity": {"id": "10044311823", "name": "United Nations", "description": "Global conversation about the United Nations and all related efforts."}}, {"domain": {"id": "47", "name": "Brand", "description": "Brands and Companies"}, "entity": {"id": "10044311825", "name": "World Food Programme"}}, {"domain": {"id": "88", "name": "Political Body", "description": "A section of a government, like The Supreme Court"}, "entity": {"id": "10044311823", "name": "United Nations", "description": "Global conversation about the United Nations and all related efforts."}}], "created_at": "2020-10-10T11:54:57.000Z", "conversation_id": "1314897205074038784", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1314897205074038784", "text": "#Gl\u00fcckwunsch, David #Beasley! Vor zwei Wochen tauschten wir uns zu #globalen Themen aus. Er ist Direktor des #WFP - Weltern\u00e4hrungsprogramms der #UN. Eine Welt ohne #Hunger ist m\u00f6glich, wenn wir entschlossen vorangehen! #Friedensnobelpreis @stimmeonline"}, {"created_at": "2020-10-08T09:06:32.000Z", "conversation_id": "1314130044390985728", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "entities": {"hashtags": [{"start": 61, "end": 71, "tag": "vordenker"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1314130044390985728", "text": "Vor 28 Jahren starb mit Willy Brandt ein gro\u00dfer europ\u00e4ischer #vordenker. Seine Art der Politik und sein konsequenter Kampf f\u00fcr seine - oft nicht unumstrittenen - Ideen haben mich tief gepr\u00e4gt. Auch heute m\u00fcssen wir wieder mutiger werden und in Willys Sinne handeln!"}, {"created_at": "2020-10-07T10:50:09.000Z", "attachments": {"media_keys": ["3_1313793676020154368"]}, "conversation_id": "1313793734073610243", "author_id": "738731811380076544", "entities": {"urls": [{"start": 276, "end": 299, "url": "https://t.co/iB1kti68la", "expanded_url": "https://twitter.com/josip_juratovic/status/1313793734073610243/photo/1", "display_url": "pic.twitter.com/iB1kti68la"}], "hashtags": [{"start": 142, "end": 145, "tag": "EU"}, {"start": 254, "end": 267, "tag": "Gemeinschaft"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1313793734073610243", "text": "Unsere Parlamentsgruppe S\u00fcdosteuropa empfing heute die Botschafterinnen aus \ud83c\uddf7\ud83c\uddf8 und \ud83c\udde7\ud83c\udde6 zum Gespr\u00e4ch. Unser Anliegen ist und bleibt der baldige #EU-Beitritt der L\u00e4nder des Westbalkan. Wir sind uns einig: Der Innenhof Europas muss vollwertiger Teil unserer #Gemeinschaft werden. https://t.co/iB1kti68la"}, {"entities": {"mentions": [{"start": 253, "end": 266, "username": "stimmeonline", "id": "26986638"}, {"start": 267, "end": 273, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 274, "end": 297, "url": "https://t.co/j7gWtLApwf", "expanded_url": "https://twitter.com/josip_juratovic/status/1313456033331924992/photo/1", "display_url": "pic.twitter.com/j7gWtLApwf"}], "hashtags": [{"start": 37, "end": 44, "tag": "Europa"}]}, "created_at": "2020-10-06T12:28:15.000Z", "attachments": {"media_