tag": "rassismus"}]}, "referenced_tweets": [{"type": "replied_to", "id": "1311231280735019010"}], "created_at": "2020-09-30T09:07:53.000Z", "conversation_id": "1311231280735019010", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1311231281993318400", "text": "Wir brauchen ausf\u00fchrliche Untersuchungen zur Verfassungstreue innerhalb staatl. Organe, z.B. in Polizei, Bundeswehr etc.\n \nNur saubere und unabh\u00e4ngige Aufkl\u00e4rung kann Stigmatisierung und Misstrauen vorbeugen!\n#racialprofiling #rassismus @stimmeonline @spdbt"}, {"created_at": "2020-09-30T09:07:53.000Z", "conversation_id": "1311231280735019010", "author_id": "738731811380076544", "entities": {"urls": [{"start": 256, "end": 279, "url": "https://t.co/H77hjxhsGo", "expanded_url": "https://www.stimme.de/suedwesten/nachrichten/pl/innenminister-strobl-offen-fuer-umfassende-extremismus-studie;art19070,4400223", "display_url": "stimme.de/suedwesten/nac\u2026"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 4, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1311231280735019010", "text": "Strobls Forderung verschleiert die Notwendigkeit von Untersuchungen innerhalb unserer staatl. Institutionen. Sie sind daf\u00fcr verantwortlich, dass sich die Bev\u00f6lkerung auf die Einhaltung von Recht und Ordnung verlassen kann. Sie haben eine Vorbildfunktion.\n\nhttps://t.co/H77hjxhsGo"}, {"entities": {"mentions": [{"start": 202, "end": 213, "username": "OlafScholz", "id": "38150247"}, {"start": 258, "end": 264, "username": "spdbt", "id": "347792540"}, {"start": 265, "end": 278, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 68, "end": 77, "tag": "Menschen"