t": 173, "end": 179, "tag": "Halle"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1310510565866049538", "text": "Heute ist #JomKippur, der h\u00f6chste j\u00fcdische Feiertag - Gmar Chatima tova w\u00fcnsche ich allen, die heute das Vers\u00f6hnungsfest begehen. Gleichzeitig gedenken wir dem Anschlag von #Halle. Unsere Botschaft muss klar sein: Antisemitismus hat in unserer Gesellschaft keinen Platz!"}, {"entities": {"mentions": [{"start": 4, "end": 18, "username": "EU_Commission", "id": "157981564"}, {"start": 251, "end": 264, "username": "stimmeonline", "id": "26986638"}, {"start": 273, "end": 279, "username": "spdbt", "id": "347792540"}], "hashtags": [{"start": 86, "end": 89, "tag": "EU"}, {"start": 196, "end": 203, "tag": "Werten"}, {"start": 265, "end": 272, "tag": "eu2020"}]}, "created_at": "2020-09-23T13:49:29.000Z", "conversation_id": "1308765434271936513", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1308765434271936513", "text": "Die @EU_Commission  hat endlich einen Vorschlag f\u00fcr die Reform des Asylsystems in der #EU vorgestellt. Die Mitgliedstaaten m\u00fcssen solidarischer zusammenarbeiten, dies sind wir unseren gemeinsamen #Werten schuldig - vor allem aber den Schutzsuchenden. @stimmeonline #eu2020 @spdbt", "geo": {"place_id": "3054197b67639531"}}, {"entities": {"mentions": [{"start": 249, "end": 255, "username": "spdbt", "id": "347792540"}, {"start": 256, "end": 263, "username": "_verdi", "id": "121362786"}, {"start": 264, "end": 277, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 0, "end": 10, "tag": "Klatschen"}, {"start": 37, "end": 51, "tag": "Besch\u00e4ftigten"}, {"start": 81, "end": 87, "tag": "Recht"}, {"start": 164, "end": 183, "tag": "Arbeitsbedingungen"}, {"start": 189, "end": 200, "tag": "Kompromiss"}, {"start": 209, "end": 224, "tag": "Sozialparteien"}]}, "created_at": "2020-09-22T08:39:02.000Z", "conversation_id": "1308324916505313282", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 6, "quote_count": 1}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1308324916505313282", "text": "#Klatschen alleine reicht nicht. Die #Besch\u00e4ftigten des \u00f6. Dienstes streiken mit #Recht f\u00fcr bessere Bezahlung, u.a. in Kitas u. Krankenh\u00e4usern. Es geht auch um die #Arbeitsbedingungen. Ein #Kompromiss zw. den #Sozialparteien ist dringend notwendig. @spdbt @_verdi @stimmeonline"}, {"entities": {"mentions": [{"start": 260, "end": 266, "username": "spdbt", "id": "347792540"}, {"start": 267, "end": 280, "username": "stimmeonline", "id": "26986638"}], "hashtags": [{"start": 39, "end": 49, "tag": "Industrie"}, {"start": 83, "end": 107, "tag": "Besch\u00e4ftigungssicherung"}, {"start": 109, "end": 121, "tag": "Wasserstoff"}]}, "created_at": "2020-09-21T12:36:41.000Z", "conversation_id": "1308022338148069376", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 11, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1308022338148069376", "text": "Wir brauchen ein klares Bekenntnis zur #Industrie in unserem Land. Denn es geht um #Besch\u00e4ftigungssicherung. #Wasserstoff spielt dabei eine Schl\u00fcsselrolle. An der Hochschule HN werden die Chancen f\u00fcr unsere Region untersucht. Danke f\u00fcr den heutigen Austausch! @spdbt @stimmeonline", "geo": {"place_id": "3054197b67639531"}}, {"entities": {"mentions": [{"start": 0, "end": 13, "username": "KroBotschaft", "id": "1205522626271154179"}, {"start": 14, "end": 27, "username": "BakotaGordan", "id": "1235532525243637761"}, {"start": 28, "end": 36, "username": "Der_BDI", "id": "57043880"}, {"start": 37, "end": 41, "username": "hgk", "id": "181880752"}, {"start": 42, "end": 50, "username": "MVEP_hr", "id": "791606834"}]}, "referenced_tweets": [{"type": "replied_to", "id": "1306580589366124545"}], "created_at": "2020-09-17T14:48:20.000Z", "conversation_id": "1306580589366124545", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "und", "in_reply_to_user_id": "1205522626271154179", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1306605914783391745", "text": "@KroBotschaft @BakotaGordan @Der_BDI @hgk @MVEP_hr \ud83d\udc4d\ud83d\ude00"}, {"entities": {"mentions": [{"start": 237, "end": 250, "username": "stimmeonline", "id": "26986638"}, {"start": 251, "end": 261, "username": "RNZonline", "id": "87967476"}], "hashtags": [{"start": 225, "end": 236, "tag": "PolizeiNRW"}]}, "created_at": "2020-09-17T09:17:12.000Z", "conversation_id": "1306522582502572032", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 10, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1306522582502572032", "text": "Unsere Polizei ist eine wichtige Institution zum Schutze unserer Demokratie und hat eine Vorbildfunktion in unserer Gesellschaft. Rechtsradikalismus muss man im Keim ersticken, statt die Vorkommnisse als Einzelf\u00e4lle abzutun! #PolizeiNRW @stimmeonline @rnzonline"}, {"referenced_tweets": [{"type": "replied_to", "id": "1306188494499348482"}], "created_at": "2020-09-16T11:09:39.000Z", "conversation_id": "1306188494499348482", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 0, "quote_count": 0}, "entities": {"hashtags": [{"start": 92, "end": 103, "tag": "Demokratie"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1306188495648681984", "text": "Verschw\u00f6rungstheoretiker*innen in Frage gestellt werden. Freiheit ist das h\u00f6chste Gut jeder #Demokratie \u2013 diese Freiheit darf aber nicht so weit gehen, als dass sie die demokratische Grundordnung, unsere Verfassung und die Legitimit\u00e4t unserer Abgeordneten in Zweifel zieht! (2/2)"}, {"created_at": "2020-09-16T11:09:39.000Z", "conversation_id": "1306188494499348482", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 0, "quote_count": 0}, "entities": {"hashtags": [{"start": 21, "end": 29, "tag": "belarus"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1306188494499348482", "text": "Wir d\u00fcrfen das Thema #belarus nicht aus den Augen verlieren. Als Demokrat*innen stehen wir fest hinter den Demonstrierenden. Mit Bedauern beobachten wir, wie unter dem gleichen Deckmantel auch in Deutschland demonstriert wird und demokratische Institutionen durch (1/2)"}, {"entities": {"mentions": [{"start": 99, "end": 110, "username": "OlafScholz", "id": "38150247"}], "hashtags": [{"start": 172, "end": 178, "tag": "Moria"}]}, "created_at": "2020-09-15T08:58:33.000Z", "conversation_id": "1305793114418958336", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 2, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1305793114418958336", "text": "Die j\u00fcngsten Nachrichten zeigen: Es bewegt sich was. Dank des Ultimatums unseres Kanzlerkandidaten @OlafScholz kommen wir unserem Ziel, die Gefl\u00fcchteten aus ihrem Elend in #Moria zu befreien, immer n\u00e4her. Wir m\u00fcssen entschlossen weiterk\u00e4mpfen!"}, {"context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "887720012340879360", "name": "Horst Seehofer", "description": "Horst Seehofer"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "887720012340879360", "name": "Horst Seehofer", "description": "Horst Seehofer"}}], "referenced_tweets": [{"type": "replied_to", "id": "1304058774605443075"}], "created_at": "2020-09-10T14:06:55.000Z", "conversation_id": "1304052976802320384", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1304058776757186560", "text": "Die heutige deutsch-franz. Ank\u00fcndigung, 400 Kinder zu evakuieren, ist reine Symbolpolitik. 14.000 Menschen sitzen weiter fest und warten auf Rettung, unsere L\u00e4nder und Kommunen sind zur Aufnahme bereit - Frau Merkel muss bei Herrn Seehofer ihre Richtlinienkompetenz walten lassen!"}, {"referenced_tweets": [{"type": "replied_to", "id": "1304052976802320384"}], "created_at": "2020-09-10T14:06:54.000Z", "attachments": {"media_keys": ["3_1304053403883122688"]}, "conversation_id": "1304052976802320384", "author_id": "738731811380076544", "entities": {"urls": [{"start": 42, "end": 65, "url": "https://t.co/rtlpFoHt4L", "expanded_url": "https://twitter.com/josip_juratovic/status/1304058774605443075/photo/1", "display_url": "pic.twitter.com/rtlpFoHt4L"}]}, "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 3, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1304058774605443075", "text": "Mein vollst\u00e4ndiges Statement von gestern. https://t.co/rtlpFoHt4L"}, {"entities": {"mentions": [{"start": 132, "end": 141, "us