ount": 0, "like_count": 4, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1266283480565989377", "text": "Es schmerzt, wenn #Menschen nach \u00fcber 40/50 Jahren nicht die #Anerkennung bekommen, die sie sich redlich verdient haben. Dazu habe ich f\u00fcr die @spdbt im #Bundestag gesprochen: https://t.co/curu09m8xN - #Staatsangeh\u00f6rigkeitsrecht #Einwanderungsland"}, {"created_at": "2020-02-05T13:47:50.000Z", "conversation_id": "1225053418529665025", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 4, "quote_count": 0}, "entities": {"hashtags": [{"start": 17, "end": 21, "tag": "FDP"}, {"start": 25, "end": 35, "tag": "Th\u00fcringen"}, {"start": 171, "end": 180, "tag": "Weimarer"}, {"start": 181, "end": 190, "tag": "Republik"}, {"start": 253, "end": 257, "tag": "AfD"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1225053418529665025", "text": "Das Abr\u00fccken der #FDP in #Th\u00fcringen vom Spruch \"nicht zu regieren, statt falsch zu regieren\", erinnert mich an die Leichtfertigkeit politischer Akteure, wie zu Zeiten der #Weimarer #Republik. Gerade die FDP, als traditionell liberale Partei, erhebt die #AfD zum K\u00f6nigsmacher."}, {"entities": {"mentions": [{"start": 3, "end": 9, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 22, "end": 45, "url": "https://t.co/O70UPz98IO", "expanded_url": "https://twitter.com/schneidercar/status/1225040423615434752", "display_url": "twitter.com/schneidercar/s\u2026"}]}, "context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "827110952499769344", "name": "Christian Lindner", "description": "Christian Lindner"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "827110952499769344", "name": "Chri