ontext_annotations": [{"domain": {"id": "46", "name": "Brand Category", "description": "Categories within Brand Verticals that narrow down the scope of Brands"}, "entity": {"id": "781974596752842752", "name": "Services"}}, {"domain": {"id": "47", "name": "Brand", "description": "Brands and Companies"}, "entity": {"id": "10045225402", "name": "Twitter"}}], "referenced_tweets": [{"type": "quoted", "id": "1191744531475156992"}], "created_at": "2019-11-05T15:53:54.000Z", "conversation_id": "1191745464569417732", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 17, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter for Android", "id": "1191745464569417732", "text": "Vielen Dank f\u00fcr das erneute Vertrauen meiner Kolleg*innen in der @spdbt mit der Wahl in den #Fraktionsvorstand. Packen wir es an! https://t.co/VjqNYdoRFn"}, {"created_at": "2019-10-21T08:50:10.000Z", "conversation_id": "1186203010722123778", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 9, "quote_count": 0}, "entities": {"hashtags": [{"start": 11, "end": 18, "tag": "Eppler"}, {"start": 38, "end": 53, "tag": "Sozialdemokrat"}, {"start": 235, "end": 244, "tag": "Demokrat"}, {"start": 249, "end": 258, "tag": "Vision\u00e4r"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1186203010722123778", "text": "Mit Erhard #Eppler hat uns ein gro\u00dfer #Sozialdemokrat verlassen, der seiner Zeit in vielen Dingen voraus war. F\u00fcr mich war er ein Vorbild und sein Tod l\u00e4sst uns alle in tiefer Trauer zur\u00fcck. Erhard war ein geradliniger und standhafter #Demokrat und #Vision\u00e4r."}, {"created_at": "2019-10-21T08:40:06.000Z", "conversation_id": "1186200475969949696", "author_id": "738731811380076544", "entities": {"urls": [{"start": 125, "end": 148, "url": "https://t.co