count": 14, "like_count": 37, "quote_count": 3}, "possibly_sensitive": false, "source": "Twitter for iPhone", "id": "1352599962446606336", "text": "#Corona belastet Menschen mit wenig Einkommen besonders - \u00c4ltere in der Grundsicherung, ALG 2-Empf\u00e4nger und Menschen mit Behinderung. @KatjaMast: \u201eDaher ist es absolut richtig, dass @hubertus_heil gezielt diese Menschen mit einem Zuschuss zur #Grundsicherung unterst\u00fctzen will.\u201c"}, {"context_annotations": [{"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "1349062721677914112", "name": "Inauguration Day: Watch as Joe Biden and Kamala Harris are sworn into office"}}, {"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "10040395078", "name": "Joe Biden", "description": "US President Joe Biden"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "10040395078", "name": "Joe Biden", "description": "US President Joe Biden"}}], "created_at": "2021-01-21T08:46:54.000Z", "attachments": {"media_keys": ["13_1352159191104942083"]}, "conversation_id": "1352175828285730816", "author_id": "114508061", "entities": {"urls": [{"start": 160, "end": 183, "url": "https://t.co/yF1gbNkIDp", "expanded_url": "https://twitter.com/SZ/status/1352175828285730816/video/1", "display_url": "pic.twitter.com/yF1gbNkIDp"}], "hashtags": [{"start": 63, "end": 72, "tag": "JoeBiden"}, {"start": 102, "end": 115, "tag": "AmandaGorman"}, {"start": 146, "end": 159, "tag": "inauguration"}]}, "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 50, "reply_count": 8, "like_count": 246, "quote_count": 11}, "possibly_sensitive": false, "source": "Twitter Media Studio", "id": "1352175828285730816", "text": "Es war einer der emotionalen H\u00f6hepunkte der Amtseinf\u00fchrung von #JoeBiden: Der Auftritt der 22-j\u00e4hrige #AmandaGorman. Ihr Gedicht in voller L\u00e4nge. #inauguration https://t.co/yF1gbNkIDp"}, {"created_at": "2021-01-20T13:09:13.000Z", "conversation_id": "1351879455569039361", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 3, "like_count": 6, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1351879455569039361", "text": "Ich begr\u00fc\u00dfe die Entscheidung des Bundeskabinetts, meinen Bundestagskollegen Christian Schmidt als Kandidaten f\u00fcr den Hohen Repr\u00e4sentanten f\u00fcr Bosnien und Herzegowina \ud83c\udde7\ud83c\udde6 vorzuschlagen. Herzlichen Gl\u00fcckwunsch!"}, {"entities": {"mentions": [{"start": 106, "end": 118, "username": "DennisRohde", "id": "18160122"}]}, "created_at": "2021-01-19T12:11:47.000Z", "conversation_id": "1351502615742394370", "author_id": "347792540", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 5, "reply_count": 11, "like_count": 44, "quote_count": 3}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1351502615742394370", "text": "Ob die November- und Dezemberhilfen oder die \u00dcberbr\u00fcckungshilfen \u2013 das Geld muss jetzt aber auch flie\u00dfen. @dennisrohde, haushaltspolitischer Sprecher der SPD-Fraktion: \"Ich erwarte, dass der daf\u00fcr zust\u00e4ndige Bundeswirtschaftsminister das nun endlich hinbekommt!\""}, {"referenced_tweets": [{"type": "replied_to", "id": "1347494317577920513"}], "created_at": "2021-01-08T10:44:15.000Z", "conversation_id": "1347494316206387200", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1347494318945280000", "text": "Wohin ein solcher Trumpismus f\u00fchrt, kann man seit drei Jahrzehnten auf dem Westbalkan verfolgen - gegen solche Tendenzen k\u00e4mpfe ich jeden Tag, denn f\u00fcr die M\u00e4chtigen, die sich diesem Ph\u00e4nomen bedienen, spielen demokratische Spielregeln keine Rolle mehr. (3/4)"}, {"referenced_tweets": [{"type": "replied_to", "id": "1347494316206387200"}], "created_at": "2021-01-08T10:44:15.000Z", "conversation_id": "1347494316206387200", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "in_reply_to_user_id": "738731811380076544", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 1, "quote_count": 0}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1347494317577920513", "text": "Das ist die Entwicklung, die wir aktuell in den USA verfolgen k\u00f6nnen. Leider sind die USA nicht das einzige Land, das diese \u201eF\u00e4ulnis\u201c der gesellschaftlichen Grundordnung offenlegt. Inzwischen ist das Ph\u00e4nomen des Trumpismus bedauerlicherweise auch bei uns zu finden. (2/4)"}, {"context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "10040395078", "name": "Joe Biden", "description": "US President Joe Biden"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "10040395078", "name": "Joe Biden", "description": "US President Joe Biden"}}], "created_at": "2021-01-08T10:44:14.000Z", "conversation_id": "1347494316206387200", "author_id": "738731811380076544", "reply_settings": "everyone", "lang": "de", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 3, "quote_count": 0}, "entities": {"hashtags": [{"start": 34, "end": 47, "tag": "WashingtonDC"}, {"start": 56, "end": 64, "tag": "Capitol"}]}, "possibly_sensitive": false, "source": "Twitter Web App", "id": "1347494316206387200", "text": "Mein Take zu den Geschehnissen in #WashingtonDC und dem #Capitol: Ich bin erleic