, "end": 80, "username": "katarinabarley", "id": "4097559143"}]}, "reply_settings": "everyone", "author_id": "17064195", "attachments": {"media_keys": ["3_1146451218534993921"]}, "conversation_id": "1146451223698202624"}, {"source": "Twitter for Android", "id": "1144514522176204801", "text": "Wir sind der Meinung: Es sollten alle auf @janboehm h\u00f6ren. https://t.co/TFgUxHydeS", "created_at": "2019-06-28T07:55:00.000Z", "possibly_sensitive": false, "public_metrics": {"retweet_count": 112, "reply_count": 49, "like_count": 1934, "quote_count": 16}, "lang": "de", "entities": {"urls": [{"start": 59, "end": 82, "url": "https://t.co/TFgUxHydeS", "expanded_url": "https://twitter.com/janboehm/status/1144512358334783494", "display_url": "twitter.com/janboehm/statu\u2026"}], "mentions": [{"start": 42, "end": 51, "username": "janboehm", "id": "19072286"}]}, "reply_settings": "everyone", "author_id": "76644468", "conversation_id": "1144514522176204801"}, {"source": "Twitter for iPhone", "id": "1144528228872261632", "text": "In der Kneipe #Stonewall50 standen heute Nacht vor 50 Jahren mutige Leute auf gegen Diskriminierung und gegen Gewalt. Ein Wendepunkt der LGBTIQ-Bewegung! Leider gibt es noch immer viel zu tun. Lasst uns alle gemeinsam f\u00fcr mehr Akzeptanz einstehen. Denn Vielfalt macht uns stark. https://t.co/RRijmFWwMp", "created_at": "2019-06-28T08:49:28.000Z", "possibly_sensitive": false, "public_metrics": {"retweet_count": 108, "reply_count": 120, "like_count": 632, "quote_count": 26}, "lang": "de", "entities": {"urls": [{"start": 279, "end": 302, "url": "https://t.co/RRijmFWwMp", "expanded_url": "https://twitter.com/HeikoMaas/status/1144528228872261632/photo/1", "display_url": "pic.twitter.com/RRijmFWwMp"}], "hashtags": [{"start": 14, "end": 26, "tag": "Stonewall50"}]}, "reply_settings": "everyone", "author_id": "24158261", "attachments": {"media_keys": ["3_1144528212107649026"]}, "conversation_id": "1144528228872261632"}, {"source": "Twitter for iPhone", "id": "1144131001855238144", "text": "Heldin des Alltags: Pia Findei\u00df. Seit 2008 Oberb\u00fcrgermeisterin von Zwickau. Sie hat viel Hass und Bedrohung von rechts abgekriegt, nur weil sie ihren Job ernst nimmt. Aber mutig weitergemacht #donnerstagderdemokratie https://t.co/qNj90q4Hjd", "created_at": "2019-06-27T06:31:02.000Z", "possibly_sensitive": false, "public_metrics": {"retweet_count": 169, "reply_count": 45, "like_count": 1043, "quote_count": 9}, "lang": "de", "entities": {"urls": [{"start": 217, "end": 240, "url": "https://t.co/qNj90q4Hjd", "expanded_url": "https://daserste.ndr.de/panorama/archiv/2016/Anschlaege-auf-Buergermeisterin-von-Zwickau,panorama6044.html", "display_url": "daserste.ndr.de/panorama/archi\u2026"}], "hashtags": [{"start": 192, "end": 216, "tag": "donnerstagderdemokratie"}]}, "reply_settings": "everyone", "author_id": "2445486307", "conversation_id": "1144131001855238144"}, {"source": "Twitter for iPhone", "id": "1144179633862189063", "text": "Vielen Dank f\u00fcr #DonnerstagderDemokratie @HeikoMaas. Eine Alltagsheldin ist f\u00fcr mich: Birgit #Lohmeyer. Sie organisiert seit 12 Jahren das Festival #JamelRockt &amp; das inmitten einer Neonazi-Hochburg. Vielen Dank f\u00fcr Dein mutiges Engagement f\u00fcr unsere Demokratie, liebe Birgit! https://t.co/fJCDpfcMaM", "created_at": "2019-06-27T09:44:17.000Z", "possibly_sensitive": false, "public_metrics": {"retweet_count": 49, "reply_count": 18, "like_count": 515, "quote_count": 4}, "lang": "de", "entities": {"urls": [{"start": 280, "end": 303, "url": "https://t.co/fJCDpfcMaM", "expanded_url": "https://twitter.com/larsklingbeil/status/1144179633862189063/photo/1", "display_url": "pic.twitter.com/fJCDpfcMaM"}], "hashtags": [{"start": 16, "end": 40, "tag": "DonnerstagderDemokratie"}, {"start": 93, "end": 102, "tag": "Lohmeyer"}, {"start": 148, "end": 159, "tag": "JamelRockt"}], "mentions": [{"start": 41, "end": 51, "username": "HeikoMaas", "id": "24158261"}]}, "reply_settings": "everyone", "author_id"