112036421742594", "name": "UN Human Rights Day 2018", "description": "UN Human Rights Day 2018"}}], "possibly_sensitive": false, "reply_settings": "everyone", "public_metrics": {"retweet_count": 136, "reply_count": 144, "like_count": 488, "quote_count": 40}, "source": "Twitter Web Client", "entities": {"hashtags": [{"start": 223, "end": 244, "tag": "TagderMenschenrechte"}, {"start": 245, "end": 260, "tag": "HumanRightsDay"}], "urls": [{"start": 261, "end": 284, "url": "https://t.co/Whc0YwcFah", "expanded_url": "https://twitter.com/HeikoMaas/status/1072088363447058436/video/1", "display_url": "pic.twitter.com/Whc0YwcFah"}]}, "author_id": "24158261", "attachments": {"media_keys": ["7_1072087641280143366"]}, "lang": "de", "text": "Die Erkl\u00e4rung der Menschenrechte wird heute 70 Jahre alt. Leider sind Menschenrechte immer wieder bedroht. Umso entschiedener m\u00fcssen wir f\u00fcr sie einstehen: \u201eAlle Menschen sind frei und gleich an W\u00fcrde und Rechten geboren.\u201c #TagderMenschenrechte #HumanRightsDay https://t.co/Whc0YwcFah", "conversation_id": "1072088363447058436", "created_at": "2018-12-10T11:19:18.000Z", "id": "1072088363447058436"}, {"context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855409238318882816", "name": "Europe", "description": "Europa"}}], "possibly_sensitive": false, "reply_settings": "everyone", "public_metrics": {"retweet_count": 102, "reply_count": 109, "like_count": 834, "quote_count": 26}, "source": "Twitter Web Client", "entities": {"hashtags": [{"start": 213, "end": 233, "tag": "Europaistdieantwort"}]}, "author_id": "4097559143", "lang": "de", "text": "Danke f\u00fcr das Vertrauen. Ich f\u00fchle mich geehrt die Liste der SPD anzuf\u00fchren.\u00a0Lasst uns zeigen, was in unserer Partei und ihren Mitgliedern steckt. Lasst uns Menschen mit unserer Begeisterung f\u00fcr Europa anstecken. #Europaistdieantwort", "conversation_id": "107175252