zfelgentreu", "id": "2805274855"}]}, "lang": "de", "text": "Zeitsoldaten und -soldatinnen, die ab Januar aus dem Dienst ausscheiden, erhalten Zugang zur gesetzlichen Krankenversicherung. \"Ein gro\u00dfer Fortschritt\", sagt @fritzfelgentreu. \"Wir freuen uns auch, dass es gelungen ist, f\u00fcr Altf\u00e4lle eine L\u00f6sung zu finden.\" https://t.co/wbiYcLH8Fq https://t.co/R6Nenaf9w8", "conversation_id": "1052597429730795520", "created_at": "2018-10-17T16:29:18.000Z", "id": "1052597429730795520"}, {"context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855410081906556930", "name": "Germany", "description": "Germany"}}], "possibly_sensitive": false, "reply_settings": "everyone", "public_metrics": {"retweet_count": 7, "reply_count": 4, "like_count": 34, "quote_count": 1}, "source": "Twitter Web Client", "entities": {"hashtags": [{"start": 94, "end": 104, "tag": "Bundestag"}, {"start": 126, "end": 131, "tag": "Kita"}], "urls": [{"start": 275, "end": 298, "url": "https://t.co/NDUpBedgZS", "expanded_url": "https://twitter.com/spdbt/status/1052822055442370560/photo/1", "display_url": "pic.twitter.com/NDUpBedgZS"}]}, "author_id": "347792540", "attachments": {"media_keys": ["3_1052821894750265344"]}, "lang": "de", "text": "Mehr Qualit\u00e4t und weniger Geb\u00fchren sind zwei Seiten einer Medaille, macht Franziska Giffey im #Bundestag deutlich. \"Die beste #Kita n\u00fctzt nichts, wenn zu Hause das Geld daf\u00fcr fehlt. Gute Kitas d\u00fcrfen kein Privileg sein, sie m\u00fcssen allen Kindern in Deutschland offen stehen.\" https://t.co/NDUpBedgZS", "conversation_id": "1052822055442370560", "created_at": "2018-10-18T07:21:53.000Z", "id": "1052822055442370560"}, {"possibly_sensitive": false, "reply_settings": "everyone", "public_metrics": {"retweet_count": 3, "reply_count": 3, "like_count": 7, "quote_count": 0}, "source": "Twitter Web Client", "entities": {"hashtags": [{"start": 123, "end": 128, "tag": "Kita"}], "urls": [{"start": 258, "end": 281, "url": "https://t.co/cjwrSa5WjQ", "expanded_url": "https://twitter.com/spdbt/status/1052830269919649792/photo/1", "display_url": "pic.twitter.com/cjwrSa5WjQ"}], "mentions": [{"start": 88, "end": 98, "username": "SoenkeRix", "id": "36327895"}]}, "author_id": "347792540", "attachments": {"media_keys": ["3_1052830094312509440"]}, "lang": "de", "text": "Mehr Qualit\u00e4t und weniger Geb\u00fchren d\u00fcrfen nicht gegeneinander ausgespielt werden, macht @SoenkeRix in der Debatte zum Gute-#Kita-Gesetz deutlich: \"Wir wollen beides. Wir wollen die Qualit\u00e4t steigern und den Zugang zu Kitas f\u00fcr alle Familien m\u00f6glich machen.\" https://t.co/cjwrSa5WjQ", "conversation_id": "1052830269919649792", "created_at": "2018-10-18T07:54:31.000Z", "id": "1052830269919649792"}, {"context_annotations": [{"domain": {"id": "10", "name": "Person", "description": "Named people in the world like Nelson Mandela"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}, {"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855410081906556930", "name": "Germany", "description": "Germany"}}, {"domain": {"id": "35", "name": "Politician", "description": "Politicians in the world, like Joe Biden"}, "entity": {"id": "887728147612880896", "name": "Hubertus Heil", "description": "Hubertus Heil"}}], "possibly_sensitive": false, "reply_settings": "everyone", "public_metrics": {"retweet_count": 33, "reply_count": 20, "like_count": 70, "quote_count": 6}, "source": "Twitter Web Client", "entities": {"hashtags": [{"start": 13, "end": 37, "tag": "Familienst\u00e4rkungsgesetz"}, {"start": 71, "end": 83, "tag": "Kinderarmut"}, {"start": 148, "end": 155, "tag": "Giffey"}], "urls": [{"start": 224, "end": 247, "url": "https://t.co/zrczRi6DGX", "expanded_url": "https://www.bmfsfj.de/bmfsfj/aktuelles/reden-und-interviews/dr--fran