one", "conversation_id": "1012224420151259136", "id": "1012224420151259136", "entities": {"hashtags": [{"start": 33, "end": 42, "tag": "lifeline"}, {"start": 198, "end": 212, "tag": "Seenotrettern"}]}, "text": "Seehofer gestern im Bundestag zu #lifeline: \u201e\u00dcber die Aufnahme von Migranten und Fl\u00fcchtlingen entscheiden nicht die Schlepper, sondern demokratisch gew\u00e4hlte Regierungen.\u201c Diese Kriminalisierung von #Seenotrettern ist ein Unversch\u00e4mtheit und zeugt von einem neuen Geist.", "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 7, "quote_count": 0}, "lang": "de"}, {"referenced_tweets": [{"type": "retweeted", "id": "1011881145536073730"}], "created_at": "2018-06-28T06:25:42.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1012220477614514176", "id": "1012220477614514176", "text": "RT @georgrestle: Liebe Kollegen, falls es mal wieder in den Fingern juckt, ganz \u201eneutral\u201c \u00fcber von Rechtsau\u00dfen gesetzte Themen zu berichten\u2026", "public_metrics": {"retweet_count": 257, "reply_count": 0, "like_count": 0, "quote_count": 0}, "entities": {"mentions": [{"start": 3, "end": 15, "username": "georgrestle", "id": "19245170"}]}, "lang": "de"}, {"referenced_tweets": [{"type": "retweeted", "id": "1011986282367672320"}], "created_at": "2018-06-28T06:22:38.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1012219703664758784", "id": "1012219703664758784", "entities": {"hashtags": [{"start": 90, "end": 99, "tag": "Lifeline"}], "mentions": [{"start": 3, "end": 17, "username": "ErikMarquardt", "id": "149441850"}]}, "text": "RT @ErikMarquardt: Seehofer fordert als Bedingung f\u00fcr Aufnahme der \u00dcberlebenden, dass die #Lifeline beschlagnahmt und gegen Crew ermittelt\u2026", "public_metrics": {"retweet_count": 507, "reply_count": 0, "like_count": 0, "quote_count": 0}, "lang": "de"}, {"created_at": "2018-06-27T11:48:01.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1011939203083657216", "id": "1011939203083657216", "entities": {"hashtags": [{"start": 64, "end": 77, "tag": "Journalismus"}], "urls": [{"start": 254, "end": 277, "url": "https://t.co/vKaL7sXJsZ", "expanded_url": "http://www.jugendpresse.de/bundestag", "display_url": "jugendpresse.de/bundestag"}, {"start": 278, "end": 301, "url": "https://t.co/kEwz8o8GT8", "expanded_url": "https://twitter.com/josip_juratovic/status/1011939203083657216/photo/1", "display_url": "pic.twitter.com/kEwz8o8GT8"}]}, "attachments": {"media_keys": ["3_1011939125929406464"]}, "text": "Du bist zwischen 16 - 20 und interessierst Dich f\u00fcr politischen #Journalismus? \nDann bewirb Dich beim 15. \"Jugendmedienworkshop im Deutschen Bundestag\". In diesem Jahr steht er unter dem Titel ,,Zwischen Krieg und Frieden\". Bewerben kannst Du Dich hier: https://t.co/vKaL7sXJsZ https://t.co/kEwz8o8GT8", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "lang": "de"}, {"referenced_tweets": [{"type": "quoted", "id": "1011537359719010304"}], "created_at": "2018-06-26T12:58:16.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1011594492254801920", "id": "1011594492254801920", "entities": {"hashtags": [{"start": 45, "end": 49, "tag": "AFD"}, {"start": 104, "end": 114, "tag": "Migranten"}], "urls": [{"start": 180, "end": 203, "url": "https://t.co/RvL1IRASLl", "expanded_url": "https://twitter.com/MDIntegration/status/1011537359719010304", "display_url": "twitter.com/MDIntegration/\u2026"}]}, "text": "Ich h\u00e4tte daf\u00fcr keine Zahlen gebraucht - die #AFD bezieht im Bundestag jedes noch so abwegige Thema auf #Migranten. Aber gut, dass die Statistik das f\u00fcr alle sichtbar untermauert. https://t.co/RvL1IRASLl", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "lang": "de"}, {"referenced_tweets": [{"type": "quoted", "id": "1011528031024898049"}], "created_at": "2018-06-26T10:17:51.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1011554122116616193", "id": "1011554122116616193", "entities": {"hashtags": [{"start": 41, "end": 45, "tag": "USA"}], "urls": [{"start": 93, "end": 116, "url": "https://t.co/7G3VxlQox1", "expanded_url": "https://twitter.com/HeikoMaas/status/1011528031024898049", "display_url": "twitter.com/HeikoMaas/stat\u2026"}]}, "text": "M\u00f6ge die langj\u00e4hrige Freundschaft zu den #USA Bestand haben - jenseits aktueller Ereignisse. https://t.co/7G3VxlQox1", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855429964178497536", "name": "United States of America", "description": "United States of America"}}], "lang": "de"}, {"created_at": "2018-06-21T07:36:12.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1009701504658354176", "id": "1009701504658354176", "entities": {"hashtags": [{"start": 152, "end": 163, "tag": "Masterplan"}, {"start": 215, "end": 234, "tag": "weltfl\u00fcchtlingstag"}], "urls": [{"start": 235, "end": 258, "url": "https://t.co/aPj1RrEW7O", "expanded_url": "https://www.augsburger-allgemeine.de/politik/SPD-entsetzt-ueber-Seehofers-Masterplan-id51419016.html", "display_url": "augsburger-allgemeine.de/politik/SPD-en\u2026"}]}, "text": "Unser Land verh\u00e4rtet. Das d\u00fcrfen wir nicht zulassen. Ebenso d\u00fcrfen wir die menschlich und rechtlich inakzeptablen Punkte, die aus Seehofers sogenannten #Masterplan bekannt wurden, nicht unkommentiert stehen lassen. #weltfl\u00fcchtlingstag https://t.co/aPj1RrEW7O", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 4, "quote_count": 0}, "lang": "de"}, {"created_at": "2018-06-16T09:13:32.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1007914059231059968", "id": "1007914059231059968", "text": "Claudia Roth ist eine aufrechte Demokratin. Ihr souver\u00e4nes Handeln als Bundestagsvizepr\u00e4sidentin hat meinen vollen Respekt. Wir m\u00fcssen auch k\u00fcnftig verhindern, dass das Parlamt und seine Regeln missachtet und vorgef\u00fchrt werden. Unbedingt lesen: https://t.co/WNTLCtKEfl", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 4, "quote_count": 0}, "lang": "de", "entities": {"urls": [{"start": 245, "end": 268, "url": "https://t.co/WNTLCtKEfl", "expanded_url": "https://claudia-roth.de/persoenliche-erklaerung-von-claudia-roth-zur-inszenierten-schweigeminute-der-afd-im-deutschen-bundestag/", "display_url": "claudia-roth.de/persoenliche-e\u2026"}]}}, {"created_at": "2018-06-14T13:53:11.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1007259657709252608", "id": "1007259657709252608", "entities": {"hashtags": [{"start": 65, "end": 74, "tag": "Dimitrov"}, {"start": 183, "end": 194, "tag": "Mazedonien"}, {"start": 217, "end": 228, "tag": "Westbalkan"}, {"start": 230, "end": 241, "tag": "Demokratie"}, {"start": 242, "end": 262, "tag": "Kompromissf\u00e4higkeit"}, {"start": 263, "end": 274, "tag": "nursogehts"}], "urls": [{"start": 275, "end": 298, "url": "https://t.co/nrKFcakZWY", "expanded_url": "https://twitter.com/josip_juratovic/status/1007259657709252608/photo/1", "display_url": "pic.twitter.com/nrKFcakZWY"}]}, "attachments": {"media_keys": ["3_1007258412579684353"]}, "text": "Ich hatte die gro\u00dfe Freude heute den mazedonischen Au\u00dfenminister #Dimitrov zu treffen. Nutzte die Gelegenheit, um ihm zu der Einigung mit Griechenland im Namensstreit zu gratulieren. #Mazedonien ist ein Lichtblick im #Westbalkan. #Demokratie #Kompromissf\u00e4higkeit #nursogehts https://t.co/nrKFcakZWY", "public_metrics": {"retweet_count": 0, "reply_count": 4, "like_count": 7, "quote_count": 0}, "lang": "de"}, {"referenced_tweets": [{"type": "retweeted", "id": "1007182119188160512"}], "created_at": "2018-06-14T08:58:01.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1007185377768165376", "id": "1007185377768165376", "entities": {"hashtags": [{"start": 54, "end": 73, "tag": "Nationalmannschaft"}, {"start": 78, "end": 100, "tag": "Migrationshintergrund"}, {"start": 120, "end": 127, "tag": "WM2018"}], "mentions": [{"start": 3, "end": 17, "username": "MDIntegration", "id": "986365986"}]}, "text": "RT @MDIntegration: Jeder vierte Spieler der deutschen #Nationalmannschaft hat #Migrationshintergrund. Heute beginnt die #WM2018. https://t.\u2026", "public_metrics": {"retweet_count": 4, "reply_count": 0, "like_count": 0, "quote_count": 0}, "context_annotations": [{"domain": {"id": "6", "name": "Sports Event"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "40", "name": "Sports Series", "description": "A grouping of sports events or series, for example 2014 pre-season, a tournament, or round"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "6", "name": "Sports Event"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "40", "name": "Sports Series", "description": "A grouping of sports events or series, for example 2014 pre-season, a tournament, or round"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}], "lang": "de"}, {"created_at": "2018-06-14T08:13:49.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1007174254473957376", "id": "1007174254473957376", "entities": {"hashtags": [{"start": 92, "end": 108, "tag": "Br\u00fcckenteilzeit"}], "mentions": [{"start": 22, "end": 26, "username": "spd", "id": "7531562"}], "urls": [{"start": 196, "end": 219, "url": "https://t.co/N7UkZRjwXV", "expanded_url": "https://www.zeit.de/politik/deutschland/2018-06/brueckenteilzeit-vollzeit-bundeskabinett-gesetz", "display_url": "zeit.de/politik/deutsc\u2026"}]}, "text": "Und wieder ist es die @spd, die als treibende Kraft Rechte f\u00fcr Arbeitnehmer durchsetzt. Die #Br\u00fcckenteilzeit kommt, und damit das Recht auf befristete Teilzeit. Das kommt vor allem Frauen zugute! https://t.co/N7UkZRjwXV", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "lang": "de"}, {"created_at": "2018-06-14T07:59:55.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1007170758353850368", "id": "1007170758353850368", "entities": {"hashtags": [{"start": 247, "end": 252, "tag": "WM18"}], "urls": [{"start": 253, "end": 276, "url": "https://t.co/S0Vpx06UV0", "expanded_url": "https://twitter.com/josip_juratovic/status/1007170758353850368/photo/1", "display_url": "pic.twitter.com/S0Vpx06UV0"}]}, "attachments": {"media_keys": ["3_1007170398096642048"]}, "text": "Heute geht\u00b4s los! Ich freue mich sehr auf gesellige Abende, spannende Spiele und nat\u00fcrlich die Titelverteidigung! \ud83c\udfc5\ud83d\ude09 M\u00f6gen es faire Spiele werden und die Besten gewinnen. Unseren Jungs w\u00fcnsche ich jedenfalls viel, viel Gl\u00fcck. Wir glauben an Euch. #WM18 https://t.co/S0Vpx06UV0", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 5, "quote_count": 0}, "context_annotations": [{"domain": {"id": "6", "name": "Sports Event"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "40", "name": "Sports Series", "description": "A grouping of sports events or series, for example 2014 pre-season, a tournament, or round"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "6", "name": "Sports Event"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}, {"domain": {"id": "40", "name": "Sports Series", "description": "A grouping of sports events or series, for example 2014 pre-season, a tournament, or round"}, "entity": {"id": "731226242301599744", "name": "2018 FIFA World Cup", "description": "Photo @GettySport"}}], "lang": "de"}, {"created_at": "2018-06-13T15:08:16.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1006916168756682752", "id": "1006916168756682752", "text": "...Meine Botschaft an die Sch\u00fcler war: Macht was aus Eurem Leben, holt Euch so viel Bildung wie m\u00f6glich. Das ist entscheidend f\u00fcr Eure Zukunft, egal ob ihr hierbleibt oder wieder geht. Und leistet Euren Beitrag - Deutschland ist ein gutes Land.", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 7, "quote_count": 1}, "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855410081906556930", "name": "Germany", "description": "Germany"}}], "lang": "de"}, {"created_at": "2018-06-13T15:06:39.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "1006915761753985029", "id": "1006915761753985029", "attachments": {"media_keys": ["3_1006915682871730176"]}, "text": "Ich war heute in einer Schule in Berlin-Neuk\u00f6lln, um mit Kindern aus zwei 6. Klassen und einer Willkommensklasse \u00fcber meine Arbeit als Abgeordneter und Politik an sich zu sprechen. Am spannendsten fand ich aber, ihre Geschichten zu h\u00f6ren, auch die der Flucht und des Ankommens. https://t.co/bpi07s5Zfr", "public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 4, "quote_count": 0}, "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855410510082080770", "name": "Berlin", "description": "Berlin"}}], "lang": "de", "entities": {"urls": [{"start": 278, "end": 301, "url": "https://t.co/bpi07s5Zfr", "expanded_url": "https://twitter.com/josip_juratovic/status/1006915761753985029/photo/1", "display_url": "pic.tw