id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "992061709417402369", "id": "992370370102652929", "text": "@ADEL55016000 Die Anzahl der F\u00e4lle in Griechenland ist deutlich geringer, daher ist das nicht vergleichbar.", "public_metrics": {"retweet_count": 0, "reply_count": 2, "like_count": 0, "quote_count": 0}, "entities": {"mentions": [{"start": 0, "end": 13, "username": "ADEL55016000", "id": "2739915932"}]}, "lang": "de"}, {"referenced_tweets": [{"type": "replied_to", "id": "992061709417402369"}], "created_at": "2018-05-04T11:47:20.000Z", "in_reply_to_user_id": "2739915932", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "992061709417402369", "id": "992370084315361281", "entities": {"hashtags": [{"start": 57, "end": 68, "tag": "Westbalkan"}], "mentions": [{"start": 0, "end": 13, "username": "ADEL55016000", "id": "2739915932"}]}, "text": "@ADEL55016000 Das ist v\u00f6llig richtig. Die Botschaften im #Westbalkan sind \u00fcberlastet u. kommen bei Bearbeitung der Antr\u00e4ge kaum hinterher. Ich habe mehrfach beim AA auf Personalverst\u00e4rkung gedrungen. Wir m\u00fcssen da wieder hinterherkommen.", "public_metrics": {"retweet_count": 0, "reply_count": 3, "like_count": 0, "quote_count": 0}, "lang": "de"}, {"referenced_tweets": [{"type": "retweeted", "id": "991960652804689920"}], "created_at": "2018-05-03T13:28:48.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "992033232047820800", "id": "992033232047820800", "text": "RT @larsklingbeil: Rechtspopulismus ist eine Bedrohung f\u00fcr \ndie Pressefreiheit, weil er diese aktiv infrage stellt - in den USA, aber auch\u2026", "public_metrics": {"retweet_count": 41, "reply_count": 0, "like_count": 0, "quote_count": 0}, "entities": {"mentions": [{"start": 3, "end": 17, "username": "larsklingbeil", "id": "16255941"}]}, "lang": "de"}, {"referenced_tweets": [{"type": "quoted", "id": "990959576425140224"}], "created_at": "2018-05-02T13:08:35.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "991665758404038656", "id": "991665758404038656", "entities": {"hashtags": [{"start": 89, "end": 102, "tag": "ungleichland"}], "mentions": [{"start": 81, "end": 88, "username": "docupy", "id": "911524803135381504"}], "urls": [{"start": 103, "end": 126, "url": "https://t.co/yfSfGhqia6", "expanded_url": "https://twitter.com/ZEITmagazin/status/990959576425140224", "display_url": "twitter.com/ZEITmagazin/st\u2026"}]}, "text": "Anschauen lohnt sich bestimmt! Ich bin jedenfalls gespannt auf kommenden Montag. @docupy #ungleichland https://t.co/yfSfGhqia6", "public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 2, "quote_count": 0}, "lang": "de"}, {"referenced_tweets": [{"type": "quoted", "id": "989491435467689984"}], "created_at": "2018-04-27T08:52:52.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "989789466305933312", "id": "989789466305933312", "text": "Dass ich als ehemaliger Flie\u00dfbandarbeiter im Bundestag die Ausnahme bilde, ist kein Geheimnis. Interessant ist aber, wie das von Kollegen eingeordnet wird.\nDie ganze Sendung von @docupy l\u00e4uft \u00fcbrigens am Montag, 7. Mai 2018, 20:15 Uhr in der ARD. https://t.co/y6uDiSzsRC", "public_metrics": {"retweet_count": 1, "reply_count": 2, "like_count": 7, "quote_count": 1}, "entities": {"mentions": [{"start": 178, "end": 185, "username": "docupy", "id": "911524803135381504"}], "urls": [{"start": 247, "end": 270, "url": "https://t.co/y6uDiSzsRC", "expanded_url": "https://twitter.com/docupy/status/989491435467689984", "display_url": "twitter.com/docupy/status/\u2026"}]}, "context_annotations": [{"domain": {"id": "29", "name": "Events [Entity Service]", "description": "Entity Service related Events domain"}, "entity": {"id": "973328664971567105", "name": "Graduation 2018 (Japan)", "description": "Graduation 2018"}}], "lang": "de"}, {"created_at": "2018-04-26T07:51:23.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "989411604017147905", "id": "989411604017147905", "entities": {"hashtags": [{"start": 93, "end": 111, "tag": "berlintraegtkippa"}], "mentions": [{"start": 38, "end": 44, "username": "spdbt", "id": "347792540"}, {"start": 45, "end": 61, "username": "larscastellucci", "id": "17469649"}, {"start": 66, "end": 77, "username": "helgelindh", "id": "454981027"}], "urls": [{"start": 263, "end": 286, "url": "https://t.co/h7XFYF1t4g", "expanded_url": "https://twitter.com/josip_juratovic/status/989411604017147905/photo/1", "display_url": "pic.twitter.com/h7XFYF1t4g"}]}, "attachments": {"media_keys": ["3_989411172674875392"]}, "text": "Gemeinsam mit meinen Kollegen von der @spdbt @larscastellucci und @helgelindh bei der Aktion #berlintraegtkippa. Insgesamt waren erfreulich viele Menschen da - mit Kopfbedeckung oder ohne, aber alle, um Zeichen f\u00fcr Solidarit\u00e4t und gegen Antisemitismus zu setzen. https://t.co/h7XFYF1t4g", "public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 12, "quote_count": 0}, "lang": "de"}, {"referenced_tweets": [{"type": "quoted", "id": "987731315708612608"}], "created_at": "2018-04-25T13:42:00.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "989137453989679106", "id": "989137453989679106", "entities": {"hashtags": [{"start": 135, "end": 153, "tag": "berlintraegtkippa"}], "urls": [{"start": 154, "end": 177, "url": "https://t.co/ojiH2TSq3V", "expanded_url": "https://twitter.com/CJudaicum/status/987731315708612608", "display_url": "twitter.com/CJudaicum/stat\u2026"}]}, "text": "Ich bin dabei heute Abend. Es ist h\u00f6chste Zeit, sich offen gegen die zunehmenden antisemitischen Tendenzen in unserem Land zu stellen. #berlintraegtkippa https://t.co/ojiH2TSq3V", "public_metrics": {"retweet_count": 0, "reply_count": 2, "like_count": 10, "quote_count": 0}, "lang": "de"}, {"created_at": "2018-04-24T13:30:36.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "988772194703544320", "id": "988772194703544320", "entities": {"hashtags": [{"start": 44, "end": 48, "tag": "AfD"}, {"start": 229, "end": 241, "tag": "Behinderung"}], "mentions": [{"start": 123, "end": 132, "username": "Paritaet", "id": "19070229"}], "urls": [{"start": 272, "end": 295, "url": "https://t.co/b37TpU3bSC", "expanded_url": "https://twitter.com/josip_juratovic/status/988772194703544320/photo/1", "display_url": "pic.twitter.com/b37TpU3bSC"}]}, "attachments": {"media_keys": ["3_988771258925010946"]}, "text": "Die Routiniertheit, mit der Abgeordnete der #AfD im Bundestag Grenzen \u00fcberschreiten, ist unertr\u00e4glich. Daher danke ich dem @Paritaet Gesamtverein f\u00fcr den offenen Brief zur diskriminierenden Anfrage der Populisten zu Menschen mit #Behinderung. Er ruft zur Wachsamkeit auf. https://t.co/b37TpU3bSC", "public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 8, "quote_count": 0}, "lang": "de"}, {"created_at": "2018-04-23T14:04:18.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "738731811380076544", "reply_settings": "everyone", "conversation_id": "988418286755991553", "id": "988418286755991553", "attachments": {"media_keys": ["3_988418191360708610"]}, "text": "Update aus Stra\u00dfburg: Heute Nachmittag w\u00e4hlen wir den Vorsitzenden der gemeinsamen Fraktion von Sozialdemokraten und Gr\u00fcnen im @Europarat_DE . https://t.co/jbYsNUErd8", "public_metrics": {"retweet_count