ublic_metrics": {"retweet_count": 9, "reply_count": 4, "like_count": 48, "quote_count": 0}, "lang": "de"}, {"created_at": "2018-08-27T20:33:01.000Z", "source": "Twitter for Android", "possibly_sensitive": false, "author_id": "4097559143", "reply_settings": "everyone", "conversation_id": "1034176981984845830", "id": "1034176981984845830", "entities": {"hashtags": [{"start": 163, "end": 169, "tag": "c2708"}, {"start": 170, "end": 179, "tag": "Chemnitz"}]}, "text": "Ein Mensch ist gestorben. Das ist Grund zu Trauer und kein Vorwand f\u00fcr Hass, Gewalt und Hetze. So etwas darf in unserer Gesellschaft nie wieder einen Platz haben.\u00a0#c2708\u00a0#Chemnitz", "public_metrics": {"retweet_count": 245, "reply_count": 468, "like_count": 1480, "quote_count": 86}, "lang": "de"}, {"created_at": "2018-08-27T08:34:45.000Z", "source": "Twitter for iPhone", "possibly_sensitive": false, "author_id": "516783036", "reply_settings": "everyone", "conversation_id": "1033996224783949824", "id": "1033996224783949824", "entities": {"hashtags": [{"start": 267, "end": 276, "tag": "Chemnitz"}]}, "text": "Gr\u00f6nemeyer trifft den Nagel auf den Kopf: \u201eDas Land ist nerv\u00f6s, die Zeiten sind nerv\u00f6s und wir m\u00fcssen lernen, Haltung zu zeigen, den Mund aufzumachen und laut zu werden, richtig laut zu werden, damit die rechte Szene merkt: Das ist hier nicht gewollt.\u201c\nZ.B. heute in #Chemnitz!", "public_metrics": {"retweet_count": 196, "reply_count": 95, "like_count": 869, "quote_count": 15}, "lang": "de"}, {"referenced_tweets": [{"type": "replied_to", "id": "1034049961716068352"}], "created_at": "2018-08-27T12:15:29.000Z", "in_reply_to_user_id": "738731811380076544", "source": "Twitter for iPhone", "possibly_sensitive": false, "author_id": "2739915932", "reply_settings": "everyone", "conversation_id": "1032536176400449536", "id": "1034051775425380352", "text": "@josip_juratovic @MartinRosemann Das habe ich Anfang Mai schon von Ihnen geh\u00f6rt.ich habe verschiedene Bundestags