aktion) ,@josip_juratovic (@spdbt), @katrin_staffler (@csu_bt) und E. Winkelmeier-Becker (@CDU)  @cducsubt https://t.co/JEDSWKEbqR", "public_metrics": {"retweet_count": 5, "reply_count": 0, "like_count": 15, "quote_count": 2}, "lang": "de"}, {"created_at": "2018-06-07T16:19:51.000Z", "source": "Twitter Ads", "possibly_sensitive": false, "author_id": "347792540", "reply_settings": "everyone", "conversation_id": "1004759852479115264", "id": "1004759852479115264", "attachments": {"media_keys": ["13_1004758680720543746"]}, "text": "Wenn in Mietsh\u00e4usern Balkone oder Aufz\u00fcge eingebaut werden, nutzen Vermieter das oft f\u00fcr satte Aufschl\u00e4ge. Oft k\u00f6nnen sich Mieterinnen und Mieter ihre Wohnung dann nicht mehr leisten. Wir helfen ihnen. @Johannes_SPD erkl\u00e4rt die Pl\u00e4ne. https://t.co/OcifyEghhU", "public_metrics": {"retweet_count": 10, "reply_count": 14, "like_count": 38, "quote_count": 6}, "entities": {"mentions": [{"start": 202, "end": 215, "username": "Johannes_SPD", "id": "838545322360057857"}], "urls": [{"start": 235, "end": 258, "url": "https://t.co/OcifyEghhU", "expanded_url": "https://twitter.com/spdbt/status/1004759852479115264/video/1", "display_url": "pic.twitter.com/OcifyEghhU"}]}, "lang": "de"}, {"created_at": "2018-06-07T11:13:51.000Z", "source": "Twitter for iPad", "possibly_sensitive": false, "author_id": "20877217", "reply_settings": "everyone", "conversation_id": "1004682848270417923", "id": "1004682848270417923", "text": "Alle Menschen, die z.B. aus Frust \u00fcber unbezahlbare Wohnungen AfD w\u00e4hlen, empfehle ich, die eben zu Ende gegangene AfD-Rede zum Thema anzuh\u00f6ren: Die AfD will mehr Rechte f\u00fcr die Vermieter und weniger Schutz f\u00fcr Mieter. Und bis 2016 laut AfD keine Probleme auf dem Wohnungsmarkt!!!", "public_metrics": {"retweet_count": 272, "reply_count": 60, "like_count": 601, "quote_count": 14}, "lang": "de"}, {"created_at": "2018-06-08T06:16:26.000Z", "source": "Twitter for iPhone", "possibly_sensitive": false, "author_id": "494809842", "reply_settings": "everyone", "conversation_id": "1004970386742800385", "id": "1004970386742800385", "entities": {"hashtags": [{"start": 31, "end": 38, "tag": "Europa"}, {"start": 142, "end": 153, "tag": "Bundestags"}], "mentions": [{"start": 47, "end": 61, "username": "EuropaUnionDE", "id": "59458561"}, {"start": 206, "end": 212, "username": "spdbt", "id": "347792540"}, {"start": 253, "end": 262, "username": "MiRo_SPD", "id": "1114675538"}, {"start": 263, "end": 279, "username": "josip_juratovic", "id": "738731811380076544"}], "urls": [{"start": 280, "end": 303, "url": "https://t.co/CQB6w6zjjM", "expanded_url": "https://twitter.com/Timon_Gremmels/status/1004970386742800385/photo/1", "display_url": "pic.twitter.com/CQB6w6zjjM"}]}, "geo": {"place_id": "0952aa2b3b967000"}, "attachments": {"media_keys": ["3_1004970381801861121"]}, "text": "Der erste Termin des Tages ist #Europa und der @EuropaUnionDE gewidmet. Heute konstituiert sich die Parlamentariergruppe der Europa-Union des #Bundestags. Das europ\u00e4ische Projekt ist aktueller denn je. Die @spdbt ist gut vertreten. U.a mit @jojoschraps @MiRo_SPD @josip_juratovic https://t.co/CQB6w6zjjM", "public_metrics": {"retweet_count": 3, "reply_count": 0, "like_count": 13, "quote_count": 1}, "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855409238318882816", "name": "Europe", "description": "Europa"}}], "lang": "de"}, {"created_at": "2018-06-03T20:12:38.000Z", "source": "FAZ.NET", "possibly_sensitive": false, "author_id": "24274741", "reply_settings": "everyone", "conversation_id": "1003368885909901314", "id": "1003368885909901314", "text": "Dass inzwischen jeder vierte Fl\u00fcchtling einen Beruf aus\u00fcbt, geht nicht nur gegen die Prognose, dass die erste gefl\u00fcchtete Generation keine Chance habe. Die Zahlen belegen auch einen ganz anderen wichtigen Trend. https://t.co/cyJxnE5s6X"