urce": "erased6981162", "possibly_sensitive": false, "author_id": "467321087", "reply_settings": "everyone", "conversation_id": "999964823160049664", "id": "999964823160049664", "entities": {"hashtags": [{"start": 35, "end": 44, "tag": "Toleranz"}, {"start": 49, "end": 60, "tag": "Demokratie"}, {"start": 174, "end": 181, "tag": "Giffey"}, {"start": 217, "end": 233, "tag": "DemokratieLeben"}], "urls": [{"start": 252, "end": 275, "url": "https://t.co/9yAOJuVYOX", "expanded_url": "http://www.demokratie-leben.de", "display_url": "demokratie-leben.de"}, {"start": 276, "end": 299, "url": "https://t.co/7ojYNsRg7X", "expanded_url": "https://twitter.com/BMFSFJ/status/999964823160049664/photo/1", "display_url": "pic.twitter.com/7ojYNsRg7X"}]}, "attachments": {"media_keys": ["3_999964820274282496"]}, "text": "Wir unterst\u00fctzen die, die sich f\u00fcr #Toleranz und #Demokratie und gegen Rassismus und Extremismus einsetzen. Wir k\u00fcmmern uns um die K\u00fcmmerer. Deshalb hat Ministerin Franziska #Giffey heute verk\u00fcndet, dass das Programm #DemokratieLeben! entfristet wird. https://t.co/9yAOJuVYOX https://t.co/7ojYNsRg7X", "public_metrics": {"retweet_count": 38, "reply_count": 15, "like_count": 106, "quote_count": 12}, "lang": "de"}, {"created_at": "2018-05-24T06:03:43.000Z", "source": "Twitter Web Client", "possibly_sensitive": false, "author_id": "2473899462", "reply_settings": "everyone", "conversation_id": "999531371214393344", "id": "999531371214393344", "entities": {"hashtags": [{"start": 110, "end": 115, "tag": "Roth"}, {"start": 124, "end": 129, "tag": "Hass"}, {"start": 209, "end": 219, "tag": "Verrohung"}], "urls": [{"start": 242, "end": 265, "url": "https://t.co/W9OKoQP3cY", "expanded_url": "http://faktenfinder.tagesschau.de/inland/kampagnen-roth-101.html", "display_url": "faktenfinder.tagesschau.de/inland/kampagn\u2026"}]}, "text": "Man muss sie nicht m\u00f6gen und kann inhaltlich einige, viele oder auch alle Positionen kritisieren; was Claudia #Roth aber an #Hass und H\u00e4me einstecken muss, ist krass - und zeigt, wie allt\u00e4glich die politische #Verrohung bereits geworden ist. https://t.co/W9OKoQP3cY", "public_metrics": {"retweet_count": 126, "reply_count": 48, "like_count": 391, "quote_count": 9}, "lang": "de"}, {"created_at": "2018-05-23T12:31:02.000Z", "source": "TweetDeck", "possibly_sensitive": false, "author_id": "4097559143", "reply_settings": "everyone", "conversation_id": "999266452472520704", "id": "999266452472520704", "entities": {"hashtags": [{"start": 23, "end": 35, "tag": "Grundgesetz"}, {"start": 99, "end": 102, "tag": "GG"}, {"start": 139, "end": 159, "tag": "TagdesGrundgesetzes"}, {"start": 230, "end": 242, "tag": "Rechtsstaat"}, {"start": 247, "end": 258, "tag": "Demokratie"}], "urls": [{"start": 268, "end": 291, "url": "https://t.co/oqqLOuDs2H", "expanded_url": "https://twitter.com/katarinabarley/status/999266452472520704/video/1", "display_url": "pic.twitter.com/oqqLOuDs2H"}]}, "attachments": {"media_keys": ["7_999266257990963200"]}, "text": "Herzlichen Gl\u00fcckwunsch #Grundgesetz! \ud83c\udf89 Heute vor 69 Jahren verk\u00fcndete der Parlamentarische Rat das #GG - Grundlage unserer Demokratie. Zum #TagdesGrundgesetzes m\u00f6chte ich einen wichtigen Artikel hervorheben - Art. 79 Abs. 3 - der #Rechtsstaat und #Demokratie sichert. https://t.co/oqqLOuDs2H", "public_metrics": {"retweet_count": 79, "reply_count": 43, "like_count": 310, "quote_count": 11}, "lang": "de"}, {"created_at": "2018-05-17T14:51:27.000Z", "source": "Twitter Ads", "possibly_sensitive": false, "author_id": "347792540", "reply_settings": "everyone", "conversation_id": "997127460805332995", "id": "997127460805332995", "attachments": {"media_keys": ["13_997125813794496518"]}, "text": "Damit es jedes Kind packt: Franziska Giffey wird mit dem Gute-Kita-Gesetz f\u00fcr mehr Qualit\u00e4t und weniger Geb\u00fchren in der Kinderbetreuung sorgen - und k\u00fcndigt eine Initiative f\u00fcr bessere Arbeitsbedingungen von Erzieherinn