"quoted", "id": "968014002134704128"}], "text": "Heute Nacht wird es noch eisiger als in den N\u00e4chten zuvor. F\u00fcr Wohnungslose, die im Freien \u00fcbernachten m\u00fcssen, bedeutet das Erfrierungsgefahr. In #Heilbronn hilft die @AufbaugildeHN mit Schlafpl\u00e4tzen in der Neckarhalde 21. https://t.co/5a7IChYEua", "id": "968511072180342785", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 4, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2018-02-26T14:50:57.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "968136306424414208", "referenced_tweets": [{"type": "quoted", "id": "968110665201315841"}], "text": "Vielen Dank an alle, die gekommen sind. Es war ein wichtiges Zeichen. #Heilbronn #Mitmenschlichkeit #Solidarit\u00e4t https://t.co/yj3c0EskGs", "id": "968136306424414208", "author_id": "738731811380076544", "entities": {"urls": [{"start": 113, "end": 136, "url": "https://t.co/yj3c0EskGs", "expanded_url": "https://twitter.com/ngrheilbronn/status/968110665201315841", "display_url": "twitter.com/ngrheilbronn/s\u2026"}], "hashtags": [{"start": 70, "end": 80, "tag": "Heilbronn"}, {"start": 81, "end": 99, "tag": "Mitmenschlichkeit"}, {"start": 100, "end": 112, "tag": "Solidarit\u00e4t"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 4, "quote_count": 1}, "reply_settings": "everyone", "attachments": {"media_keys": ["3_966590288755089408"]}, "entities": {"mentions": [{"start": 138, "end": 151, "username": "stimmeonline", "id": "26986638"}, {"start": 153, "end": 159, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 171, "end": 194, "url": "https://t.co/KWK7j8XD1X", "expanded_url": "https://twitter.com/josip_juratovic/status/966600428778655744/photo/1", "display_url": "pic.twitter.com/KWK7j8XD1X"}], "hashtags": [{"start": 104, "end": 114, "tag": "Heilbronn"}]}, "created_at": "2018-02-22T09:07:55.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "966600428778655744", "text": "Mein offener Brief an die Heilbronnerinnen und Heilbronner nach der Messerattacke auf dem Marktplatz in #Heilbronn, ver\u00f6ffentlicht in der @stimmeonline. @spdbt @SPDBadEms https://t.co/KWK7j8XD1X", "id": "966600428778655744", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2018-02-21T16:45:42.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "966353245512839171", "text": "Nach der Messerattacke auf junge Gefl\u00fcchtete auf dem Marktplatz in #Heilbronn hier mein offener Brief an die Heilbronnerinnen und Heilbronner mit dem Ziel gemeinsam und besonnen die Lage zu entsch\u00e4rfen: https://t.co/mHpZjk9dbq", "id": "966353245512839171", "author_id": "738731811380076544", "entities": {"urls": [{"start": 203, "end": 226, "url": "https://t.co/mHpZjk9dbq", "expanded_url": "http://www.stimme.de/heilbronn/nachrichten/region/Nach-Messerattacke-Juratovic-ruft-zu-Besonnenheit-auf;art140897,3989395", "display_url": "stimme.de/heilbronn/nach\u2026"}], "hashtags": [{"start": 67, "end": 77, "tag": "Heilbronn"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 3, "quote_count": 0}, "reply_settings": "everyone", "entities": {"mentions": [{"start": 192, "end": 205, "username": "ngrheilbronn", "id": "4266927844"}], "urls": [{"start": 226, "end": 249, "url": "https://t.co/yfksUgzhP8", "expanded_url": "https://twitter.com/ngrheilbronn/status/966209384232648704", "display_url": "twitter.com/ngrheilbronn/s\u2026"}], "hashtags": [{"start": 108, "end": 118, "tag": "Heilbronn"}]}, "created_at": "2018-02-21T14:08:51.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "966313773224087552", "referenced_tweets": [{"type": "quoted", "id": "966209384232648704"}], "text": "Ich bin am Freitag dabei. Nach dem Messerangriff eines Mannes auf drei Gefl\u00fcchtete vor der Kilianskirche in #Heilbronn gilt es, ein Zeichen zu setzen f\u00fcr Solidarit\u00e4t und Menschlichkeit. Danke @ngrheilbronn f\u00fcr die Initiative. https://t.co/yfksUgzhP8", "id": "966313773224087552", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 3, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2018-02-20T12:07:58.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "965920962351902720", "text": "Das Motiv war Fremdenhass. \nNach Wochen polarisierender Diskussionen sticht ein 70-j\u00e4hriger drei junge M\u00e4nner auf dem #Kiliansplatz nieder. K\u00f6nnen wir bitte alle wieder zur Besinnung kommen? #Heilbronn darf seine Menschlichkeit nicht verlieren. \nhttps://t.co/zEIw0SKvq5", "id": "965920962351902720", "author_id": "738731811380076544", "entities": {"urls": [{"start": 246, "end": 269, "url": "https://t.co/zEIw0SKvq5", "expanded_url": "http://www.spiegel.de/panorama/justiz/heilbronn-mann-attackiert-fluechtlinge-vor-kirche-zorn-ueber-fluechtlingspolitik-a-1194354.html", "display_url": "spiegel.de/panorama/justi\u2026", "status": 200, "unwound_url": "https://www.spiegel.de/panorama/justiz/heilbronn-mann-attackiert-fluechtlinge-vor-kirche-zorn-ueber-fluechtlingspolitik-a-1194354.html"}], "hashtags": [{"start": 118, "end": 131, "tag": "Kiliansplatz"}, {"start": 191, "end": 201, "tag": "Heilbronn"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 128, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "entities": {"mentions": [{"start": 3, "end": 13, "username": "HeikoMaas", "id": "24158261"}]}, "created_at": "2018-02-16T10:44:43.000Z", "source": "Twitter Web App", "lang": "de", "conversation_id": "964450464174522368", "referenced_tweets": 