"id": "938724094358499329"}], "text": "RT @RYCOwb: \"People in the Western Balkans do not hate each other. They are feeling afraid and because of that they are trying to avoid thi\u2026", "id": "939069256775491584", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2017-12-06T12:30:10.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "938385071639351301", "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855410081906556930", "name": "Germany", "description": "Germany"}}], "text": "Gibt es zu wenig #Abschiebungen? Eine Studie zeigt: In diesem Jahr haben bereits mehr abgelehnte Asylbewerber Deutschland verlassen, als im gleichen Zeitraum \"ausreisepflichtig\" geworden sind. https://t.co/TVbrIxRJHa", "id": "938385071639351301", "author_id": "738731811380076544", "entities": {"urls": [{"start": 193, "end": 216, "url": "https://t.co/TVbrIxRJHa", "expanded_url": "https://mediendienst-integration.de/artikel/gibt-es-zu-wenige-abschiebungen-abgelehnte-asylbewerber-ausreisepflichtige.html", "display_url": "mediendienst-integration.de/artikel/gibt-e\u2026"}], "hashtags": [{"start": 17, "end": 31, "tag": "Abschiebungen"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 1, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2017-12-05T15:36:36.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "938069604231983105", "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855410510082080770", "name": "Berlin", "description": "Berlin"}}], "text": "Ich konzentriere meine Kraft darauf, #Heilbronn &amp; Heilbronner Land in Berlin zu vertreten. Derweil mache ich im Kreisverband den Weg frei f\u00fcr die Jungen: Herzlichen Gl\u00fcckwunsch Markus Herrera Torrez zum Kreisvorsitz der #SPD Heilbronn! #SPDerneuern https://t.co/bbRsPjyJU8", "id": "938069604231983105", "author_id": "738731811380076544", "entities": {"urls": [{"start": 253, "end": 276, "url": "https://t.co/bbRsPjyJU8", "expanded_url": "http://www.stimme.de/heilbronn/nachrichten/region/Generationenwechsel-bei-der-Heilbronner-Kreis-SPD;art140897,3949491", "display_url": "stimme.de/heilbronn/nach\u2026"}], "hashtags": [{"start": 37, "end": 47, "tag": "Heilbronn"}, {"start": 224, "end": 228, "tag": "SPD"}, {"start": 240, "end": 252, "tag": "SPDerneuern"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 3, "reply_count": 1, "like_count": 2, "quote_count": 0}, "reply_settings": "everyone", "entities": {"mentions": [{"start": 201, "end": 212, "username": "ARDOzsvath", "id": "1564079354"}], "urls": [{"start": 213, "end": 236, "url": "https://t.co/dR5EPVlI3h", "expanded_url": "https://www.inforadio.de/programm/schema/sendungen/forum/201712/180405.html", "display_url": "inforadio.de/programm/schem\u2026"}], "hashtags": [{"start": 4, "end": 7, "tag": "EU"}, {"start": 34, "end": 45, "tag": "Westbalkan"}, {"start": 69, "end": 89, "tag": "Beitrittskandidaten"}]}, "created_at": "2017-12-01T13:08:40.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "936582823485505537", "text": "Der #EU fehlt ein Konzept f\u00fcr den #Westbalkan und die Ann\u00e4herung der #Beitrittskandidaten stockt. Wir haben leidenschaftlich dar\u00fcber diskutiert. Nachzuh\u00f6ren am Sonntag um 11:00 Uhr auf @rbbinforadio . @ARDOzsvath https://t.co/dR5EPVlI3h", "id": "936582823485505537", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 1, "reply_count": 1, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "entities": {"mentions": [{"start": 46, "end": 59, "username": "stimmeonline", "id": "26986638"}, {"start": 148, "end": 154, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 155, "end": 178, "url": "https://t.co/ngqxqsNgSH", "expanded_url": "http://www.stimme.de/heilbronn/nachrichten/region/Was-nun-SPD;art140897,3948118", "display_url": "stimme.de/heilbronn/nach\u2026", "status": 200, "unwound_url": "https://www.stimme.de/regional/region/was-nun-spd-art-3948118"}], "hashtags": [{"start": 120, "end": 124, "tag": "SPD"}, {"start": 135, "end": 147, "tag": "SPDerneuern"}]}, "created_at": "2017-12-01T10:29:59.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "936542890704093185", "text": "Pers\u00f6nlich und politisch: Im Gespr\u00e4ch mit der @stimmeonline habe ich mich zur Stimmung an der Basis und zum Zustand der #SPD ge\u00e4u\u00dfert. #SPDerneuern @spdbt https://t.co/ngqxqsNgSH", "id": "936542890704093185", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 1}, "reply_settings": "everyone", "created_at": "2017-11-28T11:12:05.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "935466319276859394", "referenced_tweets": [{"type": "quoted", "id": "935460653749473285"}], "text": "Gute Besserung #andreashollstein. Und was f\u00fcr eine Haltung: Obwohl sein Mitgef\u00fchl und seine N\u00e4chstenliebe mit Gewalt quittiert wurden, wird er darin nicht nachlassen. #Altena #keinPlatzf\u00fcrrechteGewalt https://t.co/sKl2D8HNFd", "id": "935466319276859394", "author_id": "738731811380076544", "entities": {"urls": [{"start": 201, "end": 224, "url": "https://t.co/sKl2D8HNFd", "expanded_url": "https://twitter.com/FlorianFlade/status/935460653749473285", "display_url": "twitter.com/FlorianFlade/s\u2026"}], "hashtags": [{"start": 15, "end": 32, "tag": "andreashollstein"}, {"start": 167, "end": 174, "tag": "Altena"}, {"start": 175, "end": 200, "tag": "keinPlatzf\u00fcrrechteGewalt"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 37, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "entities": {"mentions": [{"start": 3, "end": 12, "username": "ZDFheute", "id": "1101354170"}], "hashtags": [{"start": 14, "end": 21, "tag": "Altena"}, {"start": 92, "end": 102, "tag": "Hollstein"}]}, "created_at": "2017-11-28T09:57:21.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "935447510834925568", "referenced_tweets": [{"type": "retweeted", "id": "935393886402482176"}], "text": "RT @ZDFheute: #Altena | Bundesjustizminister Heiko Maas w\u00fcnschte dem Altenaer B\u00fcrgermeister #Hollstein gute Besserung und verurteilte den #\u2026", "id": "935447510834925568", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 0, "quote_count": 0}, "reply_settings": "everyone", "entities": {"mentions": [{"start": 205, "end": 211, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 212, "end": 235, "url": "https://t.co/J4FTnIyxOl", "expanded_url": "https://www.vorwaerts.de/artikel/mdb-josip-juratovic-eigentlich-wissen-sozialdemokraten-worauf-ankommt", "display_url": "vorwaerts.de/artikel/mdb-jo\u2026"}], "hashtags": [{"start": 19, "end": 23, "tag": "SPD"}, {"start": 29, "end": 35, "tag": "GroKo"}, {"start": 192, "end": 204, "tag": "SPDerneuern"}]}, "created_at": "2017-11-27T08:42:05.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "935066185292533766", "text": "Die Mitglieder der #SPD \u00fcber #GroKo entscheiden zu lassen, ist der richtige Weg, denn: Die Basis hat einen sehr guten Instinkt, f\u00fcr sozialdemokratische Werte und politische Ungerechtigkeiten. #SPDerneuern @spdbt https://t.co/J4FTnIyxOl", "id": "935066185292533766", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 1, "reply_count": 3, "like_count": 2, "quote_count": 0}, "reply_settings": "everyone", "attachments": {"media_keys": ["3_933315000831234048"]}, "entities": {"mentions": [{"start": 219, "end": 225, "username": "spdbt", "id": "347792540"}], "urls": [{"start": 190, "end": 213, "url": "https://t.co/iUOBh4pol6", "expanded_url": "http://www.bundestag.de/", "display_url": "bundestag.de"}, {"start": 246, "end": 269, "url": "https://t.co/2n4NK7Mayw", "expanded_url": "https://twitter.com/josip_juratovic/status/933315734251417600/photo/1", "display_url": "pic.twitter.com/2n4NK7Mayw"}], "hashtags": [{"start": 0, "end": 7, "tag": "Syrien"}, {"start": 84, "end": 99, "tag": "AfDimBundestag"}, {"start": 214, "end": 218, "tag": "SPD"}, {"start": 226, "end": 238, "tag": "Fluechtling"}, {"start": 239, "end": 245, "tag": "krieg"}]}, "created_at": "2017-11-22T12:46:25.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "933315734251417600", "text": "#Syrien ist nicht sicher und die humanit\u00e4re Lage katastrophal. Trotzdem fordert die #AfDimBundestag ein \"Abkommen zur R\u00fcckkehr syrischer Fl\u00fcchtlinge\". Meine Rede dazu heute ab 15:45 Uhr auf https://t.co/iUOBh4pol6 #SPD @spdbt #Fluechtling #krieg https://t.co/2n4NK7Mayw", "id": "933315734251417600", "author_id": "738731811380076544", "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 7, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2017-11-20T11:02:21.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "932564765674803200", "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "864414756936888320", "name": "Jamaica", "description": "Jamaica"}}], "text": "Unverantwortlich, dass #Lindner in seiner Profilierungssucht sogar bereit war, Koalitionsverhandlungen platzen zu lassen. Bei allem Verst\u00e4ndnis f. Bef\u00fcrchtung eines kleineren Koalitionspartners: Wir haben 2013 auch Kompromisse schlie\u00dfen m\u00fcssen u. dennoch Erfolge erzielt. #Jamaika", "id": "932564765674803200", "author_id": "738731811380076544", "entities": {"hashtags": [{"start": 23, "end": 31, "tag": "Lindner"}, {"start": 272, "end": 280, "tag": "Jamaika"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 2, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2017-11-15T09:32:01.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "930730094343180288", "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855410081906556930", "name": "Germany", "description": "Germany"}}, {"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "864414756936888320", "name": "Jamaica", "description": "Jamaica"}}], "referenced_tweets": [{"type": "quoted", "id": "930700081216581632"}], "text": "Die Themen, auf die es wirklich ankommt, kommen bei den #Sondierungen der #schwarzenAmpel gar nicht vor. #Jamaika #blind https://t.co/bFdfDql31u", "id": "930730094343180288", "author_id": "738731811380076544", "entities": {"urls": [{"start": 121, "end": 144, "url": "https://t.co/bFdfDql31u", "expanded_url": "https://twitter.com/MFratzscher/status/930700081216581632", "display_url": "twitter.com/MFratzscher/st\u2026"}], "hashtags": [{"start": 56, "end": 69, "tag": "Sondierungen"}, {"start": 74, "end": 89, "tag": "schwarzenAmpel"}, {"start": 105, "end": 113, "tag": "Jamaika"}, {"start": 114, "end": 120, "tag": "blind"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 0, "like_count": 2, "quote_count": 0}, "reply_settings": "everyone", "attachments": {"media_keys": ["3_930418073533808640"]}, "created_at": "2017-11-14T13:58:30.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "930434770433126401", "text": "Sie sind herzlich eingeladen: Meine 1. #B\u00fcrgersprechstunde in dieser Leg.Periode findet heute arbeitnehmerfreundlich von 17 - 20 Uhr statt. Wenn Sie ein Anliegen haben, melden Sie sich gerne vorab in meinem Wahlkreisb\u00fcro in #Heilbronn: josip.juratovic.wk@bundestag.de. https://t.co/WwsfNDiLIU", "id": "930434770433126401", "author_id": "738731811380076544", "entities": {"urls": [{"start": 269, "end": 292, "url": "https://t.co/WwsfNDiLIU", "expanded_url": "https://twitter.com/josip_juratovic/status/930434770433126401/photo/1", "display_url": "pic.twitter.com/WwsfNDiLIU"}], "hashtags": [{"start": 39, "end": 58, "tag": "B\u00fcrgersprechstunde"}, {"start": 224, "end": 234, "tag": "Heilbronn"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 5, "quote_count": 0}, "reply_settings": "everyone", "created_at": "2017-11-14T08:36:54.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "930353837067702276", "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "864414756936888320", "name": "Jamaica", "description": "Jamaica"}}], "text": "Die Forderung nach einer #Flexibilisierung geht an der Arbeitswirklichkeit vorbei. Die Menschen sind schon flexibel, und es wird ohnehin immer mehr Arbeit auf weniger Schultern verteilt. #zynisch #Jamaika #FDP", "id": "930353837067702276", "author_id": "738731811380076544", "entities": {"hashtags": [{"start": 25, "end": 42, "tag": "Flexibilisierung"}, {"start": 187, "end": 195, "tag": "zynisch"}, {"start": 196, "end": 204, "tag": "Jamaika"}, {"start": 205, "end": 209, "tag": "FDP"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 8, "quote_count": 1}, "reply_settings": "everyone", "created_at": "2017-11-14T08:21:15.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "930349897169227777", "text": "Nicht vergessen: Ab 10 Uhr bin ich auf dem Kiliansplatz in #Heilbronn, um mit Ihnen ins #Gespr\u00e4ch zu kommen. Ich freue mich darauf! #dialogspdbt", "id": "930349897169227777", "author_id": "738731811380076544", "entities": {"hashtags": [{"start": 59, "end": 69, "tag": "Heilbronn"}, {"start": 88, "end": 97, "tag": "Gespr\u00e4ch"}, {"start": 132, "end": 144, "tag": "dialogspdbt"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 1, "reply_count": 0, "like_count": 8, "quote_count": 0}, "reply_settings": "everyone", "attachments": {"media_keys": ["3_928986867302850562"]}, "created_at": "2017-11-10T14:05:30.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "928986980104499200", "text": "#Rausgehen und #Reden ist die Devise bei der Aktion \"SPD Fraktion im Dialog\". Ich bin am Dienstag parallel zum Wochenmarkt in #Heilbronn auf dem Kiliansplatz dabei und freue mich, mit vielen ins Gespr\u00e4ch zu kommen.  #dialogspdbt https://t.co/VRaKujA7Rn", "id": "928986980104499200", "author_id": "738731811380076544", "entities": {"urls": [{"start": 229, "end": 252, "url": "https://t.co/VRaKujA7Rn", "expanded_url": "https://twitter.com/josip_juratovic/status/928986980104499200/photo/1", "display_url": "pic.twitter.com/VRaKujA7Rn"}], "hashtags": [{"start": 0, "end": 10, "tag": "Rausgehen"}, {"start": 15, "end": 21, "tag": "Reden"}, {"start": 126, "end": 136, "tag": "Heilbronn"}, {"start": 216, "end": 228, "tag": "dialogspdbt"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 0, "reply_count": 1, "like_count": 7, "quote_count": 0}, "reply_settings": "everyone", "attachments": {"media_keys": ["3_928591890705993728", "3_928592193564135424"]}, "created_at": "2017-11-09T11:59:54.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "928592984207224832", "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855410081906556930", "name": "Germany", "description": "Germany"}}], "text": "Der #Mauerfall hat Dank vieler mutiger Menschen der friedlichen Revolution nicht nur Deutschland geeint, sondern das Friedensprojekt #EU erm\u00f6glicht. Dies gilt es gerade heute f\u00fcr uns Deutsche gegen Euroskeptiker aller Art mit aller Kraft zu verteidigen. https://t.co/WBzLdri5tU", "id": "928592984207224832", "author_id": "738731811380076544", "entities": {"urls": [{"start": 254, "end": 277, "url": "https://t.co/WBzLdri5tU", "expanded_url": "https://twitter.com/josip_juratovic/status/928592984207224832/photo/1", "display_url": "pic.twitter.com/WBzLdri5tU"}, {"start": 254, "end": 277, "url": "https://t.co/WBzLdri5tU", "expanded_url": "https://twitter.com/josip_juratovic/status/928592984207224832/photo/1", "display_url": "pic.twitter.com/WBzLdri5tU"}], "hashtags": [{"start": 4, "end": 14, "tag": "Mauerfall"}, {"start": 133, "end": 136, "tag": "EU"}]}, "possibly_sensitive": false}, {"public_metrics": {"retweet_count": 2, "reply_count": 0, "like_count": 4, "quote_count": 0}, "reply_settings": "everyone", "attachments": {"media_keys": ["3_928539427902840834"]}, "entities": {"mentions": [{"start": 136, "end": 149, "username": "gorkitheater", "id": "68969255"}, {"start": 160, "end": 173, "username": "Tagesspiegel", "id": "22926365"}], "urls": [{"start": 188, "end": 211, "url": "https://t.co/4KUEG0ggBM", "expanded_url": "https://twitter.com/josip_juratovic/status/928539594479587329/photo/1", "display_url": "pic.twitter.com/4KUEG0ggBM"}], "hashtags": [{"start": 31, "end": 40, "tag": "DieListe"}, {"start": 41, "end": 54, "tag": "Gefl\u00fcchteter"}]}, "created_at": "2017-11-09T08:27:45.000Z", "source": "Twitter Web Client", "lang": "de", "conversation_id": "928539594479587329", "context_annotations": [{"domain": {"id": "13", "name": "Place", "description": "Named places in the world, like Fenway Park"}, "entity": {"id": "855409238318882816", "name": "Europe", "description": "Europa"}}], "text": "Gibt den Menschen eine